(3, 1, 1, 2, '1573031641_1572605766_1549986524.png', 'The European Age of Discovery started with the Portuguese navigators, where Prince Henry the Navigator started a maritime school in Portugal. The resulting of this technical and scientific discoveries led Portugal to develop the most advanced ships, including the Caravel, the Carrack and the Galleon, where for the first time in history maritime navigation was possible. The Portuguese Empire led the Portuguese Kingdom to discover and map most of the Globe, and find seas routes as far as the East and West, such as the remarkable voyage to find the sea route to India via the Cape of Good Hope. Here, we are giving brief accounts on the arrival of Europeans in India for general awareness.\r\n\r\nAdvent of Europeans\r\n\r\nArrival of Portuguese in India\r\n\r\nIt was the Portuguese who first discovered a direct sea route to India. Portuguese sailor Vasco da Gama arrived at Calicut an important sea port located on the South-West India on May 20, 1498 AD. King Zamorin, the local rule received him and bestowed on him certain privileges. After staying in India for a period of three months Vasco da Gama returned with a rich cargo which he sold in the European market at an exorbitant price- 60 times the cost of his voyage.\r\n\r\n\r\nBut soon Vasco da Gama came back to India for the second time in 1501 AD. He set up a trading factory at Cannanore. With establishment of trade links, Calicut, Cannanore and Cochin emerged the significant Portuguese centers in India. Arab traders became jealous of the rise and success of the Portuguese and hence caused enmity bred between the Portuguese and the local king Zamorin. The hostilities grew and led to full- fledged military face- off between them. King Zamorin was defeated by the Portuguese. With the victory over Zamorin, the military superiority of the Portuguese was established.\r\n\r\nRise of Portuguese power In India\r\n\r\nIn 1505 AD, Francisco de Almeida was appointed as the first Portuguese governor in India. His policy being centric to controlling the Indian Ocean was known as the Blue Water Policy. Alfonso de Albuquerque who replaced Almeida as the governor in 1509 AD, and captured Goa from the Sultan of Bijapur in 1510 AD is considered the real founder of the Portuguese power in India. Goa subsequently became the headquarters of the Portuguese settlements in India. Portuguese hold over the coastal areas and superiority in naval power helped them significantly. By the end of the 16th century, the Portuguese captured not only Goa, Daman, Diu, and Salsette but also a vast stretches along the Indian coast.\r\n\r\nDecline of Portuguese Power\r\n\r\nBut the Portuguese rise in Indian had a short life as the new rival trading communities from Europe posed a big challenge to them. Struggle among various rival trading blocs ensued in which Portuguese had to give way to the more powerful and enterprising competitors gradually rendering them an atrophied entity.\r\n\r\nFamous Indian mathematicians from Ancient to Modern India\r\n\r\nArrival of the British\r\nArrival of the British and the establishment of British East India Company was the outcome of the Portuguese traders  who  earn enormous profit by selling their merchandise in India. Being motivated by the successful business stories of the Portuguese a group of English merchants -‘Merchant Adventurers’ formed a company- the East India Company in 1599 AD. The Company received a royal charter from Queen Elizabeth I on December 31, 1600 AD authorizing it to trade in the East. Queen was herself a share holder in the East India Company.\r\nExpansion in West and the South\r\n\r\nSubsequently in 1608 AD, the East India Company sent Captain William Hawkins to the court of the Mughal emperor Jahangir to secure royal patronage. He succeeded in getting royal permit for the Company to establish its factories at various places on the Western coast of India. Then in 1615 AD, Sir Thomas Roe was sent by Emperor James I of England to Jahangir’s court, with a plea for more concession for the Company. Roe was very diplomatic and thus successfully secured a royal charter giving the Company freedom to trade in the whole of the Mughal territory.\r\n\r\nExpansion in the East\r\n\r\nAfter establishing its factories in south and west India, the company started to focus on east India particularly Bengal a significant province Mughal empire. The governor of Bengal Sujauddaula in 1651 AD, allowed the English Company to carry out its trade activities in Bengal. A factory in Hugli was established and three villages -Sutanati, Govindapur and Kolkata- were purchased in 1698 AD by the Company to build a factory over there. Subsequently Fort William was raised in order to provide protection around the factory.\r\n\r\nImportant Battles And Wars In India\r\n\r\nArrival of the Dutch\r\n\r\nThe people of Holland (present Netherlands) are called the Dutch. Next to the Portuguese, the Dutch set their feet in India. Historically the Dutch have been experts in sea trade. In 1602, the United East India Company of the Netherlands was formed and given permission by the Dutch government to trade in the East Indies including India. \r\n\r\nRise of the Dutch\r\n\r\nThe Dutch founded their first factory in Masaulipatam in Andhra Pradesh in 1605. Subsequently they also established trading centres in various parts of India. Dutch Suratte and Dutch Bengal were established in 1616 AD and 1627 AD respectively. The Dutch conquered Ceylon from the Portuguese in 1656 AD. They also took the Portuguese forts on the Malabar coast in 1671 AD. The Dutch gradually became a potent force capturing Nagapatam near Madras (Chennai) from the Portuguese thereby establishing their foothold in South India. In economic terms, they earned huge profit through business monopolizing in black pepper and spices. The major Indian commodities traded by the Dutch were cotton, indigo, silk, rice and opium.\r\n\r\nDutch Coinage\r\n\r\nThe Dutch, during their stay in India, tried their hands on the minting of coinages. As their trade flourished they established mints at Cochin, Masulipattam, Nagapatam Pondicherry and Pulicat. Even more, Gold pagoda with an image of Lord Venkateswara, (god Vishnu) was issued at Pulicat mint. The coins issued by the Dutch were all modelled on the local coinages.\r\n\r\nDecline of Dutch Power\r\n\r\nDutch presence on the Indian subcontinent lasted from 1605 AD to 1825 AD. The rise of the British power in the Eastern trade posed serious challenge to the commercial interest of the Dutch leading to  bloody warfare between them in which Britishers were the clear winners owing to huge resources at their disposal. The brutal killing of some English traders by the Dutch in Amboyna in 1623 further aggravated the situation. The Britishers one after another captured Dutch strongholds.\r\n\r\nHistory of Taxation in India\r\n\r\nArrival of the French\r\nThe last European people to arrive in India were the French. The French East India Company was formed in 1664 AD during the reign of King Louis XIV to trade with India. In 1668 AD the French established their first factory at Surat and in 1669 AD established another French factory at Masaulipatam. In 1673 AD the Mughal Subedar of Bengal allowed the French to set up a township at Chandernagore.\r\n\r\nPondicherry and French Commercial Growth\r\n\r\nIn 1674 AD, the French obtained a village called Pondicherry from the Sultan of Bijapur and founded a thriving city on it which later became the main stronghold of the French in India. The French East India Company with the passage of time developed its trade bastians at Mahe, Karaikal, Balasor, and Qasim Bazar. The French came to India mainly with a purpose of trade and commerce. From their arrival until 1741 AD, the objectives of the French, like those of the British, were purely commercial. The French East India Company took hold of Yanam in 1723 AD, Mahe on Malabar Coast in 1725 AD and Karaikal in 1739 AD.', '(Unit -1)AdventOfEuropeans.mp4', 0, 'Unit - 1', NULL, 'Advent Of Europeans'),
(4, 1, 1, 3, '1573031881_rsz_sepoy_mutinyjpg.png', 'The Anglo-Indian Wars were the several wars fought in India, over a period of time, between the British East India Company and different Indian states, mainly the Marathas, the Sikhs and the Kingdom of Mysore. These wars led to the establishment of British colonial rule in India.\r\n\r\nChild\'s War (1686–1690)\r\nFirst Anglo-Mysore War (1766–1769)\r\nFirst Anglo-Maratha War (1775-1782)\r\nSecond Anglo-Mysore War (1780–1784)\r\nThird Anglo-Mysore War (1789–1792)\r\nFourth Anglo-Mysore War (1798–1799)\r\nSecond Anglo-Maratha War (1803–1805)\r\nAnglo-Gorkha war (1814–1816)\r\nThird Anglo-Maratha War (1817–1818)\r\nFirst Anglo-Sikh War (1845-1846)\r\nSecond Anglo-Sikh War (1848-1849)\r\nAnglo-Kuki War (1917-1919)', '(Unit-2)indo-anlgobritishwar.mp4', 0, 'Unit - 2', NULL, 'Anglo-Indian Wars'),
(5, 1, 1, 4, '1573033125_rsz_4_varnas.png', 'Rammohun Roy:\r\nThe central figure in this awakening was Rammohun Roy, who is rightly regarded as the first great leader of modern India. Rammohun Roy was moved by deep love for his people and country and worked hard all his life for their social, religious, intellectual and political regeneration.\r\n\r\nADVERTISEMENTS:\r\n\r\n\r\n \r\nHe was pained by the stagnation and corruption of contemporary Indian society which was at that time dominated by caste and convention. Popular religion was full of superstitions and was exploited by ignorant and corrupt priests.\r\n\r\nThe upper classes were selfish and often sacrificed social interest to their own narrow interests. Rammohun Roy possessed great love and respect for the traditional philosophic systems of the East; but, at the same time, he believed that modern culture alone would help regenerate Indian society.\r\n\r\nIn particular, he wanted his countrymen to accept the rational and scientific approach and the principle of human dignity and social equality of all men and women. He also wanted the introduction of modern capitalism and industry in the country.\r\n\r\nRammohun Roy represented a synthesis of the thought of East and West. He was a scholar who knew over a dozen languages including Sanskrit, Persian, Arabic, English, French, Latin, Greek and Hebrew. As a young man he had studied Sanskrit literature and Hindu philosophy at Varanasi and the Quran and Persian and Arabic literature at Patna.\r\n\r\nADVERTISEMENTS:\r\n\r\n\r\n \r\nHe was also well-acquainted with Jainism and other religious movements and sects of India. Later he made an intensive study of Western thought and culture. To study the Bible in the original he learnt Greek and Hebrew. In 1809 he wrote in Persian his famous work Gift to Monotheists in which he put forward weighty arguments against belief in many gods and for the worship of a single God.\r\n\r\nHe settled in Calcutta in 1814 and soon attracted a band of young men with whose cooperation he started the Atmiya Sabha. From now on he carried on a persistent struggle against the religious and social evils which were widely prevalent among the Hindus in Bengal. In particular he vigorously opposed their worship of idols, the rigidity of caste, and the prevalence of meaningless religious rituals.\r\n\r\nHe condemned the priestly class for encouraging these practices. He held that all the principal ancient texts of the Hindus preached monotheism or worship of one God. He published the Bengali translation of the Vedas and of five of the principal Upanishads to prove his point. He also wrote a series of tracts and pamphlets in defence of monotheism.\r\n\r\nWhile citing ancient authority for his philosophical views, Rammohun Roy relied ultimately on the power of human reason which was in his view the final touchstone of the truth of any doctrine, Eastern or Western. He believed that the philosophy of Vedanta was based on this principle of reason.\r\n\r\nADVERTISEMENTS:\r\n\r\n\r\n \r\nIn any case, one should not hesitate to depart from holy books, scriptures and inherited traditions if human reason so dictates and if such traditions are proving harmful to the society. But Rammohun Roy did not confine his application of the rational approach to Indian religions and traditions alone.\r\n\r\nIn this he disappointed his many missionary friends who had hoped that his rational critique of Hinduism would lead him to embrace Christianity. Rammohun Roy insisted on applying rationalism to Christianity too, particularly to the elements of blind faith in it.\r\n\r\nIn 1820; he published his Precepts of Jesus in which he tried to separate the moral and philosophic message of the New Testament, which he praised, from its miracle stories. He wanted the high moral message of Christ to be incorporated in Hinduism. This earned for him the hostility of the missionaries.\r\n\r\nThus, as far as Rammohun was concerned there was to be no blind reliance on India’s own past or blind aping of the West. On the other hand, he put forward the idea that new India, guided by reason, should acquire and treasure all that was best in the East and the West.\r\n\r\nThus he wanted India to learn from the West; but this learning was to be an intellectual and creative process through which Indian culture and thought were to be renovated; it was not to be an imposition of Western culture on India. He, therefore, stood for the reform of Hinduism and opposed its supersession by Christianity.\r\n\r\nHe vigorously defended Hindu religion and philosophy from the ignorant attacks of the missionaries. At the same time, he adopted an extremely friendly attitude towards other religions. He believed that basically all religions preach a common message and that their followers are all brothers under the skin.\r\n\r\nAll his life Rammohun Roy paid heavily for his daring religious outlook. The orthodox condemned him for criticising idolatry and for his philosophic admiration of Christianity and Islam. They organised a social boycott against him in which even his mother joined. He was branded a heretic and an outcaste.\r\n\r\nIn 1828, he founded a new religious society, the Brahma Sabha, later known as the Brahmo Samaj, whose purpose was to purify Hinduism and to preach monotheism or belief in one God.\r\n\r\nThe new society was to be based on the twin pillars of reason, and the Vedas and Upanishads. It was also to incorporate the teachings of other religions. The Brahmo Samaj laid emphasis on human dignity, opposed idolatry, and criticised such social evils as the practice of sati.\r\n\r\nRammohun Roy was a great thinker. He was also a man of action. There was hardly any aspect of nation-building which he left untouched. In fact, just as he began the reform of Hindu religion from within, he also laid the foundations for the reform of Indian society.\r\n\r\nThe best example of his life-long crusade against social evils was the historic agitation he organised against the inhuman custom of women becoming sati. Beginning in 1818 he set out to rouse public opinion on the question.\r\n\r\nOn the one hand he showed by citing the authority of the oldest sacred books that the Hindu religion at its best was opposed to the practice; on the other, he appealed to the reason, humanity and compassion of the people. He visited the burning Ghats at Calcutta to try to persuade the relatives of widows to give up their plan of self-immolation.\r\n\r\nHe organised groups of like- minded people to keep a strict check on such performances and to prevent any attempt to force the widows to become sati. When the orthodox Hindus petitioned Parliament to withhold its approval of Bentinck’s action of banning the rite of sati, he organised a counter- petition of enlightened Hindus in favour of Bentinck’s action.\r\n\r\nHe was a stout champion of women’s rights. He condemned the subjugation of women and opposed the prevailing idea that women were inferior to men in intellect or in a moral sense. He attacked polygamy and the degraded state to which widows were often reduced. To raise the status of women he demanded that they be given the right of inheritance and property.\r\n\r\nRammohun Roy was one of the earliest propagators of modern education which he looked upon as a major instrument for the spread of modern ideas in the country.\r\n\r\nIn 1817, David Hare, who had come out to India in 1800 as a watchmaker but who spent his entire life in the promotion of modern education in the country, founded the famous Hindu College. Rammohun Roy gave most enthusiastic assistance to Hare in this and his other educational projects.\r\n\r\nIn addition, he maintained at his own cost an English school in Calcutta from 1817 in which, among other subjects, mechanics and the philosophy of Voltaire were taught. In 1825 he established a Vedanta College in which courses both in Indian learning and in Western social and physical sciences were offered.\r\n\r\nRammohun Roy was equally keen on making Bengali the vehicle of intellectual intercourse in Bengal. He compiled a Bengali grammar. Through his translations, pamphlets and journals he helped evolve a modern and elegant prose style for that language.\r\n\r\nRammohun represented the first glimmerings of the rise of national consciousness in India. The vision of an independent and resurgent India guided his thoughts and actions. He believed that by trying to weed out corrupt elements from Indian religions and society and by preaching the Vedantic message of worship of one God he was laying the foundations for the unity of Indian society which was divided into divergent groups.\r\n\r\nIn particular he opposed the rigidities of the caste system which, he declared, “has been source of want of unity among us”. He believed that the caste system was doubly evil: it created inequality and it divided people and “deprived them of patriotic feeling”. Thus, according to him, one of the aims of religious reform was political uplift.\r\n\r\nRammohun Roy was a pioneer of Indian journalism. He brought out journals in Bengali, Persian, Hindi and English to spread scientific, literary and political knowledge among the people, to educate public opinion on topics of current interest, and to represent popular demands and grievances before the government.\r\n\r\nHe was also the initiator of public agitation on political questions in the country. He condemned the oppressive practices of the Bengal zamindars which had reduced the peasants to a miserable condition. He demanded that the maximum rents paid by the actual cultivators of land should be permanently fixed so that they too would enjoy the benefits of the Permanent Settlement of 1793.\r\n\r\nHe also protested against attempts to impose taxes on tax-free lands. He demanded the abolition of the Company’s trading rights and the removal of heavy export duties on Indian goods. He also raised the demands for the Indianisation of the superior services, separation of the executive and the judiciary, trial by jury, and judicial equality between Indians and Europeans.\r\n\r\nRammohun was a firm believer in internationalism and in free cooperation between nations. The poet, Rabindranath Tagore has rightly remarked:\r\n\r\n“Rammohun was the only person in his time, in the whole world of man, to realise completely the significance of the Modern Age. He knew that the ideal of human civilisation does not lie in the isolation of independence, but in the brotherhood of inter­dependence of individuals as well as nations in all spheres of thought and activity”.\r\n\r\nRammohun Roy took a keen interest in international events and everywhere he supported the cause of liberty, democracy, and nationalism and opposed injustice, oppression and tyranny in every form. The news of the failure of the Revolution in Naples in 1821 made him so sad that he cancelled all his social engagements.\r\n\r\nOn the other hand, he celebrated the success of the Revolution in Spanish America in 1823 by giving a public dinner. He condemned the miserable condition of Ireland under the oppressive regime of absentee English landlordism. He publicly declared that he would emigrate from the British Empire if Parliament failed to pass the Reform Bill.\r\n\r\nRammohun was fearless as a lion. He did not hesitate to support a just cause. All his life he fought against social injustice and inequality even at great personal loss and hardship. In his life of service to society he often clashed with his family, with rich zamindars and powerful missionaries, and with high officials and foreign authorities. Yet he never showed fear nor shrank from his chosen course.\r\n\r\nRammohun was the brightest star in the Indian sky during the first half of the nineteenth century, but he was not a lone star. He had many distinguished associates, followers and successors. In the field of education he was greatly helped by the Dutch watchmaker David Hare and the Scottish missionary Alexander Duff.\r\n\r\nDwarkanath Tagore was the foremost of his Indian associates. His other prominent followers were Prasanna Kumar Tagore, Chandrasekhar Deb, and Tarachand Chakravarti, the first secretary of the Brahma Sabha.', '(Unit- 3)Socio-CulturalAweking.mp4', 0, 'Unit - 3', NULL, 'Socio - Cultural Awakening'),
(6, 1, 1, 5, '1573033527_rsz_image.png', 'Peasant movements have a long history that can be traced to the numerous peasant uprisings that occurred in various regions of the world throughout human history. Early peasant movements were usually the result of stresses in the feudal and semi feudal societies, and resulted in violent uprisings. More recent movements, fitting the definitions of social movements, are usually much less violent, and their demands are centered on better prices for agricultural produce, better wages and working conditions for the agricultural laborers, and increasing the agricultural production.\r\n\r\nThe economic policies of British adversely affected the Indian peasants the British Govt. used to protect the landlords and money lenders.they exploited the peasants.The peasants rose in revolt against this injustice on many occasions .The peasants in Bengal formed their union and revolted against the compulsion of cultivating indigo.\r\n\r\nAnthony Pereira, a political scientist, has defined a peasant movement as a \"social movement made up of peasants (small landholders or farm workers on large farms), usually inspired by the goal of improving the situation of peasants in a nation or territory\r\n\r\nPeasant movement in India was arose during the British colonial period, when economic policies characterized in the ruin of traditional handicrafts leading, change of ownership and overcrowding of land, and massive debt and impoverishment of peasantry. This led to peasant uprisings during the colonial period, and development of peasant movements in the post-colonial period. The Kisan Sabha movement started in Bihar under the leadership of Swami Sahajanand Saraswati, who had formed in 1929 the Bihar Provincial Kisan Sabha (BPKS) to mobilise peasant grievances against the zamindari attacks on their occupancy rights. In 1938,the crops in Eastern Khandesh were destroyed due to heavy rains.The peasants were ruined.In order to get the land revenue waived,Sane Guruji organized meetings and processions in many places and took out marches to the Collector\'s office.The peasants joined the revolutionary movement of 1942 in great numbers.  Gradually the peasant movement intensified and spread across the rest of India. All these radical developments on the peasant front culminated in the formation of the All India Kisan Sabha (AIKS) at the Lucknow session of the Indian National Congress in April 1936 with Swami Sahajanand Saraswati elected as its first President.[5] In the subsequent years, the movement was increasingly dominated by Socialists and Communists as it moved away from the Congress, by 1938 Haripura session of the Congress, under the presidency of Netaji Subhas Chandra Bose, the rift became evident, and by May 1942, the Communist Party of India, which was finally legalised by then government in July 1942, had taken over AIKS, all across India including Bengal where its membership grew considerably. \r\n\r\nD. D. Kosambi and R.S. Sharma, together with Daniel Thorner, brought peasants into the study of Indian history for the first time.', '(Unit -4 )PeaseantsMovements.mp4', 0, 'Unit - 4', NULL, 'Peasant Movements '),
(7, 1, 1, 6, '1573033849_1857_Revolt.png', 'The Sepoy Mutiny was a violent and very bloody uprising against British rule in India in 1857. It is also known by other names: the Indian Mutiny, the Indian Rebellion of 1857, or the Indian Revolt of 1857.\r\n\r\nIn Britain and in the West, it was almost always portrayed as a series of unreasonable and bloodthirsty uprisings spurred by falsehoods about religious insensitivity.\r\n\r\nIn India, it has been viewed quite differently. The events of 1857 have been considered the first outbreak of an independence movement against British rule.\r\n\r\nThe uprising was put down, but the methods employed by the British were so harsh that many in the western world were offended. One common punishment was to tie mutineers to the mouth of a cannon and then fire the cannon, completely obliterating the victim.\r\n\r\nA popular American illustrated magazine, \"Ballou\'s Pictorial\", published a full-page woodcut illustration showing the preparations for such an execution in its issue of October 3, 1857. In the illustration, a mutineer was depicted chained to the front of a British cannon, awaiting his imminent execution, as others were gathered to watch the grisly spectacle.\r\n\r\nBackground\r\nBy the 1850s the East India Company controlled much of India. A private company which first entered India to trade in the 1600s, the East India Company had eventually transformed into a diplomatic and military operation.\r\n\r\nLarge numbers of native soldiers, known as sepoys, were employed by the company to maintain order and defend trading centers. The sepoys were generally under the command of British officers.\r\n\r\nIn the late 1700s and early 1800s, sepoys tended to take great pride in their military prowess, and they exhibited enormous loyalty to their British officers. But in the 1830s and 1840s, tensions began to emerge.\r\n\r\nA number of Indians began to suspect that the British intended to convert the Indian population to Christianity. Increasing numbers of Christian missionaries began arriving in India, and their presence gave credence to rumors of impending conversions.\r\n\r\nThere was also a general feeling that English officers were losing touch with the Indian troops under them.\r\n\r\nUnder a British policy called the \"doctrine of lapse,\" the East India Company would take control of Indian states in which a local ruler had died without an heir. The system was subject to abuse, and the company used it to annex territories in a questionable manner.\r\n\r\nAs the East India Company annexed Indian states in the 1840s and 1850s, the Indian soldiers in the company\'s employ began to feel offended.\r\n\r\nA New Type of Rifle Cartridge Caused Problems\r\nThe traditional story of the Sepoy Mutiny is that the introduction of a new cartridge for the Enfield rifle provoked much of the trouble.\r\n\r\nThe cartridges were wrapped in paper, which had been coated in grease which made the cartridges easier to load in rifle barrels. Rumors began to spread that the grease used to make the cartridges was derived from pigs and cows, which would be highly offensive to Muslims and Hindus.\r\n\r\nThere is no doubt that conflict over the new rifle cartridges sparked the uprising in 1857, but the reality is that social, political, and even technological reforms had set the stage for what happened.\r\n\r\n\r\nViolence Spread During the Sepoy Mutiny\r\nOn March 29, 1857, on the parade ground at Barrackpore, a sepoy named Mangal Pandey fired the first shot of the uprising. His unit in the Bengal Army, which had refused to use the new rifle cartridges, was about to be disarmed and punished. Pandey rebelled by shooting a British sergeant-major and a lieutenant.\r\n\r\nIn the altercation, Pandey was surrounded by British troops and shot himself in the chest. He survived and was put on trial and hanged on April 8, 1857.\r\n\r\nAs the mutiny spread, the British began called mutineers \"pandies.\" Pandey, it should be noted, is considered a hero in India, and has been portrayed as a freedom fighter in films and even on an Indian postage stamp.\r\n\r\nMajor Incidents of the Sepoy Mutiny\r\nThroughout May and June 1857 more units of Indian troops mutinied against the British. Sepoy units in the south of India remained loyal, but in the north, many units of the Bengal Army turned on the British. And the uprising became extremely violent.\r\n\r\nParticular incidents became notorious:\r\n\r\nMeerut and Delhi: In a large military camp (called a cantonment) at Meerut, near Delhi, a number of sepoys refused to use the new rifle cartridges in early May 1857. The British stripped them of their uniforms and put them in chains.\r\nOther sepoys revolted on May 10, 1857, and things quickly became chaotic as mobs attacked British civilians, including women and children.Mutineers traveled the 40 miles to Delhi and soon the large city erupted in a violent revolt against the British. A number of British civilians in the city were able to flee, but many were slaughtered. And Delhi remained in rebel hands for months.\r\nCawnpore: A particularly horrific incident known as the Cawnpore Massacre occurred when British officers and civilians, leaving the city of Cawnpore (present day Kanpur) under a flag of surrender was attacked.\r\nThe British men were killed, and about 210 British women and children were taken prisoner. A local leader, Nana Sahib, ordered their death. When sepoys, abiding by their military training, refused to kill the prisoners, butchers were recruited from local bazaars to do the killing.The women, children, and infants were murdered, and their bodies were thrown into a well. When the British eventually took back Cawnpore and discovered the site of the massacre, it inflamed the troops and led to vicious acts of retribution.\r\nLucknow: At the town of Lucknow about 1,200 British officers and civilians fortified themselves against 20,000 mutineers in the summer of 1857. By late September British forces commanded by Sir Henry Havelock succeeded in breaking through.\r\nHowever, Havelock\'s forces did not have the strength to evacuate the British at Lucknow and were forced to join the besieged garrison. Another British column, led by Sir Colin Campbell, eventually fought through to Lucknow and were able to evacuate the women and children, and ultimately the entire garrison.\r\n\r\nThe Indian Revolt of 1857 Brought the End of the East India Company\r\nFighting in some places continued well into 1858, but the British were ultimately able to establish control. As mutineers were captured, they were often killed on the spot, and many were executed in dramatic fashion.\r\n\r\nOutraged by events such as the massacre of women and children at Cawnpore, some British officers believed that hanging mutineers was too humane.\r\n\r\nIn some cases, they used an execution method of lashing a mutineer to the mouth of a cannon, and then firing the cannon and literally blasting the man to pieces. Sepoys were forced to watch such displays as it was believed it set an example of the horrific death that awaited mutineers.\r\n\r\nThe grotesque executions by cannon became even became widely known in America. Along with the previously mentioned illustration in Ballou\'s Pictorial, numerous American newspapers published accounts of the violence in India.\r\n\r\nThe Demise of the East India Company\r\nThe East India Company had been active in India for nearly 250 years, but the violence of the 1857 uprising led to the British government dissolving the company and taking direct control of India.\r\n\r\nFollowing the fighting of 1857–58, India was legally considered a colony of Britain, ruled by a viceroy. The uprising was officially declared over on July 8, 1859.\r\n\r\nLegacy of the Uprising of 1857\r\nThere is no question that atrocities were committed by both sides, and stories of events of 1857–58 lived on in both Britain and India. Books and articles about the bloody fighting and heroic deeds by British officers and men were published for decades in London. Illustrations of events tended to reinforce Victorian notions of honor and bravery.\r\n\r\nAny British plans to reform Indian society, which had been one of the underlying causes of the revolt, were essentially set aside, and religious conversion of the Indian population was no longer viewed as a practical goal.\r\n\r\nIn the 1870s the British government formalized its role as an imperial power. Queen Victoria, at the prompting of Benjamin Disraeli, announced to Parliament that her Indian subjects were \"happy under My rule and loyal to My throne.\"\r\n\r\nVictoria added the title \"Empress of India\" to her royal title. In 1877, outside Delhi, essentially in the spot where bloody fighting had taken place 20 years earlier, an event called the Imperial Assemblage was held. In an elaborate ceremony, Lord Lytton, the serving viceroy of India, honored a number of Indian princes.\r\n\r\nBritain, of course, would rule India well into the 20th century. And when the Indian independence movement gained momentum in the 20th century, events of the Revolt of 1857 were viewed as having been an early battle for independence, while individuals such as Mangal Pandey were hailed as early national heroes.', '(Unit-5)SepoyMutiny.mp4', 0, 'Unit - 5', NULL, 'Sepoy Mutiny '),
(9, 1, 1, 7, '1573035445_1573034282_rsz_national_movement_l.png', 'The Indian National Movement was an organised mass movement concerned with the interests of the people of India and affected by both internal and external factors. It led to the formation of Indian National Congress in 1885 and several revolts broke out across the country. Formation of Muslim League in 1906, Swadeshi Movement 1905 etc. which spearheaded the freedom struggle in India from 1885 to 1947.\r\nSHIKHA GOYAL\r\nAUG 14, 2019 17:55 IST\r\n facebook Iconfacebook Iconfacebook Icon\r\n Summary of Indian National Movement\r\nSummary of Indian National Movement\r\nSummary of Indian National Movement\r\n\r\nIt has been observed that the struggles for Freedom in India had been a merger of a series of Political, Socio-Cultural and Economic factors that led to the rise of Nationalism.\r\n\r\nJagranjosh\r\n\r\nOn 28 December 1885 Indian National Congress (INC) was founded in the premises of Gokuldas Tejpal Sanskrit School at Bombay. It was presided over by W.C Banerjee and attended by 72 delegates. A.O Hume played an instrumental role in the foundation of INC with an aim to provide Safety Valve to the British Government.\r\nA.O Hume served as a first General Secretary of INC.\r\nReal Aim of Congress is to trained the Indian youth in political agitation and to organise or to create public opinion in the country. For this they use the method of annual session where they discuss the problem and passed the resolution.\r\nThe first or early phase of Indian Nationalism is also termed as Moderate Phase (1885-1905). Moderate leaders were W.C Banerjee, Gopal Krishna Gokhale, R.C Dutt, Ferozeshah Mehta, George Yule etc.\r\nModerates have full faith in British Government and adopted PPP path i.e. Protest, Prayer and Petition.\r\nDue to disillusionment from Moderates methods of work, extremism began to develop within the congress after 1892. The Extremist leaders were Lala Lajpat Rai, Bal Gangadhar Tilak, Bipinchandra Pal and Aurobindo Ghosh. Instead of PPP path they emphasise on self-reliance, constructive work and swadeshi.\r\nWith the announcement of Partition of Bengal (1905) by Lord Curzon for administrative convenience, Swadeshi and Boycott resolution was passed in 1905.\r\nCongress Sessions during Swadeshi Movement:\r\n\r\n1. 1905 – Congress session in Banaras. Presided over by Gopal Krishan Gokhale.\r\n2. 1906 – Congress Session in Calcutta. Presided over by Dadabhai Naroji.\r\n3. 1907 – Congress Session in Surat on the bank of the river Tapti. Presided over by Pherozeshah Mehta where due to the differences between Moderates and Extremist first split in Congress occurred.\r\n\r\nMuslim League was founded in 1906 by Agah Khan III and Moshin Mulk.\r\nSeparate electorate was introduced by the Act of 1909 Morley- Minto Reform Act.\r\nGadhar Movement was started by Lala Hardayal in 1913 and founded the Gadhar party on 1st November 1913 at Kotland. Its headquarter was set up in the form of Yugantar Ashram at San Francisco and started the publication of Gadhar Journal.\r\nKomgata Maru incident took place on September 1914 and for this Indians set up a committee named as Shore Committee to fight the legal battle of the passengers.\r\nIn 1914 First World War broke out.\r\nTilak on April 1916 started Home Rule Movement and it’s headquarter was at Poona and demanded Swaraj.\r\nAnnie Besant on September 1916 started Home Rule movement and it’s headquarter was at Adiyar near Madras.\r\nLucknow Session of Congress 1916 presided over by Ambika Charan Majumdar (Moderate leader) where both Extremist and Moderate leaders were united.\r\nGovernment of India Act 1919 or Montagu- Chelmsford Reform Act was passed to establish a responsible Government in India.\r\nOn 9th January 1915 Gandhi ji return to India from South Africa at the age of 46.\r\nIn 1916 Gandhi Ji founded Sabarmati Ashram at Ahmadabad (Gujarat) to preach the idea of truth and non-violence.\r\nChamparan Satyagraha – 1917\r\nKheda Satyagraha – 1917\r\nAhmadabad Mill Strike – 1918\r\nRowlatt Act Satyagraha February,1919\r\nGandhi ji founded the Satyagraha Sabha in February, 1919. In this movement student, middle class, labour and capitalist participated and congress as an organisation was nowhere. This was the first mass movement of Gandhi ji.\r\nJallianwala Bagh Massacre – 13 April, 1919. People were gathered at Jallianwala Bagh in Amritsar to protest against arrest on Saifuddin Kitchlew and Satyapal on 13 April 1919.\r\nOn 1st August 1920 Khilafat Committee launched a Non-Cooperation movement on triple issues- Punjab wrongs, Khilafat issue and Demand for Swaraj.\r\n ', 'unit-6NationalMovementPart-1.mp4', 0, 'Unit - 6', NULL, 'Natinal Movement '),
(10, 1, 1, 7, '1573035583_rsz_national_movement_l.png', ' Non-Cooperation Movement was started on 1920.\r\nIn October 1920 All India Trade Union Congress was founded in Bombay by N. M Joshi, Ray Chaudhary. Presided over by Lala Lajpat Ray\r\nAkali Movement was started in 1920.\r\nIn 1925, SGPC (Shiromani Gurudwara Prabhandak Committee) was founded.\r\nCongress Khilafat Swaraj Party was formed by CR Das and Motilal Nehru. Also famous for the second split in the congress.\r\nIn 1927, Workers & Peasant Party (WPP) was formed at Bombay by S.S Mirajkar, K. N Juglekar and S.V Ghate.\r\nIn 1924, H.R.A (Hindustan Republican Association) was formed at Kanpur. Its members were CS Azad, Sachin Sanyal and Ramprasad Bismil.\r\nIn 1929, HSRA (Hindustan Socialist Republic Association) was formed at Firozeshah Kotla Delhi. Bhagat Singh joined HSRA.\r\nOn 9 Aug, 1925 Kakori Train Dacoit, in this conspiracy case Ram Prasad Bismil, Rajendra Lahiri, Roshan Lal and Asafaqullah khan were hanged to death. \r\nOn 23rd March, 1931 Bhagat Singh, Rajguru and Sukhdev were hanged to death in Lahore Conspiracy Case.\r\nOn 8 November, 1927 Simon Commission was appointed by the British Conservative Government under Stanley Baldwin. To inquire in the working system of Government in the country after the reform act of 1919.\r\nNehru Report- 1928 for dominion status, universal adult franchise, etc.\r\nJinnah’s 14 point programme on 31st March, 1929.\r\n1929 Lahore Session of INC presided by Jawaharlal Nehru where the resolution of Purna Swaraj was passed by the congress and decided to launch a Civil Disobedience movement under the leadership of Gandhi ji.\r\nOn 26th January, 1930 Independence Day was celebrated for the 1st time.\r\nCivil Disobedience Movement was started with the Dandi March. From 12 March to 6 April , 1930 Gandhi ji along with his 78 followers marched from Sabarmati Ashram to Dandi and broke the salt law by making salt on 6th April 1930.\r\nOn 12 November, 1930 First Round Table Conference was held.\r\nOn 5th March, 1931 Gandhi Irwin Pact was signed.\r\nOn 23rd March, 1931 Trial of Bhagat Singh, Rajguru and Sukhdev.\r\nOn 29 March, 1931 Karachi Session of INC, presided over by Vallabh Bhai Patel. In this session first time a resolution of Fundamental Rights and Economic policy was passed.\r\nOn 7th September, 1931 Second Round Table Conference was held in which Gandhi ji participated on the behalf of congress.\r\nOn 16th August, 1932 Communal or Ramsay Macdonald Award was announced.\r\nOn 26th September, 1932 Poona pact was signed.\r\nOn November, 1932 Third Round Table Conference was held.\r\nIn 1935, Governmnet of India Act was passed to create All India Federation, Provincial Autonomy and Diarchy should be there in the centre.\r\n       Towards Quit India Movement\r\n\r\n       Important Congress Sessions:\r\n\r\n            ? 1936 – Lucknow (UP) – Presided by J.L Nehru\r\n\r\n           ? 1937 – Faizpur (Maharashtra) – Presided by J.L Nehru ( First session held in village)\r\n\r\n           ? 1938 – Haripura (Gujarat) – Presided by S.C Bose\r\n\r\n           ? 1939 – Tripuri (M.P) – Presided by S.C Bose\r\n\r\nOn September, 1939 IInd World War broke out and India was declared an ally without its consent.\r\nIn 1939 S.C Bose founded Forward Bloc. It was a left party.\r\nOn 10th August, 1940 – August Offer was announced by Lord Linlithgow viceroy to get the support of Indians in the Second World War.\r\nOn 11th March, 1942 Prime Minister Winstill Churchill announced for sending a mission under the chairmanship of Sir Stafford Cripps to find out the solution of constitutional deadlock and problems of Indians.\r\nWith the failure of Cripps Mission Quit India movement was started in 1942 by the Indian leaders and the resolution of Quit India was drafted by Gandhi Ji. Gandhi ji gave a call for Do or Die.\r\nIn 1942 - Indian National Army was founded by Captain Mohan Singh and Niranjan Gill at Singapore. S. C Bose took over its command of 2nd Headquarter at Singapore and Rangoon.\r\nOn 21st October, 1943 – Azad Hind Government was set up at Singapore under S.C Bose. There was a women regiment known as Rani Jhansi.\r\nIn 1945, Second World War was ended.\r\nIn 1945 – Shimla Conference or Wavell Plan was proposed by Lord Wavell to solve the political deadlock.\r\nIn 1946, Cabinet Mission Plan was announced by PM Clement Attlee.\r\nOn 2nd September, 1946 - Interim Government was set up under J.L Nehru.\r\nOn March, 1947 – Lord Mountbatten was send to India with an aim to find a way to transfer of power. Also known as Plan Balkan.\r\nOn 3rd June Independence of India Act 1947 was passed by which powers were transferred to two Dominion States India and Pakistan.', '(Unit-6)Part-2IndianMovement.mp4', 0, 'Unit - 6', NULL, 'Natinal Movement '),
(11, 1, 1, 8, '1573035761_rsz_governor-general-and-viceroy-of-india.png', 'The governor-general of India (from 1858 to 1947 the viceroy and governor-general of India, commonly shortened to viceroy of India) was the representative of the monarch of the United Kingdom and after Indian independence in 1947, the representative of the Indian head of state. The office was created in 1773, with the title of governor-general of the Presidency of Fort William. The officer had direct control only over Fort William, but supervised other East India Company officials in India. Complete authority over all of British India was granted in 1833, and the official came to be known as the \"governor-general of India\".\r\n\r\nIn 1858, as a consequence of the Indian Mutiny the previous year, the territories and assets of the East India Company came under the direct control of the British Crown; as a consequence the Company Raj was succeeded by the British Raj. The Governor-General (now also the Viceroy) headed the central government of India, which administered the provinces of British India, including the Punjab, Bengal, Bombay, Madras, the United Provinces, and others.[1] However, much of India was not ruled directly by the British Government; outside the provinces of British India, there were hundreds of nominally independent princely states or \"native states\", whose relationship was not with the British Government or the United Kingdom, but rather one of homage directly with the British Monarch as sovereign successor to the Mughal Emperors. From 1858, to reflect the Governor-General\'s new additional role as the Monarch\'s representative in re the fealty relationships vis the princely states, the additional title of Viceroy was granted, such that the new office was entitled \"viceroy and governor-general of India\". This was usually shortened to \"viceroy of India\".\r\n\r\nThe title of viceroy was abandoned when British India split into the two independent dominions of India and Pakistan, but the office of governor-general continued to exist in each country separately—until they adopted republican constitutions in 1950 and 1956, respectively.\r\n\r\nUntil 1858, the governor-general was selected by the Court of Directors of the East India Company, to whom he was responsible. Thereafter, he was appointed by the sovereign on the advice of the British Government; the secretary of state for India, a member of the UK Cabinet, was responsible for instructing him or her on the exercise of their powers. After 1947, the sovereign continued to appoint the governor-general, but thereafter did so on the advice of the newly-sovereign Indian Government.\r\n\r\nGovernors-general served at the pleasure of the sovereign, though the practice was to have them serve five-year terms. Governors-general could have their commission rescinded; and if one was removed, or left, a provisional governor-general was sometimes appointed until a new holder of the office could be chosen. The first governor-general of British India was Lord William Bentinck, and the first governor-general of the Dominion of India was Lord Mountbatten.\r\n', '(Unit -7)GovernorGeneralofindia.mp4', 0, 'Unit - 7', NULL, 'Governor General Of India');
INSERT INTO `chapter` (`chapter_id`, `class_id`, `subject_id`, `chapter_id_name`, `chapter_image`, `description`, `video_name`, `popular_video`, `chapter_name`, `popular_video_image`, `video_title`) VALUES
(12, 1, 2, 9, '1573040521_rsz_pre_histroic_.png', 'Human colonization in India encompasses a span of at least half-a-million years and is divided into two broad periods, namely the prehistoric (before the emergence of writing) and the historic (after writing). The prehistoric period is divided into stone, bronze and iron ages. The stone age is further divided into palaeolithic, mesolithic and neolithic periods. As the name suggests, the technology in these periods was primarily based on stone. Economically, the palaeolithic and mesolithic periods represented a nomadic, hunting-gathering way of life, while the neolithic period represented a settled, food-producing way of life. Subsequently copper was introduced as a new material and this period was designated as the chalcolithic period. The invention of agriculture, which took place about 8000 years ago, brought about dramatic changes in the economy, technology and demography of human societies. Human habitat in the hunting-gathering stage was essentially on hilly, rocky and forested regions, which had ample wild plant and animal food resources. The introduction of agriculture saw it shifting to the alluvial plains which had fertile soil and perennial availability of water. Hills and forests, which had so far been areas of attraction, now turned into areas of isolation. Agriculture led to the emergence of villages and towns and brought with it the division of society into occupational groups. The first urbanization took place during the bronze age in the arid and semi-arid region of northwest India in the valleys of the Indus and the Saraswati rivers, the latter represented by the now dry Ghaggar-Hakra bed. This urbanization is known as the Indus or Harappan civilization which flourished during 3500-1500 B.C. The rest of India during this period was inhabited by neolithic and chalcolithic farmers and mesolithic hunter-gatherers. With the introduction of iron technology about 3000 years ago, the focus of development shifted eastward into the Indo-Gangetic divide and the Ganga valley. The location of the Mahabharata epic, which is set in the beginning of the first millennium B.C., is the Indo-Gangetic divide and the upper Ganga-Yamuna doab (land between two rivers). Iron technology enabled pioneering farmers to clear the dense and tangled forests of the middle and lower Ganga plains. The focus of development now shifted further eastward to eastern Uttar Pradesh and western Bihar which witnessed the events of the Ramayana epic and rise of the first political entities known as Mahajanapadas as also of Buddhism and Jainism. The second phase of urbanization of India, marked by trade, coinage, script and birth of the first Indian empire, namely Magadha, with its capital at Pataliputra (modern Patna) also took place in this region in the sixth century B.C. The imposition by Brahmin priests of the concepts of racial and ritual purity, pollution, restrictions on sharing of food, endogamy, anuloma (male of upper caste eligible to marry a female of lower caste) and pratiloma (female of upper caste ineligible to marry a male of lower caste) forms of marriage, karma (reaping the fruits of the actions of previous life in the present life), rebirth, varnashrama dharma (four stages of the expected hundred-year life span) and the sixteen sanskaras (ceremonies) on traditional occupational groups led to the birth of the caste system - a unique Indian phenomenon. As a consequence of the expansion of agriculture and loss of forests and wildlife, stone age hunter-gatherers were forced to assimilate themselves into larger agriculture-based rural and urban societies. However, some of them resisted this new economic mode. To this day they have persisted with their atavistic lifestyle, but have had to supplement their resources by producing craft items or providing entertainment to the rural population.\r\n\r\n', '1Unit(1)Pre-HistoricPeriod.mp4', 0, 'Unit - 1', NULL, 'Pre Historic Period'),
(13, 1, 2, 9, '1573040837_Andhra_Pradesh_topo_leer.png', 'Andhra Pradesh lies between 12°41\' and 19.07°N latitude and 77° and 84°40\'E longitude, and is bordered by Telangana, Chhattisgarh, and Orissa in the north, the Bay of Bengal in the East, Tamil Nadu to the south and Karnataka to the west. Among the other states, which are situated on the country\'s coastal area, Andhra Pradesh has got a coastline of around 974 km, which gives it the 2nd longest coastline in the nation.[1] Two major rivers, the Godavari and the Krishna run across the state. A small enclave 12 sq mi (30 km²), the Yanam district of Puducherry, lies in the Godavari Delta in the north east of the state. The state includes the eastern part of Deccan plateau as well as a considerable part of the Eastern Ghats.\r\n\r\nAndhra Pradesh can be divided into two regions, namely Coastal Andhra and Rayalaseema.[4]\r\n\r\nAndhra Pradesh has 13 districts: Anantapur, Chittoor, Kadapa, East Godavari, Guntur, Krishna, Kurnool, Sri Potti Sreeramulu Nellore, Prakasam, Srikakulam, Visakhapatnam, Vizianagaram and West Godavari.\r\n\r\nAnantapur is the largest district of the state and the 7th largest district in India with an area of 19130 km2.\r\n\r\nEach district is divided into multiple mandals, and each mandal has many villages.\r\n\r\nVisakhapatnam is the largest city in the state followed by Vijayawada. Other important cities and towns are Kakinada, Guntur, Rajahmundry, Tirupati, Nellore, Ongole, Kurnool and Eluru.\r\n', '1unit(2)Apland&itsboundries.mp4', 0, 'Unit - 1', NULL, 'AP Land & It\'s Boundaries'),
(14, 1, 2, 9, '1573041094_rsz_satavahana-dynasty.png', 'The Satavahanas (Brahmi script: ???????????????????????????? S?dav?hana or ???????????????????????????? S?tav?hana,[1] IAST: S?tav?hana), also referred to as the Andhras in the Puranas, were an ancient Indian dynasty based in the Deccan region. Most modern scholars believe that the Satavahana rule began in the first century BCE and lasted until the second century CE, although some assign the beginning of their rule to as early as the 3rd century BCE based on the Puranas, but uncorroborated by archaeological evidence.[2] The Satavahana kingdom mainly comprised the present-day Telangana, Andhra Pradesh and Maharashtra. At different times, their rule extended to parts of modern Gujarat, Madhya Pradesh, and Karnataka. The dynasty had different capital cities at different times, including Pratishthana (Paithan) and Amaravati (Dharanikota).\r\n\r\nThe origin of the dynasty is uncertain, but according to the Puranas, their first king overthrew the Kanva dynasty. In the post-Maurya era, the Satavahanas established peace in the Deccan region, and resisted the onslaught of foreign invaders. In particular their struggles with the Saka Western Satraps went on for a long time. The dynasty reached its zenith under the rule of Gautamiputra Satakarni and his successor Vasisthiputra Pulamavi. The kingdom fragmented into smaller states by the early 3rd century CE.\r\n\r\nThe Satavahanas were early issuers of Indian state coinage struck with images of their rulers. They formed a cultural bridge and played a vital role in trade and the transfer of ideas and culture to and from the Indo-Gangetic Plain to the southern tip of India. They supported Brahmanism as well as Buddhism, and patronised Prakrit literature.', '1Unit(3)sathavanasdyansty.mp4', 0, 'Unit - 1', NULL, 'Satavahana Dynasty'),
(15, 1, 2, 9, '1573041493_rsz_ikshwakus-kingdom.png', 'The dynasty\'s founder Vasishthiputra Chamtamula (IAST: V?si??h?putra C??tam?la; also transliterated Chantamula) rose to power after the decline of the Satavahana power. He is attested by the Rentala and Kesanapalli inscriptions. The Rentala inscription, dated to his 5th regnal year, calls him \"Siri C??tam?la\". The 4-line Kesanapalli inscription, dated to his 13th regnal year, and inscribed on the pillar of a Buddhist stupa, names him as the founder of the Ikshvaku dynasty.[4]\r\n\r\nNo information is available about Chamtamula\'s parents, except that his father had multiple wives and daughters. Chamtamula had two uterine brothers, named Chamtasri (IAST: C??ta?r?) and Hammasri (IAST: Hamma?r?). Chamtasri, who married Mahatalavara Skandashri of Pukiya family, played an important role in the construction of a Buddhist mahachaitya.[4]\r\n\r\nThe records of the later Ikshvaku kings describe Chamtamula as a great performer of the Vedic sacrifices such as Agnishtoma, Vajapeya and Ashvamedha.[1][5] These descriptions are corroborated by archaeological discoveries, including those of Chamtamula\'s Ashvamedha-type coins, a tank used for the Avabhritha ceremony, the kurma-chiti (a tortoise-shaped sacrificial altar), and the skeleton of a horse. An inscription of the later Ikshvaku king Ehuvala Chamtamula states that Vasishthiputra Chamtamula won many battles with his valour.[4]\r\n\r\nChamtamula had many wives.[6] His daughter Advai Chamtisri (IAST: C??ti?r?) married Mahasenapati Mahatalavara Dandanayaka Khamdavishakha (IAST: Kham?avi??akha) of the Dhanaka family. He was succeeded by his son Virapurushadatta.[4] An inscription dated to the 20th regnal year of Virapurushadatta mentions Chamtamula\'s death, which can be interpreted in various ways. It is possible that Chamtamula lived up to this time, having given up the throne at an earlier date; alternatively, it is possible that the inscription merely commemorates his death anniversary\r\n\r\n', '1Unit(4)Ikshvakus Dynasty.mp4', 0, 'Unit - 1', NULL, 'Ikshvakus Dynasty'),
(16, 1, 2, 9, '1573042100_rsz_1vengi.png', 'Brihatpalayanas\r\nDuring the third century CE the Brihatpalayanas ruled north Andhra from their capital, Kodur, in the Krishna district. One dynasty was the Jaya Varma.\r\n\r\nAnandagotrikas\r\nThe Ananda Gotrikas (335-425) ruled coastal Andhra from their capital, Kapotapuram. Their affiliations are unknown.finded Anandagotras few familyes in anantapur district, kadiri taluk, it an old kadapa district@ hiranya raajya, in puranas. anandagotras living in vedaranya, of kadhiri area hill/mountain places called batrapalli forest, gogannapeta, pandava raju hill, and vankapalli.demolished old andha/kandarapuram, kambamraayudu mountain hill areas.surname is tatam in patras.\r\n\r\nSalankayanas\r\nFrom about 300 to 440, after the fall of the Ikshvakus, the Salankayanas ruled part of the east coast from Vengi. Like the Vishnukundinas of Vinukonda who succeeded them, the Salankayanas were vassals of the Pallavas of the southern Telugu and northern Tamil lands. At this time, Telugu and Kannada scripts began to separate from those of other Indian dialects.\r\n\r\nPallavas\r\nThe Pallava dynasty (Telugu: ????????; Tamil: ???????) ruled South India from the fourth to the eighth centuries from Kanchipuram in Tamil Nadu. It was ascendant during the reigns of Mahendravarman I (571–630) and Narasimhavarman I (630–668). The empire included the southern Telugu and the northern parts of the Tamil regions.\r\n\r\nThe Pallavas were noted for their patronage of Dravidian architecture, examples of which survive in Mahabalipuram. The Chinese traveller Xuanzang visited Kanchipuram (under Pallava rule), and extolled its benign government.[11]\r\n\r\nThe period was characterized by conflict with the Chalukyas of Badami in the north and the Tamil states of Chola and Pandyas in the south. During the eighth century, the Pallavas were succeeded by the Chola dynasty.\r\n\r\nVishnukundinas\r\n\r\nOne of the Undavalli Caves, built in the 7th century CE by the Vishnukundina dynasty.\r\nThe Vishnukundina dynasty ruled in the Deccan and South India in the 5th and 6th centuries CE. According to Edward B. Eastwick, the maharaja of Vizianagaram was a descendant of the maharajas of Udaipur and the Sisodia branch of the Gehlot tribe.[12] A brother of the maharaja of Udaipur migrated to Oudh. Early rulers of the dynasty allied with the Vakatakas and the Rashtrakutas by marriage.\r\n\r\nIn 529, Madhava Varma (a descendant of the dynasty) and four allied clans achieved independence by defeating the Salankayanas in coastal Andhra. Their capitals were Amaravati and Bezwada before they settled on Vizianagaram. Over the centuries the allied clans were vassals of the Vizianagaram rulers and subsequent dynasties, including the Chalukyas. Kalidindi in Krishna district was held by the Vishnukundina dynasty, although it was later associated with the Rajus.\r\n\r\nIn 1512, the maharaja of Vizianagaram was conquered by the Golkonda dynasty and was made subahdar of the Northern Circars. The title was conferred by Aurangzeb, who gave the maharaja a split-tipped sword (still part of the Vishnukundina coat of arms).[13] The rajahs of Vizianagaram received the title of Gajapati after the 16th-century Battle of Nandapur in the Northern Circars.\r\n\r\nIn 1845, the British (represented by Lord Northbrook) conferred several honours on Maharaja Vijaya Rama Gajapati Raju III. On 31 December 1850, Raju III had a son. One of his daughters was married to Maharaj Kumar Singh, a cousin of (and heir apparent to) the maharajah of Rewah.\r\n\r\nKalachuris of Chedi\r\nAlthough the Matsyas, Chedis, Pericchedis, Haihayas and Kalachuris may share a common Vedic ancestry and origin myth, the link is tenuous. In the Puranas, Matsya (Sanskrit for \"fish\") was the name of a tribe (Meenas) and a state of the Vedic civilisation. The Matsya tribe was founded by a fisherman who became a king. The Mahabharata (V.74.16) describes King Sahaja as a son of Uparichara Vasu, a Chedi king. Vasu ruled the Chedis and the Matsyas, suggesting the Matsya were once part of the Chedi kingdom. The Puranas mention six Matsya kingdoms, and the Pandya Kingdom in the south has a fish on its banner. Signs of the Matsya are later found in the Visakhapatnam region.\r\n\r\nChedi\r\nThe Chedi kingdom, in central and western India, was first ruled by Paurava kings and later by Yadav kings. It corresponds roughly to the present-day Bundelkhand region of Madhya Pradesh.\r\n\r\nHaihaya\r\nThe Haihaya kingdom (haya means \"horse\") was one of a number kingdoms ruled by Chandravamsha Kshatriya kings in central and western India. The Vishnu Purana links its outlying tribes to the Yadu tribe. According to the Puranas, the Haihaya were divided into the Talajanghas, Vitihotras, Avantis, Tundikeras and Jatas. Haihaya rulers included the legendary Kartavirya Arjuna, a powerful king who defeated Ravana. Although he had one thousand arms, he was felled and his arms severed by Parasurama. The Haihaya capital was Mahishmati, on the banks of the Narmada River in Madhya Pradesh.\r\n\r\nKalachuri\r\nKalachuri is the name used by two kingdoms who claim a common ancestry and ruled in a succession of dynasties from the 10th to the 12th centuries. The first kingdom controlled western Madhya Pradesh and Rajasthan in central India. The second, the southern Kalachuri, ruled part of Karnataka. Kalachuri kings, related by marriage to the Chalukyas and Rashtrakutas, ruled from Tripuri, Gorakhpur, Ratnapur and Rajpur.\r\n\r\nThe name Kalachuri may derive from kali (long moustache) and churi (sharp knife). The Kalachuri were also known as Katachuris.\r\n\r\nIn the Telugu epic \"The Battle of Palnadu\", the Kalachuri are referred to as the Haihaya family of the Kona region (Amalapuram; the Razole Taluqs of the present-day East Godavari district, and the Haihaya family of Palanadu. They were vassals of the Chalukyas.\r\n\r\nThe Pericchedis are also mentioned as vassals of the Chalukyas. According to V. Rama Chandra Rao, they were connected to the ancient Chedi. The Pericchedis had two branches, with Kollipaka and Bezawada their capitals. Rao also mentions that the Vastsavai dynasty of Peddapuram may be related to the Matsya dynasty, since there is evidence of a branch in the Visakhapatnam area.[14]\r\n\r\nAn 1174 record suggests the Kalachuri dynasty was thought to be founded by Soma, who grew a beard and moustache to save himself from Parashurama\'s wrath. Their emblem was suvarna vrishabha, a golden bull. The Kalachuri honoured Krantivirya Sahasrarjun, who killed Rishi Jamdagni (Bhagwan Parshurama\'s father). Historians such as P. B. Desai emphasize the Kalachuris\' central-Indian origin.\r\n\r\nAt their zenith, the Kalachuris ruled parts of Gujarat, Malwa, Konkan and Maharashtra. Their rule was ended by the Badami Chalukyas under Badami Chalukya Magalesa. Lieutenant colonel James Tod recorded a tribe of Haihayas \"near the very top of the valley of Sohagpur, in Bhagelkhand, aware of their ancient lineage, and though few in number, still celebrated for their valour\"', '1Unit(5)ven_1.mp4', 0, 'Unit - 1', NULL, 'Eastern Chalukyas'),
(17, 1, 2, 10, '1573042442_145a3600812c5b3d0bdd40a1bd18ac25.png', 'Prataparudra I\r\nThe 1149 Sanigaram inscription of Prola II is the last known record of the Kakatiyas as vassals. The 1163 Anumakonda inscription of Prataparudra I is the earliest known record that describes the Kakatiyas as a sovereign power.[26]\r\n\r\nAccording to Sastry, Prataparudra I reigned between around 1158 – 1195,[21] while Sircar gives the dates 1163–1195. He was also known as Rudra Deva, Kakatiya Rudradeva, Venkata, and Venkataraya[3][40] He was the son of Prola II, who had made efforts to assert greater Kakatiya influence on territories in the western parts of the declining Western Chalukyan empire and who died in a battle fought against the Velanati Choda ruler Gonka II around 1157/1158 while doing so.[41][42] It was during Prataparudra\'s reign, in 1163, that the Kakatiyas declared an end to their status as feudatory chiefs of the Chalukyas.[b] It is notable that inscriptions were henceforth written using the Kakatiya chiefs\' vernacular Telugu rather than the Kannada language that had prevailed until that point.[43]\r\n\r\nMahadeva succeeded Prataparudra I as king, reigning probably from 1195 to 1199.[21]\r\n\r\nGanapati\r\n\r\nRamappa Temple.\r\nJust as the Seuna and Hoysala dynasties took control of linguistically related areas during the 13th century, so too did the Kakatiyas under the rule of Ganapati.[43] He is also known as Ganapathi Deva and, according to Sastry, reigned between 1199–1262; Sircar gives regnal dates of 1199–1260.[21][40] He significantly expanded Kakatiya lands during the 1230s when he launched a series of attacks outside the dynasty\'s traditional Telangana region and thus brought under Kakatiya control the Telugu-speaking lowland delta areas around the Godavari and Krishna rivers. The outcome in the case of all three dynasties, says historian Richard Eaton, was that they \"catalysed processes of supralocal identity formation and community building\".[43]\r\n\r\nThe Kakatiya capital at Orugallu, established in 1195, was not forgotten while Ganapati expanded his territory. He organised the building of a massive granite wall around the city, complete with ramps designed for ease of access to its ramparts from within. A moat and numerous bastions were also constructed.[44]\r\n\r\nGanapati was keen to bolster the dynasty\'s economy. He encouraged merchants to trade abroad, abolishing all taxes except for a fixed duty and supporting those who risked their lives to travel afar.[45] He created the man-made Pakhal Lake.\r\n\r\nRudrama Devi\r\n\r\nStatue of Rudrama Devi.\r\nRudrama Devi, also known as Rudramadevi, reigned around 1262–1289 CE (alternative dates: 1261–1295 CE) and is one of the few queens in Indian history.[21][46][47] Sources disagree regarding whether she was the widow of Ganapati or his daughter.[48]\r\n\r\nMarco Polo, who visited India probably some time around 1289–1293, made note of Rudrama Devi\'s rule and nature in flattering terms.[49][c] She continued the planned fortification of the capital, raising the height of Ganapati\'s wall as well as adding a second earthen curtain wall 1.5 miles (2.4 km) in diameter and with an additional 150 feet (46 m)-wide moat.[44]\r\n\r\nA fragmentary Kannada language inscription also states that the Kakatiya general Bhairava defeated the Yadava army probably in or after 1263 CE, which may be a reference to his repulsion of Mahadeva\'s invasion. A coin of Mahadeva bears the Kakatiya emblem varaha with the Yadava symbols; this varaha may have been stuck on Mahadeva\'s coins to mark the Kakatiya victory.[50]\r\n\r\nRudrama was married to Virabhadra, an Eastern Chalukyan prince of Nidadavolu who had been selected for that purpose by her father.[51] Having no son as an heir,[44] Rudrama abdicated in favour of her grandson when it became apparent that the expansionist sultan Alauddin Khalji was encroaching on the Deccan and might in due course attack the Kakatiyas.[48]\r\n\r\nPrataparudra II\r\nThe earliest biography of Rudrama Devi\'s successor, Prataparudra II, is the Prataparudra Caritramu, dating from the 16th century.[52] His reign began in 1289 (alternative date: 1295) and ended with the demise of the dynasty in 1323.[21][47] It is described by Eaton as the \"first chapter in a larger story\" that saw the style of polity in the Deccan change from being regional kingdoms to transregional sultanates that survived until the arrival of the British East India Company in the 18th century.[53]\r\n\r\nDecline\r\n\r\nA replica of the Koh-i-Noor diamond. The diamond was originally owned by the Kakatiya dynasty.\r\nThe Kakatiya kingdom attracted the attention of the Delhi Sultanate ruler Alauddin Khalji because of the possibility for plunder.[54] The first foray into the Kakatiya kingdom was made in 1303 and was a disaster due to the resistance of the Kakatiya army in the battle at Upparapalli.[55][d] In 1309 Alauddin sent his general, Malik Kafur, in an attempt to force Prataparudra into acceptance of a position subordinate to the sultanate at Delhi. Kafur organised a month-long siege of Orugallu that ended with success in February 1310. Prataparudra was forced to make various symbolic acts of obeisance designed to demonstrate his new position as a subordinate but, as was Alauddin\'s plan, he was not removed as ruler of the area but rather forced thereafter to pay annual tribute to Delhi.[56] It was probably at this time that the Koh-i-Noor diamond passed from Kakatiya ownership to that of Alauddin, along with 20,000 horses and 100 elephants.[54]\r\n\r\nIn 1311, Prataparudra formed a part of the sultanate forces that attacked the Pandyan empire in the south, and he took advantage of that situation to quell some of his vassals in Nellore who had seen his reduced status as an opportunity for independence. Later, though, in 1318, he failed to provide the annual tribute to Delhi, claiming that the potential for being attacked on the journey made it impossible. Alauddin\'s son Mubarak Shah responded by sending another of his generals, Khusrau Khan, to Orugallu with a force that bristled with technology previously unknown in the area, including trebuchet-like machines. Prataparudra had to submit once more, with his obeisance on this occasion being arranged by the sultanate to include a very public display whereby he bowed towards Delhi from the ramparts of Orugallu. The amount of his annual tribute was changed, becoming 100 elephants and 12,000 horses.[57]\r\n\r\nThe new arrangements did not last long. Taking advantage of a revolution in Delhi that saw the Khalji dynasty removed and Ghiyasuddin Tughlaq installed as sultan, Prataparudra again asserted his independence in 1320. Tughlaq sent his son, Ulugh Khan, to defeat the defiant Kakatiya king in 1321. Khan\'s army was riven with internal dissension due to its containing factions from the Khalji and Tughluq camps. This caused the siege on this occasion to last much longer — six months, rather than the few weeks that had previously been the case. The attackers were initially repulsed and Khan\'s forces retreated to regroup in Devagiri. Prataparudra celebrated the apparent victory by opening up his grain stores for public feasting. Khan returned in 1323 with his revitalised and reinforced army and, with few supplies left, Prataparudra was forced into submission after a five-month siege. The unprepared and battle-weary army of Orugallu was finally defeated, and Orugallu was renamed as Sultanpur. It seems probable, from combining various contemporary and near-contemporary accounts, that Prataparudra committed suicide near to the Narmada River while being taken as a prisoner to Delhi.', '2Unit(1)kaktiyadynasty.mp4', 0, 'Unit - 2', NULL, 'Kakatiya Dynasty'),
(18, 1, 2, 10, '1573042806_Reddy_Kingdom.png', 'The fall of the Kakatiya Kingdom in 1323, after being subject to seizes by the Tughlaq dynasty, led to a political vacuum in the Andhras.The Islamic conquerors failed to keep the region under effective control and constant infighting among themselves coupled with the martial abilities of the local Telugu warriors led to the loss of the entire region by 1347.[5]\r\n\r\nWhilst, this led to the rise of the Musunuris and Recharlas in the Telegana regions, the coastal belt saw the rise of a third warrior lineage--the Reddis of the Panta clan.[6]\r\n\r\nEstablished in about 1325 by Prolaya Vema Reddi,(also known as Komati Vema), his territory extended along the coast to Nellore in the south and Srisailam, in the west. He was succeeded by Anavota Reddi who consolidated the kingdom extensively and established its capital at Kondavidu in Guntur District.[6]\r\n\r\nBy 1395, a second Reddi kingdom was established by a branch of the same lineage, with its capital in Rajahmundry, East Godavari District.[6]\r\n\r\nNone of the Reddi lineages find any mention in Kakatiya era sources and cannot be exactly traced as to their origins. But, their inscriptions and humble genealogies suggest that they were born out of the late Kakatiya \'military milieu\' and had a continuity with the local Telugu warrior culture.[6]\r\n\r\nExtent of rule\r\n\r\nWater colour painting - Kondavidu fort, Reddi Kingdom.\r\nThe Reddi kings ruled coastal and central Andhra for over a hundred years from 1325 to 1448.[7] At its maximum extent, the Reddi kingdom stretched from Cuttack, Orissa to the north, Kanchi to the south and Srisailam to the west.[8] The initial capital of the kingdom was Addanki.[9] Later, it was moved to Kondavidu and a subsidiary branch was established at Rajahmundry.[10] The Reddis were known for their fortifications. Two major hill forts, one at Kondapalli, 20 km north west of Vijayawada and another at Kondavidu about 30 km west of Guntur stand testimony to the fort building skill of the Reddi kings.[11] The forts of Bellamkonda, Vinukonda and Nagarjunakonda in the Palnadu region were also part of the Reddi kingdom.[11] The dynasty remained in power till the middle of the 15th century. In 1424, Kondavidu was annexed to the Vijayanagara Empire and Rajahmundry was conquered by the Gajapatis some twenty five years alter.[7] The Gajapatis eventually lost control of coastal Andhra after the defeat of Gajapati Prataprudra Deva by Krishna Deva Raya of Vijaynagara. The territories of the Reddi kingdom thus came under the control of the Vijayanagara Empire.[12]\r\n\r\nReligion\r\n\r\nMallikarjuna Swamy Temple, Srisailam\r\n\r\nLord Narasimha, Narasimha Swamy Temple, Ahobilam\r\nThe Reddi rulers played a prominent part in post-Kakatiyas of Telangana. The Kakatiya empire came to an end in 1323 after the army of the Delhi sultanate invaded Warangal and captured Kakatiya ruler Pratapa Rudra. Warangal fell to the invaders and Ulugh Khan commanded Warangal and Telangana. During this time of foreign invasion and chaos in Telugu country, seeds of revolt were sown by two princes, Annaya Mantri and Kolani Rudradeva. They united the Telugu nobles with the purpose of reclaiming the kingdom. Musunuri Prolaya Nayaka, Prolaya Vema Reddi, Recharla Singama Nayaka, Koppula Prolaya Nayaka and Manchikonda Ganapatinayaka were the prominent nobles. Musunuri Prolaya Nayaka was the chosen leader of this confederation of Telugu nobles who united and vowed to put an end to the Sultanate\'s rule. They succeeded in repulsing those forces from Warangal and then established independent Kingdoms of their own.[13][need quotation to verify]\r\n\r\nIt was during this chaotic period in Andhra history that Prolaya Vema Reddi established the Reddi kingdom in 1325. The Reddi rulers patronised and protected Hinduism and its institutions. The Brahmins were given liberal grants by the Reddi kings and the agraharas of Brahmins were restored. Vedic studies were encouraged. The Hindu temples of Srisailam and Ahobilam were provided with more facilities. Prolaya Vema Reddi bestowed a number of agraharas on the Brahmins. He was revered by the title of Apratima-Bhudana-Parasurama.[14] He commissioned major repairs to the Srisailam Mallikarjuna Swami temple, and had a flight of steps built from the Krishna river to the temple. The Narasimha Swamy temple at Ahobilam was built during his reign. He built 108 temples for Shiva.[15]\r\n\r\nLiterature\r\nTelugu literature blossomed under the Reddi kings. The Reddi kings also patronized Sanskrit. Several of the Reddi kings themselves were distinguished scholars and authors. Kumaragiri Reddi, Kataya Vema Reddi and Pedakomati Vema Reddi were the most outstanding among them. Errapragada (Errana), Srinatha and Potana were the remarkable poets of this period. Errapragada, the last of the Kavitraya (Trinity of Poets) was the court poet of Prolaya Vema Reddi. He completed the Telugu translation of the Mahabharata. He completed the rendition of the Aranya Parva of Mahabharata left incomplete by Nannaya Bhattu (Aadi Kavi who started the translation of Mahabharata into Telugu). He wrote Hari Vamsa and Narasimha Purana. Errana\'s translation of the Ramayana in Chapu form (a style of poetry) has been lost.', '2Unit(2)reddyrajulu.mp4', 0, 'Unit - 2', NULL, 'Reddy Dynasty'),
(19, 1, 2, 10, '1573042931_250px-Vijayanagara-empire-map.svg.png', 'The Vijayanagara Empire (also called Karnata Empire,[3] and the Kingdom of Bisnegar by the Portuguese) was based in the Deccan Plateau region in South India. It was established in 1336 by Harihara I and his brother Bukka Raya I of Sangama Dynasty.[4][5][6] The empire rose to prominence as a culmination of attempts by the southern powers to ward off Islamic invasions by the end of the 13th century. It lasted until 1646, although its power declined after a major military defeat in the Battle of Talikota in 1565 by the combined armies of the Deccan sultanates. The empire is named after its capital city of Vijayanagara, whose ruins surround present day Hampi, now a World Heritage Site in Karnataka, India.[7] The writings of medieval European travelers such as Domingo Paes, Fernão Nunes, and Niccolò Da Conti, and the literature in local languages provide crucial information about its history. Archaeological excavations at Vijayanagara have revealed the empire\'s power and wealth.\r\n\r\nThe empire\'s legacy includes many monuments spread over South India, the best known of which is the group at Hampi. Different temple building traditions in South and Central India came together in the Vijayanagara Architecture style. This synthesis inspired architectural innovation in Hindu temples\' construction. Efficient administration and vigorous overseas trade brought new technologies such as water management systems for irrigation. The empire\'s patronage enabled fine arts and literature to reach new heights in Kannada, Telugu, Tamil, and Sanskrit, while Carnatic music evolved into its current form. The Vijayanagara Empire created an epoch in South Indian history that transcended regionalism by promoting Hinduism as a unifying factor', '2Unit(3)vijayanagaram.mp4', 0, 'Unit - 2', NULL, 'Vijayanagara Empire');
INSERT INTO `chapter` (`chapter_id`, `class_id`, `subject_id`, `chapter_id_name`, `chapter_image`, `description`, `video_name`, `popular_video`, `chapter_name`, `popular_video_image`, `video_title`) VALUES
(21, 1, 2, 10, '1573043271_Read-The-Great-Story-of-Indian-Telugu-Poet-Bammera-Potana-Biography-780x405.png', 'There are various sources available for information on early Telugu writers. Among these are the prologues to their poems, which followed the Sanskrit model by customarily giving a brief description of the writer, a history of the king to whom the book is dedicated, and a chronological list of the books he published. In addition, historical information is available from inscriptions that can be correlated with the poems; there are several grammars, treatises, and anthologies that provide illustrative stanzas; and there is also information available from the lives of the poets and the traditions that they followed.[3]\r\n\r\nHistory of literature\r\nby region or country\r\nGeneral topics\r\nBasic topics Literary terms Criticism Theory\r\nTypes\r\nEpic Novel Poetry Prose Romance\r\nLists\r\nBooks Authors\r\nMiddle Eastern\r\nAncient Sumerian Babylonian Egyptian Ancient Egyptian Hebrew Pahlavi Persian Arabic Israeli\r\nEuropean\r\nGreek Latin Early Medieval Matter of Rome Matter of France Matter of Britain Medieval Renaissance\r\nModern\r\nStructuralism Poststructuralism Deconstruction Modernism Postmodernism Post-colonialism Hypertexts\r\nNorth and South American\r\nAmerican Canadian Mexican Jamaican\r\nLatin American\r\nArgentine Brazilian Colombian Cuban Peruvian\r\nAustralasian\r\nAustralian New Zealand\r\nAsian\r\nEast / Southeast\r\nChinese Japanese Korean Vietnamese Thai\r\nSouth\r\nTamil Sanskrit Indian Pakistani Assamese Bengali Gujurati Hindi Kannada Kashmiri Malayalam Marathi Nepali Rajasthani Sindhi Telugu Urdu Indian writing in English\r\nAfrican\r\nNorth\r\nMoroccan\r\nSub-Saharan\r\nNigerian South African Swahili\r\nRelated topics\r\nHistory of science fiction List of years in literature Literature by country History of theatre History of ideas Intellectual history\r\nBooks-aj.svg aj ashton 01.svg Literature portal\r\nvte\r\nSubject matter\r\nEarly Telugu literature is predominantly religious in subject matter. Poets and scholars drew most of their material from, and spent most of their time translating epics, such as the Ramayana, the Mahabharata, the Bhagavata and the Puranas, all of which are considered to be storehouses of Indian culture.[4]\r\n\r\nFrom the sixteenth century onwards, rarely known episodes from the Puranas would form the basis for the tradition of Telugu-language kavya. Literary works are drawn from episodes of the Puranas under the name Akhyana or Khanda became popular along with depictions of the fortune of a single hero under the title of Charitra, Vijaya, Vilasa and Abhyudaya. Such titles are examples of what would become the most common subject matter of poetry.[4]\r\n\r\nIn the eighteenth-century, marriages of heroes under the title Parinaya, Kalyana and Viv?ha became popular.[4]\r\n\r\nReligious literature consisted of biographies of the founders of religion, their teachings (Sara) as well as commentaries (bhashya).[4]\r\n\r\nTraditional Hindu knowledge systems such as astrology, law, grammar, ballets, moral aphorisms, and devotional psalms to deities within the Hindu pantheon are characteristics of more popular works of Telugu literature.[4]\r\n\r\nForms\r\nThe various forms of literature found in Telugu are:\r\n\r\nPrabandham: Stories in verse form with a tight metrical structure and they have three forms mentioned below.\r\nPrakhy?tam: Famous story.\r\nUtpadyam: Purely fictional story.\r\nMisramam: Mixed story.\r\nChampu: Mixture of prose and poetry.\r\nK?vyam: Poem which usually begins with a short prayer called a Prarthana, containing initial auspicious letter \"Sri\" which invokes the blessings of the God.[5] The occasion and circumstances under which the work is undertaken is next stated.[5]\r\nPadya k?vyam: Metrical poetry.\r\nGadya k?vyam: Prose poetry.\r\nKhanda k?vyam: Short poems\r\nKavita: Poetry\r\n?atakam (anthology): Satakam is a literary piece of art. The name derives from ?ata, which means a hundred in Sanskrit. Satakam comprises a hundred poems. Hence, a Satakam is a volume (book) of hundred poems. Satakams are usually devotional, philosophical or convey morals.\r\nDa?aka (anthology): Dasakam or Dashakam comprises ten poems.\r\nAvadh?nam: Avadhanam involves the partial improvisation of poems using specific themes, metres, forms, or words.[6]\r\nNavala: Navala is a written, fictional, prose narrative normally longer than a short story.\r\nKatha : Style of religious storytelling.\r\nN?takam: Drama.\r\nNaneelu:Epigrams.\r\nAshtadiggajas have written in all three of the Prabandham genres during the Prabandha yugam.[7]\r\n\r\nTelugu literature uses a unique expression in verse called Champu, which mixes prose and poetry. Although it is the dominant literary form, there are exceptions: for example, Tikkana composed Uttara Ramayana entirely in verse.[8]\r\n\r\nAs Champu Kavyas and Prabandhas were beyond the comprehension of masses, new devices for the dissemination of knowledge among the people were developed in the form of the Dvipada and Sataka styles. Dvipada means two feet (couplet) and Sataka means hundred (a cento of verses).[9] (Popular satakas: Sarveshvara sataka, Kalahastishvara sataka, Dasarathi Sataka)\r\n\r\nThere are some Satakas which are divided into ten groups of ten verses called Dasaka which is adopted from Prakrit.[10]\r\n\r\nAvadhanam is a literary performance popular from the very ancient days in Sanskrit and more so in Telugu and Kannada languages.[6] It requires a good memory and tests a person\'s capability of performing multiple tasks simultaneously.[6] All the tasks are memory intensive and demand an in-depth knowledge of literature, and prosody. The number of Prucchakas can be 8 (Ashtavadhanam) or 100 (Sataavadhaanam) or even 1000 (Sahasravadhanam). A person who has successfully performed Ashtavadhanam is called as Ashtavadhani, a Satavadhanam is called a Satavadhani and Sahasraavadhaanam is called Sahasravadhani.[6]\r\n\r\nAuthor\'s craft\r\nPraudha Prabandha or Maha Kavya is considered as highest form of verse. The essentials of such a composition according to the Telugu poetic theory are\r\n\r\n?aili (Style): The words chosen neither soft nor very musical but dignified (Gambhira), Sweetness (Madhurya), Grace and Delicacy (Sukumara), Fragrance (Saurabhya) and Symphony. In choice of vocabulary, Vulgar language (Gramya) is avoided.[8]\r\n??ka (Mould): Refers to the embodiment of ideas in language, and the nature and texture of the language employed. There are three types of pakas namely\r\nDr?ksha (wine or grape): Draksha is a crystal clear style where everything is seen through a transparent medium. Mostly Nannaiyah uses this mould.[8]\r\nKadali (Plantain): Kadali is complex paka because the soft skin has to peeled to reach the core of the subject. Mostly Tikkana uses this mould.[8]\r\nNarikela (coconut): Narikela is the most difficult mould to employ because one has to break the rind to understand the idea. Vishnu Chittiyam or Krishnadevaraya are cast in this paka.[5]\r\nRasa (Sentiment): Rasa is the heart and soul of any Telugu poetry which follows rule or (Sutram) \"V?kyam Ras?tmakam K?vyam\" which means that the soul of a sentence is Rasa. There are nine Rasas, known as the Nava Rasas.[5] A perfect kavyam uses all nine of these, namely:\r\n???g?ra (love)\r\nH?sya (Comic)\r\nKaru?? (Sympathy)\r\nRaudram (Horror)\r\nBhay?naka (Fear)\r\nB?bhatsa (Disgust)\r\nV?ra (Heroic)\r\nAdbhuta (wonder)\r\nShantam (Peace)\r\nAlank?ra (Ornamentation): There are ?abdhalank?ras (ornaments of sound) and Arthalank?ras (ornaments of thoughts). Slesha (double entendre) and Yamaka (alliteration) are ?abdhalank?ras. Upam?na (simile) Utpreksha (hyperbole) are Arthalank?ras.[5] We find usage of Alankaras in description of events, places and proceedings etc.[citation needed]\r\nHistory\r\nEarly writers\r\nThe Pre-Nannayya Period (before 1020 AD)\r\nIn the earliest period, Telugu literature existed in the form of inscriptions, precisely from 575 AD on-wards.[citation needed]\r\n\r\nThe 6th or 7th century Sanskrit text Janashrayi-Chhandovichiti (or Jan??raya-chandas) deals with the metres used in Telugu, including some metres that are not found in Sanskrit prosody. This indicates that Telugu poetry existed during or around the 6th century.[11]\r\n\r\nThe Jain Literature Phase (850-1000 CE)\r\nHistorically, Vemulawada was a Jain knowledge hub and played a significant role in patronizing Jain literature and poets.1980s excavations around Vemulawada revealed and affirmed the existence of Telugu Jain literature between 850-1000 CE.[citation needed]\r\n\r\nMalliya Rechana (940 CE)[12][13][14]\r\nMalliya Rechana composed the first Telugu poetic prosody book Kavijanasrayam (pre-Nannayya chandassu) around 940 AD. This was a popular one and referred by many poets. There seems to be even an earlier prosody book by Rechana\'s guru Vaadindra Chudamani which is not available.\r\n\r\nVeturi Prabhakara Sastry in 1900s mentioned about the existence of Pre-Nannayya Chandassu in Raja Raja Narendra Pattabhisheka Sanchika.[14] Accurate dating of this piece of literature happened after the 1980s discoveries in Karimnagar.\r\n\r\nPrabandha Ratnavali[1] (1918) also talks about a verse from Telugu Jinendra Puranam by Jain Padma Kavi (Pampa), a couple of verses from Telugu Adi Puranam by Sarvadeva and Kavijanasrayam\'s affiliation to Jainism were discussed. P. V. P Sastry also points out that many Jain works could have been destroyed.[12] Historical rivalry among Hinduism, Jainism and Buddhism is well known.[15]\r\n\r\nThe Age of the Puranas (1020–1400 CE)\r\nThis is the period of Kavi Trayam or Trinity of Poets. Nannayya, Tikkana and Yerrapragada (or Errana) are known as the Kavi Trayam.\r\n\r\nNannaya Bhattarakudu or Adi Kavi (1022–1063 AD)\r\nNannaya Bhattarakudu\'s (Telugu: ?????) Andhra mahabharatam, who lived around the 11th century, is commonly referred to as the first Telugu literary composition (aadi kaavyam).[citation needed] Although there is evidence of Telugu literature before Nannaya, he is given the epithet Aadi Kavi (\"the first poet\"). Nannaya was the first to establish a formal grammar of written Telugu. This grammar followed the patterns which existed in grammatical treatises like A???dhy?y? and V?lm?kivy?karanam but unlike P??ini, Nannayya divided his work into five chapters, covering samjn?, sandhi, ajanta, halanta and kriya.[16] Nannaya completed the first two chapters and a part of the third chapter of the Mahabharata epic, which is rendered in the Champu style.[citation needed]\r\n\r\n[17]\r\n\r\nTikanna Somayaji (1205–1288 AD)\r\nNannaya\'s Andhra Mahabharatam was almost completed by Tikanna Somayaji (Telugu: ?????? ???????) (1205–1288) who wrote chapters 4 to 18.[citation needed]\r\n\r\nErrapragada\r\nErrapragada, (Telugu: ??????????) who lived in the 14th century, finished the epic by completing the third chapter.[citation needed] He mimics Nannaya\'s style in the beginning, slowly changes tempo and finishes the chapter in the writing style of Tikkana.[citation needed] These three writers – Nannaya, Tikanna and Yerrapragada – are known as the Kavitraya (\"three great poets\") of Telugu. Other such translations like Marana’s Markandeya Puranam, Ketana’s Dasakumara Charita, Yerrapragada’s Harivamsam followed. Many scientific[relevant? – discuss] works, like Ganitasarasangrahamu by Pavuluri Mallana and Prakirnaganitamu by Eluganti Peddana, were written in the 12th century.[18][full citation needed]\r\n\r\nBaddena Bhupala (1220-1280AD)\r\nSumati Shatakam, which is a neeti (\"moral\"), is one of the most famous Telugu Shatakams.[citation needed] Shatakam is composed of more than a 100 padyalu (poems). According to many literary critics[who?] Sumati Shatakam was composed by Baddena Bhupaludu (Telugu: ?????? ?????) (CE 1220–1280). He was also known as Bhadra Bhupala. He was a Chola prince and a vassal under the Kakatiya empress Rani Rudrama Devi, and a pupil of Tikkana.[citation needed] If we assume that the Sumati Shatakam was indeed written by Baddena, it would rank as one of the earliest Shatakams in Telugu along with the Vrushadhipa Satakam of Palkuriki Somanatha and the Sarveswara Satakam of Yathavakkula Annamayya.[original research?] The Sumatee Shatakam is also one of the earliest Telugu works to be translated into a European language, as C. P. Brown rendered it in English in the 1840s.[citation needed]\r\n\r\nThe Age of Srinatha and the Prabandhas (1400–1600 AD)\r\nSrinatha\r\nSrinatha (Telugu: ??????????) (1365–1441) popularised the Prabandha style of composition.[19] He was a minister in the court of Pedakomati Vemareddy of Kondaveedu[citation needed] and wrote Salivahana Saptasati, Shivaratri Mahatyam, Harivilasa, Bhimakanda, Kashi khandam, Shringara Naishadham, Palanati Veera charitra, Dhananjaya Vijayam, Sringara Dipika. These works were concerned with history and mythology.[citation needed] Srinatha\'s Srungara Naishadhamu is a well-known example of the form.[19] Srinatha was widely regarded as the Kavi Sarvabhowma (\"the emperor among poets\").[citation needed]\r\n\r\nVemana\r\nKumaragiri Vema Reddy (Telugu: ????), popularly known as Yogi Vemana, was a 14th-century Telugu poet.[20] His poems were written in the popular vernacular of Telugu, and are known for their use of simple language and native idioms.[citation needed] His poems discuss the subjects of Yoga, wisdom and morality.[citation needed] There is no consensus among scholars about the period in which Vemana lived. C.P. Brown, known for his research on Vemana, estimates the year of birth to be the year 1352 based on some of his verses.[citation needed] His poems are four lines in length. The fourth line is, in the majority of the cases, the chorus Vishwadhabhirama Vinura Vema – he thus conveyed his message with three small lines written in a simple vernacular.[citation needed] He traveled widely across south India, acquiring popularity as a poet and Yogi.[citation needed] So high was the regard for Vemana that a popular Telugu saying goes \'Vemana\'s word is the word of the Vedas\'.[citation needed] He is celebrated for his style of Chaatu padyam, a poem with a hidden meaning.[citation needed] Many lines of Vemana\'s poems are now colloquial phrases of the Telugu language.[citation needed] They end with the signature line Vishwadhaabhi Raama, Vinura Vema, literally Beloved of Vishwadha, listen Vema. There are many interpretations of what the last line signifies.[citation needed]\r\n\r\nBammera Potanaamatya\r\nBammera Potanaamatya (Telugu: ?????? ????) (1450–1510) is best known for his translation of the Bhagavata Purana from Sanskrit to Telugu.[citation needed] His work, Andhra Maha Bhagavatamu. He was born into a Brahmin family and was considered to be a Sahaja Kavi (\"natural poet\") who needed no teacher. He wrote Bhogini Dandakam a poem praising king Singa Bhoopala\'s consort danseuse, Bhogini, while young. This is the earliest available Telugu Dandaka (a rhapsody which uses the same gana or foot throughout).[21][full citation needed] His second work was Virabhadra Vijayamu which describes the adventures of Virabhadra, son of Shiva.[citation needed] As a young man, he was a devotee of Shiva and also Rama and was more interested in salvation, from which came the inspiration to translate the Bhagavata Purana.[citation needed]\r\n\r\nAnnamacharya\r\nTallapaka Annamacharya (or Annamayya) (Telugu: ???? ???????? ???????????) (9 May 1408 – 23 February 1503) is known as the Pada-kavita Pitaamaha of the Telugu language.[22] He was born to a Vaidiki Brahmin family and his works are considered to have dominated and influenced the structure of Carnatic music compositions.[citation needed] Annamacharya is said to have composed as many as 32,000 sankeertanas (songs) on Bhagwaan Govinda Venkateswara,[23] of which only about 12,000 are available today. His keertana compositions are based on the Vishishtadvaita school of thought.[citation needed] Annamayya was educated in this system of Ramanuja by Sri Satagopa Yateendra of the Ahobila matham.[citation needed]\r\n\r\nTallapaka Tirumalamma\r\nTallapaka Tirumalamma (Telugu: ???????? ?????????) (Annamacharya\'s wife)[24] wrote Subhadra Kalyanam, and is considered the first female poet in Telugu literature.[by whom?] Her main work, Subhadra Kalyanam, which consists of 1170 poems, is about the marriage of Arjuna and Subhadra, who are characters that appear in the Mahabharata. She presented the Telugu nativity and culture in the story taken from Sanskrit epic.[citation needed]\r\n\r\nAllasani Peddana\r\nAllasani Peddana (Telugu: ???????? ??????) (15th and 16th centuries) was ranked as the foremost of the Ashtadiggajalu the title for the group of eight poets in the court of Krishnadevaraya, a ruler of the Vijayanagara Empire.[citation needed] Peddana was a native of Somandepalli near Anantapur.[citation needed] Allasani Peddana wrote the first major Prabandha and for this reason he is revered as Andhra Kavita Pitamaha (\"the grand father of Telugu poetry\").[citation needed] It is believed[by whom?] that he was also a minister in the king\'s court and is hence sometimes referred as Peddanaamaatya (Peddana + Amaatya = Peddana, the minister).[citation needed] He wrote Swaarochisha Manu Sambhavam (also known as Manu Charitra), which is a development of an episode in the Markandeya Purana relating to the birth of Svarochishamanu, who is one of the fourteen Manus. Pravarakhya is a pious Brahmin youth who goes to the Himalayas for Tapasya. In the Himalayas Varudhini, a Gandharva girl, falls in love with him, but Pravarakyudu rejects her love. Knowing this a Gandharva youth who was earlier rejected by Varudhini assumes the form of Pravarakhya and succeeds to win her love. To them is born Svarochisha, the father of Svarochishamanu.[21][full citation needed] The theme for his Manu Charitra is a short story from Markandeya Purana. It is about second Manu of fourteen manus (fathers of mankind societies according to Hindu mythology), translated into Telugu from Sanskrit by Marana (1291–1323),[citation needed] disciple of Tikkana. The original story was around 150 poems and Peddana extended into six chapters with 600 poems by adding fiction and descriptions.\r\n\r\nHis work was treated as one of the Pancha Kavyas, the five best works in Telugu. Some of his other famous works such as Harikathaasaaramu are untraceable now.', '2Unit(5)teluguliterature.mp4', 0, 'Unit - 2', NULL, 'Telugu literature'),
(22, 1, 2, 10, '1573043702_Deccan_sultanates_1490_-_1687_ad.png', 'The dynasty\'s founder, Sultan Quli Qutb-ul-Mulk, migrated to Delhi from Iran, with his uncle, Allah-Quli, some of his relatives and friends in the beginning of the 16th century. Later he migrated south, to the Deccan and served the Bahmani sultan, Mohammad Shah.[9] He conquered Golconda, after the disintegration of the Bahmani Kingdom into the five Deccan sultanates.[9] Soon after, he declared independence from the Bahmani Sultanate, took the title Qutub Shah, and established the Qutb Shahi dynasty of Golconda. He was later assassinated in 1543 by his son, Jamsheed, who assumed the sultanate.[9] Jamsheed died in 1550 from cancer.[10] Jamsheed\'s young son reigned for a year, at which time the nobility brought back and installed Ibrahim Quli as sultan.[10] During the reign of Muhammad Quli Qutb Shah, relations between Hindus and Muslims were strengthened, even to the point of Hindus resuming their religious festivals like Diwali and Holi.[11] Some Hindus rose to prominence in the Qutb Shahi state, the most important example being the ministers Madanna and Akkanna.\r\n\r\nGolconda, and with the construction of the Char Minar, later Hyderabad, served as capitals of the sultanate,[9] and both cities were embellished by the Qutb Shahi sultans. The dynasty ruled Golconda for 171 years, until the Mughal emperor Aurangzeb conquered the Deccan in 1687.[12]\r\n\r\nCulture\r\nThe Qutub Shahi rulers were great builders, whose structures included the Char Minar,[13] as well as patrons of learning. Quli Qutb Mulk\'s court became a haven for Persian culture and literature.[7] Sultan Muhammad Quli Qutb Shah (1580–1612) wrote poems in Dakhini Urdu, Persian and Telugu and left a huge poetry collection.[13] Subsequent poets and writers, however wrote in Urdu, while using vocabulary from Persian, Hindi and Telugu languages.[13] By 1535, the Qutb Shahis were using Telugu for their revenue and judicial areas within the sultanate.[14]\r\n\r\nInitially, the Qutub Shahi rulers patronized Persianate culture, but eventually adopted the regional culture of the Deccan, symbolized by the Telugu language and the newly developed Deccani idiom of Urdu became prominent.[15] Although Telugu was not their mother tongue, the Golconda rulers spoke and wrote Telugu,[13] and patronized Telugu so exclusively they were termed the \"Telugu Sultans\".[16] In 1543, fearing for his life, Prince Ibrahim Quli fled to the Vijayanagar court, which lavishly patronized the Telugu language. Upon his enthronement as sultan in 1550, Ibrahim Quli was thoroughly acquainted with Telugu aesthetics.[16]\r\n\r\nThe Qutb Shahi rulers were much more liberal than their other Muslim counterparts. During the reign of Abdullah Qutb Shah in 1634 CE, the ancient Indian sex manual Koka Shastra was translated into Persian named Lazzat-un-Nisa (Flavors of the Woman).[17]\r\n\r\nArchitecture\r\nThe Qutb Shahi architecture was Indo-Islamic, a culmination of Indian and Persian architectural styles.[18] Their style was very similar to that of the other Deccan Sultanates.\r\n\r\nSome examples of Qutb Shahi Indo-Islamic architecture are the Golconda Fort, tombs of the Qutb Shahis, Char Minar and the Char Kaman, Mecca Masjid, Khairtabad Mosque, Hayat Bakshi Mosque, Taramati Baradari and the Toli Mosque', '2Unit(4)qtubshahi.mp4', 0, 'Unit - 2', NULL, 'Qutb Shahi Dynasty'),
(23, 1, 2, 11, '1573044798_rsz_santa-caterina.png', 'In a 1753 decree, Deccan subedar Asif ad-Dawlah Mir Ali Salabat Jang ceded Chicacole, Ellore and Rajahmundry to the Marquis de Bussy-Castelnau. An annual stipend of 200,000 rupees was paid to maintain French troops in the subah; revenue in the Northern Circars amounted to one million rupees per year.\r\n\r\nBussy had helped Salabat Jang become subedar of the Deccan. The agreement between the French and Salabat Jang in Aurangabad bears the signature of Said Loukshur, Salabat Jang\'s minister. Yanam was an important town during the French occupation of the Northern Circars.\r\n\r\nIn 1758, the French and English fought at Chandurti (in the present-day Gollaprolu mandal of East Godavari district). The French were defeated by the armies of the British and Maharaja Ananda Gajapathi Raju II of Vizianagram. Salabat Jang made a treaty with the British, giving them the Northern Circars in a firman.\r\n\r\nThe Nizam later rebelled against the English. The war ended with a second treaty; the Northern Circars remained under the control of British India, and after 1760 the French lost their hold there and throughout South India. In 1765, Robert Clive and the chief and council at Vizagapatam obtained from Mughal emperor Shah Alam a grant of the Northern Circars. In 1792, the British defeated Maharaja Vijaya Rama Gajapati Raju of Vizianagaram. During the rule of Hyder Ali and Tipu Sultan, the Kingdom of Mysore pursued an expansionist policy against the Marathas, the Nizam and the English and made incursions into the Rayalaseema region.\r\n\r\nMadras Presidency\r\nSee caption\r\nMadras Presidency in 1859; North Canara (Uttara Kannada) was transferred to the Bombay Presidency in 1862.\r\nThe Northern Circars became part of the British Madras Presidency. The Nizam later ceded five territories (Datta Mandal?lu) to the British, which became the Rayalaseema region. The Nizams retained control of the interior provinces as Hyderabad State, acknowledging British rule in return for local autonomy. The provinces were governed in a feudal manner, with zamindars in areas such as Kulla and elsewhere in the Godavari acting as lords under the Nizam. The zamindari system was dismantled after independence.\r\n\r\nTelugu districts\r\nVizagapatam (later Srikakulam, Vizianagaram and Visakhapatnam districts)\r\nGodavari (later East Godavari district)\r\nMachilipatnam (later Guntur, Krishna and West Godavari Districts)\r\nKurnool\r\nNellore\r\nCuddapah\r\nAnantapur\r\nZamindaris\r\nVizagapatam\r\nPemmasani clan\r\nRavella clan\r\nYarlagadda rajas\r\nBalusu clan\r\nMullapudi clan\r\nAdusumilli clan\r\nIndriyal Clan of Rajamahendravaram\r\nPadamanayakas\r\nBobbili\r\nVavilavalasa Inuganty kings\r\nSiripuram Inuganty kings\r\nPalakonda\r\nKirlampudi\r\nKasimkota\r\nAnnavaram\r\nNuzividu\r\nMylavaram\r\nGurazala\r\nShri Kalahasti\r\nPolavaram\r\n', '3unit(1)aphistoryadvantofbritish.mp4', 0, 'Unit - 3', NULL, 'Advent of European in AP'),
(24, 1, 2, 11, '1573045371_1573031881_rsz_sepoy_mutinyjpg.png', 'The Indian Rebellion of 1857 was a major, but ultimately unsuccessful, uprising in India in 1857–58 against the rule of the British East India Company, which functioned as a sovereign power on behalf of the British Crown.[4][5] The rebellion began on 10 May 1857 in the form of a mutiny of sepoys of the Company\'s army in the garrison town of Meerut, 40 mi (64 km) northeast of Delhi (now Old Delhi). It then erupted into other mutinies and civilian rebellions chiefly in the upper Gangetic plain and central India,[a][6][b][7] though incidents of revolt also occurred farther north and east.[c][8] The rebellion posed a considerable threat to British power in that region,[d][9] and was contained only with the rebels\' defeat in Gwalior on 20 June 1858.[10] On 1 November 1858, the British granted amnesty to all rebels not involved in murder, though they did not declare the hostilities to have formally ended until 8 July 1859. The rebellion is known by many names, including the Sepoy Mutiny, the Indian Mutiny, the Great Rebellion, the Revolt of 1857, the Indian Insurrection, and the First War of Independence.[e][11]\r\n\r\nThe Indian rebellion was fed by resentments born of diverse perceptions, including invasive British-style social reforms, harsh land taxes, summary treatment of some rich landowners and princes,[12][13] as well as scepticism about the improvements brought about by British rule.[f][14] Many Indians rose against the British; however, many also fought for the British, and the majority remained seemingly compliant to British rule.[g][14] Violence, which sometimes betrayed exceptional cruelty, was inflicted on both sides, on British officers, and civilians, including women and children, by the rebels, and on the rebels, and their supporters, including sometimes entire villages, by British reprisals; the cities of Delhi and Lucknow were laid waste in the fighting and the British retaliation.[h][14]\r\n\r\nAfter the outbreak of the mutiny in Meerut, the rebels very quickly reached Delhi, whose 81-year-old Mughal ruler, Bahadur Shah Zafar, they declared the Emperor of Hindustan. Soon, the rebels had also captured large tracts of the North-Western Provinces and Awadh (Oudh). The East India Company\'s response came rapidly as well. With help from reinforcements, Kanpur was retaken by mid-July 1857, and Delhi by the end of September.[10] However, it then took the remainder of 1857 and the better part of 1858 for the rebellion to be suppressed in Jhansi, Lucknow, and especially the Awadh countryside.[10] Other regions of Company controlled India—Bengal province, the Bombay Presidency, and the Madras Presidency—remained largely calm.[i][7][10] In the Punjab, the Sikh princes crucially helped the British by providing both soldiers and support.[j][7][10] The large princely states, Hyderabad, Mysore, Travancore, and Kashmir, as well as the smaller ones of Rajputana, did not join the rebellion, serving the British, in the Governor-General Lord Canning\'s words, as \"breakwaters in a storm.\"[15]\r\n\r\nIn some regions, most notably in Awadh, the rebellion took on the attributes of a patriotic revolt against European oppression.[16] However, the rebel leaders proclaimed no articles of faith that presaged a new political system.[k][17] Even so, the rebellion proved to be an important watershed in Indian- and British Empire history.[l][11][18] It led to the dissolution of the East India Company, and forced the British to reorganize the army, the financial system, and the administration in India, through passage of the Government of India Act 1858.[19] India was thereafter administered directly by the British government in the new British Raj.[15] On 1 November 1858, Queen Victoria issued a proclamation to Indians, which while lacking the authority of a constitutional provision,[m][20] promised rights similar to those of other British subjects.[n][o][21] In the following decades, when admission to these rights was not always forthcoming, Indians were to pointedly refer to the Queen\'s proclamation in growing avowals of a new nationalism.[p][22][q][23]\r\n\r\n\r\n', '3unit(2)aphistory1857revolt.mp4', 0, 'Unit - 3', NULL, 'Sepoy Mutiny in AP'),
(25, 1, 2, 11, '1573046426_1573033125_rsz_4_varnas.png', 'India passed through conflict, crisis, misfortune and factional trouble in eighteenth century. Political uncertainty obstructed the progressive evolution of Indian culture.\r\n\r\nThe Britishers took advantages of the situation and exercised deep influence on nation’s life and culture. India’s response to British challenge constitutes an important feature of nineteenth century modern Indian history. It was a transition from medievalism to modern age. There was a mental awakening in India as a result of its contact with the forces of the west and no wonder the nation witnessed a remarkable socio-cultural upsurge.\r\n\r\nThe Renaissance of the 19th century awakened the people of the India from the slumber of lethargy and infused them with a spirit of search for liberation from bondage of slavery. Bipan Chandra observes, “Thoughtful Indians began to look for the strength and weakness of their society and for ways and means of removing the weaknesses.\r\n\r\nADVERTISEMENTS:\r\n\r\n\r\n \r\nWhile a large number of Indians refused to come to terms with the west and still put their faith in traditional Indian ideas and institutions, others gradually came to hold the elements of modern western thought that had to be imbedded for the regeneration of their society. They were impressed in particular by modern science and doctrines of reason and humanism. While differing on the nature and extent of reforms, nearly all the 19th century intellectuals shared the conviction that social and religious reforms were urgently needed.”\r\n\r\nCauses of Socio-Cultural Awakening\r\n\r\nThe most important factor which contributed to the socio-cultural awakening of the 19th century was impact of British rule on Indian economy and society. British imperialism brought political and administrative unification of the country.\r\n\r\nThey introduced uniform system of law and introduced methods of communication. British rule marked the collapse of traditional economic structure. The economic life and lot of the Indian people got interlinked. The exploitative character of the colonial economy contributed a lot to rise of national spirit .The highly centralized character of the British rule in India promoted the growth of nationalism.\r\n\r\nADVERTISEMENTS:\r\n\r\n\r\n \r\nThe socio-cultural impact of British rule was tremendous and indeed it made a revolution in India.\r\n\r\nThe emergence of a new middle class, by product of western contact, played the role of creative minority and aimed at destroying all traditions which helped the emergence of awakened India. Infused by the spirit of nationalism and rationalism the powerful middle class made serious introspection and tried their best to purge the Indian society of its vices.\r\n\r\nAnother factor which helped the awakening was the coming of the Christian missionaries in India from the beginning of nineteenth century. These Christian missionaries spread education in different part of the country and undertook many welfare activities. Some section of Indian people became attracted to their creed.\r\n\r\nThe activities of missionaries and their satire and condemnation of Hindu religion resulted in strong conservative and rationalist reaction. While the orthodox and conservatives opposed Christianity doggedly, the liberals made introspection and tried to purge the inner weakness of their own religion.\r\n\r\nADVERTISEMENTS:\r\n\r\n\r\n \r\nThe spread of Western education provided stimuli to socio-culture awakening. According to K.M. Panikar the introduction of English language helped the cause of unity in the country without which India would have been spilt into as many different units as there are languages in India. According to Naoroji, “The introduction of English education with its great, noble, elevating and civilizing literature and advanced science will for ever remain a monument of good work done in India.” A.R. Desai points out that “the study of the English language unfolded the treasures of the democratic and nationalistic thought crystallized in precious scientific works.”\r\n\r\nThe English educated young men criticized all Hindu traditions and customs and even drank intoxicant drinks to show that they were modern. But they tried to examine every aspect of life rationally and thus helped the process of modernization. The reformative zeal of the British Government reflected in removing caste disabilities and injustice done to the women in Indian society.\r\n\r\nIt made progressive forces inside the country to make a serious introspection. Press, newspapers and literature also contributed to the development of national awakening. The vitality of Indian culture also helped the advent and growth of Renaissance. Response of India to the crisis of the time had always been positive.\r\n\r\nWhen India got the western impact modern Indian gladly accepted the positive features of the west and adapted them to the changing condition. Thus due to the combination of forces 19th century saw a new mental awakening that led to Renaissance in Indian thought. The rational spirit of Renaissance developed a desire for reform.', '3unit(3)aphistorysocio-sulturalaweking.mp4', 0, 'Unit - 3', NULL, 'Social and Cultural Awakening in AP'),
(26, 1, 2, 11, '1573046513_rsz_ind.png', 'Self-Respect Movement\r\nMain article: Self-Respect Movement\r\n\r\nPeriyar during the early years of Self-Respect Movement\r\nPeriyar and his followers campaigned constantly to influence and pressure the government to take measures to remove social inequality,(abolish untouchability, manual scavenging system etc) even while other nationalist forerunners focused on the struggle for political independence. The Self-Respect Movement was described from the beginning as \"dedicated to the goal of giving non-Brahmins a sense of pride based on their Dravidian past\".[38]\r\n\r\nIn 1952, the Periyar Self-Respect Movement Institution was registered with a list of objectives of the institution from which may be quoted as\r\n\r\nfor the diffusion of useful knowledge of political education; to allow people to live a life of freedom from slavery to anything against reason and self respect; to do away with needless customs, meaningless ceremonies, and blind superstitious beliefs in society; to put an end to the present social system in which caste, religion, community and traditional occupations based on the accident of birth, have chained the mass of the people and created \"superior\" and \"inferior\" classes... and to give people equal rights; to completely eradicate untouchability and to establish a united society based on brother/sisterhood; to give equal rights to women; to prevent child marriages and marriages based on law favourable to one sect, to conduct and encourage love marriages, widow marriages, inter caste and inter-religious marriages and to have the marriages registered under the Civil Law; and to establish and maintain homes for orphans and widows and to run educational institutions.[33]\r\n\r\nPropagation of the philosophy of self respect became the full-time activity of Periyar since 1925. A Tamil weekly Kudi Arasu started in 1925, while the English journal Revolt started in 1928 carried on the propaganda among the English educated people.[39] The Self-Respect Movement began to grow fast and received the sympathy of the heads of the Justice Party from the beginning. In May 1929, a conference of Self-Respect Volunteers was held at Pattukkotai under the presidency of S. Guruswami. K.V. Alagiriswami took charge as the head of the volunteer band. Conferences followed in succession throughout the Tamil districts of the former Madras Presidency. A training school in Self-Respect was opened at Erode, the home town of Periyar. The object was not just to introduce social reform but to bring about a social revolution to foster a new spirit and build a new society.[40]\r\n\r\nInternational travel (1929–1932)\r\nBetween 1929 and 1935, under the strain of World Depression, political thinking worldwide received a jolt from the spread of international communism.[8] Indian political parties, movements and considerable sections of leadership were also affected by inter-continental ideologies. The Self-Respect Movement also came under the influence of the leftist philosophies and institutions. E.V. Ramasamy, after establishing the Self-Respect Movement as an independent institution, began to look for ways to strengthen it politically and socially. To accomplish this, he studied the history and politics of different countries, and personally observed these systems at work.[8]\r\n\r\nE.V. Ramasamy toured Malaya for a month, from December 1929 to January 1930, to propagate the self-respect philosophy. Embarking on his journey from Nagapattinam with his wife Nagammal and his followers, E.V. Ramasamy was received by 50,000 Tamil Malaysians in Penang. During the same month, he inaugurated the Tamils Conference, convened by the Tamils Reformatory Sangam in Ipoh, and then went to Singapore. In December 1931 he undertook a tour of Europe, accompanied by S. Ramanathan and Erode Ramu, to personally acquaint himself with their political systems, social movements, way of life, economic and social progress and administration of public bodies. He visited Egypt, Greece, Turkey, the Soviet Union, Germany, England, Spain, France and Portugal, staying in Russia for three months. On his return journey he halted at Ceylon and returned to India in November 1932.[8]\r\n\r\nThe tour shaped the political ideology of E.V. Ramasamy to achieve the social concept of Self-Respect. The communist system in the Soviet Union appealed to him as appropriately suited to deal with the social ills of the country. Thus, on socio-economic issues Periyar was Marxist, but he did not advocate for abolishing private ownership.[41] Immediately after his return, E.V. Ramasamy, in alliance with the enthusiastic communist, M. Singaravelar, began to work out a socio-political scheme incorporating socialist and self-respect ideals. This marked a crucial stage of development in the Self-Respect Movement which got politicised and found its compatibility in Tamil Nadu.[8]\r\n\r\nOpposition to Hindi\r\nMain article: Anti-Hindi agitations\r\nIn 1937, when Chakravarthi Rajagopalachari became the Chief Minister of Madras Presidency, he introduced Hindi as a compulsory language of study in schools, thereby igniting a series of anti-Hindi agitations.[11] Tamil nationalists, the Justice Party under Sir A. T. Panneerselvam, and E.V. Ramasamy organised anti-Hindi protests in 1938 which ended with numerous arrests by the Rajaji government.[42]\r\n\r\nDuring the same year, the slogan \"Tamil Nadu for Tamilians\"[43] was first used by E.V. Ramasamy in protest against the introduction of Hindi in schools. He claimed that the introduction of Hindi was a dangerous mechanism used by the Aryans to infiltrate Dravidian culture.[43] He reasoned that the adoption of Hindi would make Tamils subordinate to the Hindi-speaking North Indians. E.V. Ramasamy claimed that Hindi would not only halt the progress of Tamil people, but would also completely destroy their culture and nullify the progressive ideas that had been successfully inculcated through Tamil in the recent decades.[44]\r\n\r\nCutting across party lines, South Indian politicians rallied together in their opposition to Hindi.[44] There were recurrent anti-Hindi agitations in 1948, 1952 and 1965.[45]\r\n\r\nAs President of the Justice Party (1938–1944)\r\nMain article: Justice Party (India)\r\nA political party known as the South Indian Libertarian Federation (commonly referred to as Justice Party) was founded in 1916, principally to oppose the economic and political power of the Brahmin groups. The party\'s goal was to render social justice to the non-Brahmin groups. To gain the support of the masses, non-Brahmin politicians began propagating an ideology of equality among non-Brahmin castes. Brahmanical priesthood and Sanskritic social class-value hierarchy were blamed for the existence of inequalities among non-Brahmin caste groups.[10]\r\n\r\nIn 1937, when the government required that Hindi be taught in the school system, E.V. Ramasamy organised opposition to this policy through the Justice Party. After 1937, the Dravidian movement derived considerable support from the student community. In later years, opposition to Hindi played a big role in the politics of Tamil Nadu. The fear of the Hindi language had its origin in the conflict between Brahmins and non-Brahmins. To the Tamils, acceptance of Hindi in the school system was a form of bondage. When the Justice Party weakened in the absence of mass support, E.V. Ramasamy took over the leadership of the party after being jailed for opposing Hindi in 1939.[9] Under his tutelage the party prospered, but the party\'s conservative members, most of whom were rich and educated, withdrew from active participation', '3unit(4)aphistrojustice&selfrespect.mp4', 0, 'Unit - 3', NULL, 'Justice & Self Respect Movement '),
(27, 1, 2, 11, '1573047280_rsz_national_movement_l.png', 'The Nationalist Movements in India were organized as mass movements emphasizing and raising questions concerning the interests of the people of India. In most of these movements, people were themselves encouraged to take action. Due to several factors , these movements failed to win independence for India. However, they did promote a sense of nationalism among the people of the country. The failure of these movements affected many people as they withdrew from Government offices, schools, factories and services. Though they did manage to get a few concessions such as those won by the Salt March in 1930, they did not help India much from the point of view of their objective.\r\n\r\nNizamiyat, the local nawabs of Oudh and Bengal and other smaller powers. Each was a strong regional power influenced by its religious and ethnic identity. However, the East India Company ultimately emerged as the predominant power. One of the results of the social, economic and political changes instituted in the country throughout the greater part of 18th century was the growth of the Indian middle class. Although from different backgrounds and different parts of India, this middle class and its varied political leaderships contributed to a growing \"Indian\" identity\".[1] The realisation and refinement of this concept of national identity fed a rising tide of nationalism in India in the last decades of the 19th century.[2][3][4]\r\n\r\nThe Swadeshi movement encouraged the Indian people to stop using British products and start using their own handmade products. The original Swadeshi movement emanated from the partition of Bengal in 1905 and continued up to 1908. The Swadeshi movement which was a part of the Indian freedom struggle was a successful economic strategy to remove the British empire and improve economic conditions in India.The Swadeshi movement soon stimulated local enterprise in many areas. Lokmanya Bal Gangadhar Tilak, Bipin Chandra Pal, Lala Lajpat Rai, V. O. Chidambaram Pillai, Sri Aurobindo, Surendarnath Banerji, Rabindranath Tagore were some of the prominent leaders of this movement. The trio also known as LAL BAL PAL.The Swadeshi movement was the most successful.The name of Lokmanya began spreading around and people started following him in all parts of the country.\r\n\r\nIndian textile industry also played an important role in the freedom struggle of India. The merchandise of the textile industry pioneered the Industrial revolution in India and soon England was producing cotton cloth in such great quantities that the domestic market was saturated and foreign markets were required to sell the production. On the other hand, India was rich in cotton produce and was in a position to supply British mills with the raw material, they required. This was the time when India was under British rule and the East India Company had already established its roots in India. Raw materials went to England at very low rates and cotton cloth of refined quality was brought back to India and sold here at very high prices. This was draining India\'s economy and the textile industry of India suffered greatly. This led to a great resentment among cotton cultivators and traders.\r\n\r\nTo add fuel to the fire Lord Curzon announced the partition of Bengal in 1905, and there was a massive opposition from the people of Bengal. Initially the partition plan was opposed through press campaign. The total follower of such techniques led to the boycott of British goods and the people of India pledged to use only swadeshi or Indian goods and to wear only Indian cloth. Imported garments were viewed with hate. At many places, public burnings of foreign cloth were organized. Shops selling foreign cloths were closed. The cotton textile industry is rightly described as swadeshi industry. The period witnessed the growth of swadeshi textile mills. Swadeshi factories came into existence everywhere.\r\n\r\nAccording to Surendranath Banerji, swadeshi movement changed the entire texture of our social and domestic life. The songs composed by Rabindranath Tagore, Rajanikanta Sen and Syed Abu Mohd became the moving spirit for the nationalists. The movement soon spread to the rest of the country and the partition of Bengal had to be firmly inhaled on the first of April, 1912.The people were great.', '3Unit(5)National movemenap.mp4', 0, 'Unit - 3', NULL, 'Natinal Movement in AP'),
(28, 1, 2, 11, '1573047379_Zamindari_movent.png', 'A zamindar, zomindar, zomidar, or jomidar, in the Indian subcontinent was an aristocrat. The term means land owner in Persian. Typically hereditary, zamindars held enormous tracts of land and control over their peasants, from whom they reserved the right to collect tax on behalf of imperial courts or for military purposes. Their families carried titular suffixes of lordship.\r\n\r\nIn the 19th and 20th centuries, with the advent of British imperialism, many wealthy and influential zamindars were bestowed with princely and royal titles such as Maharaja (Great King), Raja (King) and Nawab.\r\n\r\nDuring the Mughal Empire, zamindars belonged to the nobility[1] and formed the ruling class. Emperor Akbar granted them mansabs and their ancestral domains were treated as jagirs.[2] Under British colonial rule in India, the permanent settlement consolidated what became known as the zamindari system. The British rewarded supportive zamindars by recognising them as princes. Many of the region\'s princely states were pre-colonial zamindar holdings elevated to a greater protocol. However, the British also reduced the land holdings of many pre-colonial aristocrats, demoting their status to a zamindar from previously higher ranks of nobility.\r\n\r\nThe system was abolished during land reforms in East Bengal (Bangladesh) in 1950,[3] India in 1951[4] and West Pakistan in 1959.[5]\r\n\r\nThe zamindars often played an important role in the regional histories of the subcontinent. One of the most notable examples is the 16th century confederation formed by twelve zamindars in the Bhati region (Baro-Bhuyans), which, according to the Jesuits and Ralph Fitch, earned a reputation for successively repelling Mughal invasions through naval battles. The confederation was led by a zamindar-king, Isa Khan, and included both Muslims and Hindus, such as Pratapaditya. The zamindars were also patrons of the arts. The Tagore family produced India\'s first Nobel laureate in literature in 1913, Rabindranath Tagore, who was often based at his estate. The zamindars also promoted neoclassical and Indo-Saracenic architecture', '3unit(6)aphistoryzamindari.mp4', 0, 'Unit - 3', NULL, 'Zamindari Movement ');
INSERT INTO `chapter` (`chapter_id`, `class_id`, `subject_id`, `chapter_id_name`, `chapter_image`, `description`, `video_name`, `popular_video`, `chapter_name`, `popular_video_image`, `video_title`) VALUES
(29, 1, 2, 12, '1573047661_rsz_andhra_pradesh.png', 'In an effort to protect the interests of the Telugu people of Madras State, Potti Sreeramulu attempted to force the Madras state government to listen to public demands for the separation of Telugu-speaking districts (Rayalaseema and Coastal Andhra) from Madras State to form Andhra State. He went on a lengthy fast, and only stopped when Prime Minister Jawaharlal Nehru promised to form Andhra State. However, there was no movement on the issue for a long time. He started fasting again for attaining statehood for Andhra in Maharshi Bulusu Sambamurti\'s house in Madras on 19 October 1952. It started off without fanfare but steadily caught people\'s attention despite the disapproval of the fast by the Andhra INC committee.\r\n\r\nThe government of the day, however, did not make a clear statement about the formation of a new state, despite several strikes and demonstrations by Telugu people. On the midnight of 15 December (i.e. early 16 December 1952), Sreeramulu died trying to achieve his objective at House No. 126, Royapethah High Road, Mylapore, Madras State; the house has been preserved as a monument by the state government.[2]\r\n\r\nIn his death procession, people shouted slogans praising his sacrifice. When the procession reached Mount Road, thousands of people joined and raised slogans hailing Sreeramulu. Later, they went into a frenzy and resorted to destruction of public property. The news spread like wildfire and created an uproar among the people in far off places like Chirala, Vizianagaram, Visakhapatnam, Vijayawada, Rajahmundry, Eluru, Bhimavaram, Guntur, Tenali, Ongole and Nellore. Seven people were killed in clashes with police in Anakapalle and Vijayawada. The popular agitation continued for three to four days disrupting normal life in Madras and Andhra regions. On 19 December 1952, the Prime Minister of the country Jawaharlal Nehru made an announcement about formation of a separate state for the Telugu-speaking people of Madras State. The central government appointed K. N. Wanchoo, Chief Justice of the Rajasthan High Court,[3] to look into issues related to formation of Andhra State. Parliament passed the Andhra State Act in September 1953.[4]\r\n\r\nOn 1 October 1953, 11 districts in the Telugu-speaking portion of Madras State became the new Andhra State with Kurnool as the capital. Tanguturi Prakasam Pantulu (also known as Andhra Kesari – \"The Lion of Andhra\") became the first Chief Minister of the new state.[5]\r\n\r\nFormation of this first \"linguistic state\" paved the way to creation of more and provided an opportunity for these states to develop independently, linguistically and economically, each of them having a state to support', '4unitformationofandhra.mp4', 0, 'Unit - 4', NULL, 'Formation Of AP'),
(30, 1, 2, 13, '1573048032_1573047661_rsz_andhra_pradesh.png', 'Andhra Pradesh (/???ndr? pr??d??/) (About this soundpronunciation (help·info)) is one of the 28 states of India. Situated in the south-east of the country, it is the seventh-largest state in India, covering an area of 160,205 km2 (61,855 sq mi).[3] As per the 2011 census, it is the tenth-most populous state, with 49,386,799 inhabitants. The largest city in Andhra Pradesh is Visakhapatnam. Telugu, one of the classical languages of India,[9] is the major and official language of Andhra Pradesh.[10][11]\r\n\r\nThe north-western portion of Andhra Pradesh was separated to form the new state of Telangana on 2 June 2014, and Hyderabad, the longtime capital of Andhra Pradesh, was transferred to Telangana as part of the division. However, in accordance with the Andhra Pradesh Reorganisation Act, 2014, Hyderabad was to remain the acting capital of both Andhra Pradesh and Telangana states for a period of time not exceeding ten years.[12] The new riverfront de facto capital, Amaravati, is under the jurisdiction of the Andhra Pradesh Capital Region Development Authority (APCRDA).[13]\r\n\r\nAndhra Pradesh has a coastline of 974 km (605 mi) – the second-longest coastline among the states of India, after Gujarat – with jurisdiction over almost 15,000 km2 of territorial waters.[3][14] The state is bordered by Telangana in the north-west, Chhattisgarh and Odisha in the north-east, Karnataka in the west, Tamil Nadu in the south, and to the east lies the Bay of Bengal. The small enclave of Yanam, a district of Puducherry, lies to the south of Kakinada in the Godavari delta on the eastern side of the state.[15]\r\n\r\nThe state is made up of the two major regions of Rayalaseema, in the inland southwestern part of the state, and Coastal Andhra to the east and northeast, bordering the Bay of Bengal.[16][17] The state comprises thirteen districts in total, nine of which are located in Coastal Andhra and four in Rayalaseema. The largest city and commercial hub of the state are Visakhapatnam, located on the Bay of Bengal, with a GDP of US$43.5 billion; the second largest city in the state is Vijayawada, located on the banks of the Krishna River, which has a GDP of US billion (as of 2010).[18] The economy of Andhra Pradesh is the seventh-largest state economy in India with ?9.33 lakh crore (US$130 billion) in gross domestic product and a per capita GDP of ?164,000 (US$2,400).[5] Andhra Pradesh ranks twentieth among Indian states in human development index.[6]\r\n\r\nAndhra Pradesh hosted 121.8 million visitors in 2015, a 30% growth in tourist arrivals over the previous year,[19] making it the third most-visited state in India. The Tirumala Venkateswara Temple in Tirupati is one of the world\'s most visited religious sites, with 18.25 million visitors per year.[20] Other pilgrimage centres in the state include the Mallikarjuna Jyotirlinga at Srisailam, the Srikalahasteeswara Temple at Srikalahasti, the Ameen Peer Dargah in Kadapa, the Mahachaitya at Amaravathi, the Kanaka Durga Temple in Vijayawada, and Prasanthi Nilayam in Puttaparthi. The state\'s natural attractions include the beaches of Visakhapatnam, hill stations such as the Araku Valley and Horsley Hills, and the island of Konaseema in the Godavari River delta.\r\n\r\n\r\n', '5unit(1)aphistoryandhrapradeshfornation.mp4', 0, 'Unit - 5', NULL, 'Andhra Pradesh Formation'),
(31, 1, 2, 13, '1573048561_rsz_clust-map.png', 'Proponents of a separate Telangana state cite perceived injustices in the distribution of water, budget allocations, and jobs. Within the state of Andhra Pradesh, 68.5% of the catchment area of the Krishna River and 69% of the catchment area of the Godavari River are in the plateau region of Telangana and flowing through the other parts of the state into bay of Bengal. Telangana and non-coastal parts of Karnataka and Maharashtra states form Deccan Plateau. Telangana supporters state that 74.25% of irrigation water through the canal system under major irrigation projects goes to the Coastal Andhra region, while Telangana gets 18.20%. The remaining 7.55% goes to the Rayalaseema region.[8]\r\n\r\nAs per Volume-II of Krishna Water Dispute Tribunal Award, \"The area which we are considering for irrigation formed part of Hyderabad State and had there been no division of that State, there were better chances for the residents of this area to get irrigation facilities in Mahboobnagar District. We are of the opinion that this area should not be deprived of the benefit of irrigation on account of the reorganisation of States.\"[9]\r\n\r\nThe share of education funding for Telangana ranges from 9.86% in government-aided primary schools to 37.85% in government degree colleges. The above numbers include the expenditure in Hyderabad. Budget allocations to Telangana are generally less than 1/3 of the total Andhra Pradesh budget. There are allegations that in most years, funds allocated to Telangana were never spent. Since 1956, Andhra Pradesh government established 11 new medical colleges in the state. 8 were in Seemandhra and only 3 were in Telangana. Telangana was not compensated for lost opportunities because of inward migration of lot of students into Hyderabad from Seemandhra.[10]\r\n\r\nAccording to Professor Jayashankar only 20% of the total Government employees, less than 10% of employees in the secretariat, and less than 5% of department heads in the Andhra Pradesh government are from Telangana; those from other regions make up the bulk of employment.[8][11][12] He also alleged that the state was represented by Telangana chief ministers for only 6 1/2 years out of over five decades of its existence, with no chief minister from the region being in power continuously for more than 2 1/2 years.[8] As per Srikrishna committee on Telangana, Telangana held the position of CM for 10.5 years while Seema-Andhra region held it for 42 years.[13]\r\n\r\nAccording to the Backward Regions Grant Fund 2009–10, 13 backward districts are located in Andhra Pradesh: nine (all except Hyderabad) are from Telangana and the rest are from other regions.[14][15][16]\r\n\r\nProponents of a separate Telangana state feel that the agreements, plans, and assurances from the legislature and Lok Sabha over the last fifty years have not been honoured, and as a consequence Telangana has remained neglected, exploited, and backward. They allege that the experiment to remain as one state has proven to be a futile exercise and that separation is the best solution.[17][18][19]\r\n\r\nNote: The above content has been sourced from news articles and articles. It can only be regarded as opinions of a few people rather than solid facts.\r\n\r\nViews of political parties between 2009 and 2013\r\nMost of the parties in the state changed their stand about Telangana statehood several times. Here are the stands taken by various parties in the state when the movement was at its peak between 2009 and 2013. Congress party, the ruling party at center, took its final decision to go ahead with creating the Telangana state in July 2013.[20]\r\n\r\nIn parenthesis (MP seats/MLA seats from Andhra Pradesh)[21][22]\r\n\r\nIn Favor	Against	Neutral\r\nIndian National Congress (31/155) acg	All India Majlis-e-Ittehadul Muslimeenf(1/7)	YSR Congressb (2/17)\r\nTelangana Rashtra Samithi (2/17)	Communist Party of India (Marxist) (0/1)	Independents (0/2)\r\nBharatiya Janata Party (0/3)		Telugu Desam Partyae (6/86)\r\nCommunist Party of India (1/4)		\r\nLok Sattaad (0/1)[23]		\r\nIndependent (0/1)		\r\n(a) Parties which were in favor of Telangana state before 9 December 2009, but changed the stand to neutral on 10 December 2009, the day the process for formation of Telangana state was announced by central government and later retracted on 23 December.\r\n\r\n(b) After 9 December 2009, Jagan Mohan Reddy as a Congress MP opposed the Telangana state formation. After he formed the YSR Congress party, it adopted a neutral stand.[24]\r\n\r\n(c) The Praja Rajyam Party of actor-politician Chiranjeevi was against the division of the state, but merged into the Congress in 2011.\r\n\r\n(d) The Lok Satta adds that it will welcome the formation of a separate state as part of a comprehensive and amicable solution. It,however,states that the real issue is to improve the lives of people irrespective of the formation of a separate state.[25]\r\n\r\n(e) During the all party meeting on 28 December 2012, TDP representatives gave a letter signed by its president to Home minister of India which said that the party had never withdrawn its letter to Pranab Mukherjee in 2008 which supported Telangana state formation.\r\n\r\n(f) MIM wants the state to remain united. If division is unavoidable, the party wants a separate state of Rayala-Telangana with Telangana and Rayalseema regions along with Hyderabad as capital. They oppose Hyderabad being declared as a union territory.\r\n\r\n(g) The Congress Working Committee (CWC) unanimously passed a resolution On 30 July to create the State of Telangana.\r\n\r\nEarly incidents (1969 to 1985)\r\nMain article: Pre-2004 Telangana protests\r\n1969 to 1973: This period was marked by two political kranthi namely \'Jai Telangana\' and \'Jai Andhra\' movements. Social tensions arose due to influx of people from the Coastal Andhra region. Protests started with the hunger strike of a student from Khammam district for the implementation of safe-guards promised during the creation of Andhra Pradesh. The movement slowly manifested into a demand for a separate Telangana.\r\n\r\nSome students protested for \"implementation of the safe guards from Andhra Pradesh\" while some protested for a \"Separate Telangana\". The local newspaper Indian Express reported that the latter group were dominant.[26] According to the 19 January 1969 edition of The Indian Express, the agitation turned violent when a crowd attempted to set fire to a sub-inspector\'s residence. 17 were injured in police firing. Discussions about the promised safe-guards were held. The Telangana Regional Committee was, however, not fully convinced of the outcome.[27] This agitation was met by a counter agitation by the Andhra students accusing the transfer Andhra employees as a discrimination between one region and the other. The transfers were eventually challenged in the high-court.\r\n\r\nThe army had to be called in. After several days of talks with leaders of both regions, on 12 April 1969, Prime minister put forth, an eight-point plan.[28] Telangana leaders rejected the plan and protests continued under the leadership of newly formed political party Telangana Praja Samithi in 1969 asking for the formation of Telangana. Under the Mulki rules in force at the time, anyone who had lived in Hyderabad for 12 years was considered a local, and was thus eligible for certain government posts.\r\n\r\nTelangana Praja Samithi was formed under the leadership of Pratap Kishore with the intention of leading the movement. The party however, split in November 1969 with the exit of dissident Congress leaders.\r\n\r\n1971: In the May 1971 parliamentary elections, Telangana Praja Samithi won 10 out the 14 Parliament seats in Telangana.[29][30] Despite these electoral successes, some of the new party leaders gave up their agitation in September 1971 after realising that the Prime Minister was not inclined to towards a separate state of Telangana, and rejoined the safer political haven of the Congress ranks.[31][32] Chief Minister Brahmananda Reddy resigns to make room for a Telangana Chief Minister. On 30-September-1971, P.V.Narasimha Rao – who would later become the Prime Minister of India – was appointed the Chief Minister of Andhra Pradesh. \"The Telangana Praja Samiti was dissolved and its members rejoined the Congress.\"[32]\r\n\r\n1972: When the Supreme Court upheld the Mulki rules the Jai Andhra movement, with the aim of re-forming a separate state of Andhra, was started in Coastal Andhra and Rayalseema regions. The movement lasted for 110 days. The Supreme Court upheld the implementation of Mulki rules. The people from the Andhra region viewed the Mulki rules as \"treating them like aliens in their own land\".\r\n\r\n1973: a political settlement was reached with the Government of India with a Six-Point Formula. It was agreed upon by the leaders of the two regions to prevent any recurrence of such agitations in the future. To avoid legal problems, constitution was amended (32nd amendment) to give the legal sanctity to the Six-point formula.[33]\r\n\r\nIn 1985, when Telangana employees complained about the violations to six point formula, government enacted government order 610 (GO 610) to correct the violations in recruitment. As Telangana people complained about the non-implementation of GO 610, in 2001, the government formed the Girglani commission to look into violations.[34]\r\n\r\n1997 to 2010\r\nIn 1997, the state unit of the BJP passed a resolution seeking a separate Telangana.[35] In 2000, Congress party MLAs from the Telangana region who supported a separate Telangana state formed the Telangana Congress Legislators Forum and submitted momorandum to their president Sonia Gandhi requesting to support the Telangana state.[36]\r\n\r\nA new party called Telangana Rashtra Samithi (TRS), led by Kalvakuntla Chandrashekar Rao (KCR), was formed in April 2001 with the single-point agenda of creating a separate Telangana state with Hyderabad as its capital.[37]\r\n\r\nIn 2001, the Congress Working Committee sent a resolution to the NDA government for constituting a second SRC to look into the Telangana state demand. This was rejected by then union home minister L.K. Advani citing that smaller states were neither viable nor conducive to the integrity of the country.[38]\r\n\r\nIn April 2002, Advani wrote a letter to MP A. Narendra rejecting a proposal to create Telangana state explaining that \"regional disparities in economic development could be tackled through planning and efficient use of available resources\". He said that the NDA government, therefore, does \"not propose creation of a separate state of Telangana\"[39] However, in 2012, Advani said that if their then partner TDP cooperated during NDA tenure, a separate state of Telangana could have been created.[40] This was confirmed by the President of the TDP, Chandrababu Naidu, on 1 September 2013 in a public meeting.[41]\r\n\r\nMain article: 2004–10 Telangana protests\r\nIn the run-up to the 2004 Assembly and Parliament elections, then Union Home Minister L. K. Advani ruled out inclusion of Telangana in the NDA agenda and said \"Unless there is consensus among all political parties in the state and unless that consensus is reflected in a resolution of the state Assembly, we don’t propose to include it in the NDA agenda\"[42]\r\n\r\nFor these elections, the Congress party and the TRS forged an electoral alliance in the Telangana region to consider the demand of separate Telangana State.[43] Congress came to power in the state and formed a coalition government at the centre; TRS joined the coalition after the common minimum program of the coalition government included that the demand for separate Telangana state will be considered after due consultations and consensus.[44]\r\n\r\nIn February 2009 the state government declared that it had no objection, in principle, to the formation of separate Telangana and that the time had come to move forward decisively on this issue. To resolve related issues, the government constituted a joint house committee.[45] In the lead-up to the 2009 General Elections in India, all the major parties in Andhra Pradesh supported the formation of Telangana.[46]\r\n\r\nIn the 2009 elections TRS managed to win only 10 assembly seats out of the 45 it contested and only 2 MP seats. Some media analysts thought Telangana sentiment faded.[47]\r\n\r\nWithin few months of getting re-elected as popular CM, Y. S. Rajasekhara Reddy (YSR) died in a helicopter crash in September 2009. This resulted in a leadership crisis within the Congress party and also created a political vacuum in the state.[48] During this time, TRS president K. Chandrashekar Rao (KCR) raised his pitch for the separate state. On 29 November 2009, he started a fast-unto-death, demanding that the Congress party introduce a Telangana bill in Parliament.[49] Student organisations, employee unions, and various organisations joined the movement.[50] General strikes shut down Telangana on 6 and 7 December.[51] In an all party meeting called by the state government on the night of 7 December to discuss regarding KCR\'s fast and how to handle it,[52] all major Opposition parties extended their support for a separate state for Telangana. The state Congress and its ally Majlis-e-Ittehadul Muslimeen have left it to the Congress high command to take a final decision. Minutes of the meeting were faxed to Congress high command.[53]\r\n\r\nAnnouncement of bifurcation and subsequent rollback\r\nOn 9 December 2009, Union Minister of Home Affairs P. Chidambaram announced that the Indian government would start the process of forming a separate Telangana state, pending the introduction and passage of a separation resolution in the Andhra Pradesh assembly. This resulted in protests across both Andhra and Rayalseema. Students, workers, lawyers and various organisations in the regions launched the Samaikyandhra Movement demanding that the state be kept united.[54] MLAs from these regions also submitted their resignations in protest seeking a reversal of the home minister\'s statement.[55]\r\n\r\nOn 23 December, keeping in view the reactions of people of other regions, the Government of India announced that no action on Telangana will be taken until a consensus is reached by all parties and groups in the state.[56] Coastal Andhra and Rayalaseema region MLAs started withdrawing their resignations while MLAs and ministers from Telangana started submitting their resignations, and demanded that the Centre take immediate steps to initiate the process of bifurcating Andhra Pradesh.[57]\r\n\r\nA Joint Action Committee (also known as JAC or TJAC) comprising political and non-political groups was formed to lead the demand for separate Telangana with Osmania University professor M Kodandaram as its convenor.[58]\r\n\r\nOn 3 February, the government appointed a five-member committee headed by Justice SriKrishna to look into the issue.[59]\r\n\r\n2010: Srikrishna Committee\r\nMain article: Committee for Consultations on the situation in Andhra Pradesh\r\nThe Srikrishna Committee headed by former Chief Justice B. N. Srikrishna toured all the regions of state extensively and invited people from all sections of the society to give their opinion on the statehood. It received over one lakh petitions and representations from political parties, organisations, NGOs and individuals. It also held consultations with political parties and general public while also factoring in the impact of recent developments on different sections of people such as women, children, students, minorities, Other Backward Classes, Scheduled Castes and Scheduled Tribes.[60]\r\n\r\nOn 16 December 2010, two weeks before the deadline for the submission of the Srikrishna report, TRS organised a public meeting in Warangal. It was estimated that over 2.6 million people attended this meeting. It was reported that even more would have attended, but were stranded due to traffic jams along roads leading to the city.[61][62][63] TRS president K. Chandrasekhar Rao appealed to Prime Minister Manmohan Singh to note that the people of Telangana were losing patience. He demanded that the Centre introduce the Bill on Telangana in the next session of Parliament.[64][65][66][67]\r\n\r\nDays before the Srikrishna committee submitted its report to the Central government, KCR declared that his party was ready to wash Sonia Gandhi\'s feet if she agrees to the Telangana demand. He said his party is associated with the movement and was willing to dissolve the party if the state was formed.', '5Unit(2)AP HISTORy-historiceventbetween1956-2014.mp4', 0, 'Unit - 5', NULL, 'Events From 1956 - 2014'),
(32, 1, 3, 14, '1573190141_1551175625_geography-of-png-6.png', 'Geography (from Greek: ?????????, geographia, literally \"earth description\")[1] is a field of science devoted to the study of the lands, features, inhabitants, and phenomena of the Earth and planets.[2] The first person to use the word ????????? was Eratosthenes (276–194 BC).[3] Geography is an all-encompassing discipline that seeks an understanding of Earth and its human and natural complexities—not merely where objects are, but also how they have changed and come to be.\r\n\r\nGeography is often defined in terms of two branches: human geography and physical geography.[4][5] Human geography deals with the study of people and their communities, cultures, economies, and interactions with the environment by studying their relations with and across space and place.[6] Physical geography deals with the study of processes and patterns in the natural environment like the atmosphere, hydrosphere, biosphere, and geosphere.\r\n\r\nThe four historical traditions in geographical research are: spatial analyses of natural and the human phenomena, area studies of places and regions, studies of human-land relationships, and the Earth sciences. Geography has been called \"the world discipline\" and \"the bridge between the human and the physical sciences\".\r\n\r\nGeography is a systematic study of the Universe and its features. Traditionally, geography has been associated with cartography and place names. Although many geographers are trained in toponymy and cartology, this is not their main preoccupation. Geographers study the space and the temporal database distribution of phenomena, processes, and features as well as the interaction of humans and their environment.[10] Because space and place affect a variety of topics, such as economics, health, climate, plants and animals, geography is highly interdisciplinary. The interdisciplinary nature of the geographical approach depends on an attentiveness to the relationship between physical and human phenomena and its spatial patterns.[11]\r\n\r\nNames of places...are not geography...know by heart a whole gazetteer full of them would not, in itself, constitute anyone a geographer. Geography has higher aims than this: it seeks to classify phenomena (alike of the natural and of the political world, in so far as it treats of the latter), to compare, to generalize, to ascend from effects to causes, and, in doing so, to trace out the laws of nature and to mark their influences upon man. This is \'a description of the world\'—that is Geography. In a word Geography is a Science—a thing not of mere names but of argument and reason, of cause and effect.[12]\r\n\r\n—?William Hughes, 1863\r\nJust as all phenomena exist in time and thus have a history, they also exist in space and have a geography.[13]\r\n\r\n—?United States National Research Council, 1997\r\nGeography as a discipline can be split broadly into two main subsidiary fields: human geography and physical geography. The former largely focuses on the built environment and how humans create, view, manage, and influence space. The latter examines the natural environment, and how organisms, climate, soil, water, and landforms produce and interact.[14] The difference between these approaches led to a third field, environmental geography, which combines physical and human geography and concerns the interactions between the environment and humans\r\n', '1Unit(1)IntroductiontoGeography.mp4', 0, 'Unit - 1', NULL, 'Introdcution To Geography'),
(33, 1, 3, 14, '1573191173_India_and_its_neighbours.jpg', 'India lies on the Indian Plate, the northern portion of the Indo-Australian Plate, whose continental crust forms the Indian subcontinent. The country is situated north of the equator between 8°04\' to 37°06\' north latitude and 68°07\' to 97°25\' east longitude.[2] It is the seventh-largest country in the world, with a total area of 3,287,263 square kilometres (1,269,219 sq mi).[3] India measures 3,214 km (1,997 mi) from north to south and 2,933 km (1,822 mi) from east to west. It has a land frontier of 15,200 km (9,445 mi) and a coastline of 7,516.6 km (4,671 mi).[1]\r\n\r\nOn the south, India projects into and is bounded by the Indian Ocean—in particular, by the Arabian Sea on the west, the Lakshadweep Sea to the southwest, the Bay of Bengal on the east, and the Indian Ocean proper to the south. The Palk Strait and Gulf of Mannar separate India from Sri Lanka to its immediate southeast, and the Maldives are some 125 kilometres (78 mi) to the south of India\'s Lakshadweep Islands across the Eight Degree Channel. India\'s Andaman and Nicobar Islands, some 1,200 kilometres (750 mi) southeast of the mainland, share maritime borders with Myanmar, Thailand and Indonesia. Kanyakumari at 8°4?41?N and 77°55?230?E is the southernmost tip of the Indian mainland, while the southernmost point in India is Indira Point on Great Nicobar Island. The northernmost point which is under Indian administration is Indira Col, Siachen Glacier.[4] India\'s territorial waters extend into the sea to a distance of 12 nautical miles (13.8 mi; 22.2 km) from the coast baseline.[5] India has the 18th largest Exclusive Economic Zone of 2,305,143 km2 (890,021 sq mi).\r\n\r\nThe northern frontiers of India are defined largely by the Himalayan mountain range, where the country borders China, Bhutan, and Nepal. Its western border with Pakistan lies in the Karakoram range, Punjab Plains, the Thar Desert and the Rann of Kutch salt marshes. In the far northeast, the Chin Hills and Kachin Hills, deeply forested mountainous regions, separate India from Burma. On the east, its border with Bangladesh is largely defined by the Khasi Hills and Mizo Hills, and the watershed region of the Indo-Gangetic Plain.[clarification needed]\r\n\r\nThe Ganga is the longest river originating in India. The Ganga–Brahmaputra system occupies most of northern, central, and eastern India, while the Deccan Plateau occupies most of southern India. Kangchenjunga, in the Indian state of Sikkim, is the highest point in India at 8,586 m (28,169 ft) and the world\'s third highest peak. Climate across India ranges from equatorial in the far south, to alpine and tundra in the upper reaches of the Himalayas. the geographic view of India is pretty expository and vivid in the terms of area, mountains and relief.\r\n\r\n\r\n', '1Unit(2)IG-Land&Boundries.mp4', 0, 'Unit - 1', NULL, 'Land & Its Boundaries'),
(34, 1, 3, 14, '1573191982_landlocked-states-do-not-have-an-International-boundary.jpg', 'In India there are 20 landlocked states, of these five do not have an international boundary. \r\n\r\nA landlocked state is a state entirely enclosed by land or whose coastlines lie on closed seas. An access to water bodies accords benefits which is not the case of landlocked states. According to a famous saying, “If you are coastal, you serve the world; if you are landlocked, you serve your neighbors.” Five landlocked states which do not have an international boundary are Chhattisgarh, Haryana, Jharkhand, Madhya Pradesh and Telangana.\r\n\r\nChhattisgarh\r\nThe 10th largest state of India, Chhattisgarh is one of the fastest developing state in India. Chhattisgarh shares its boundaries with the states of Madhya Pradesh in the northwest, Maharashtra in the southwest, Telangana and Andhra Pradesh in the south, Odisha in the southeast, Jharkhand in the northeast and Uttar Pradesh in the north.\r\n\r\nHaryana\r\nHaryana is the 18th most populous state in India. Haryana shares its borders with Punjab and Himachal Pradesh to the north, Rajasthan to the southwest and touches Uttar Pradesh towards east which is defined by the Yamuna river. Delhi, the capital city of India, is surrounded by Haryana on the northern, western and southern borders.\r\n\r\nJharkhand \r\nApproximately 40% of the mineral resources of the country come from Jharkhand. Jharkhand is one of the landlocked states of India and shares its borders with Bihar on the north, West Bengal to the east, Chhattisgarh and Uttar Pradesh to the northwest and Odisha to the south. Interestingly, all the districts of Jharkhand, except Lohardaga and Khunti, share a border with a neighboring state.\r\n\r\nMadhya Pradesh\r\nMadhya Pradesh is the heart of India. Being located centrally, it shares its border with the states of Uttar Pradesh to the northeast, Chhatisgarh to southeast, Maharashtra to south, Gujrat to west and Rajasthan to the northwest. The name of this state itself suggests it to be the Central Province.\r\n\r\nTelangana\r\nIt is the youngest state of the nation, officially formed on 2 June 2014. Telangana shares its borders with Maharashtra to the northwest, Chhattisgarh to the north, Karnataka to the west and Andhra Pradesh to the southeast.', '1Unit(3)Land-Lockedstates.mp4', 0, 'Unit - 1', NULL, 'Land - Locked States'),
(35, 1, 3, 15, '1573192220_1572585781.jpg', 'The geography of India is extremely diverse, with landscape ranging from snow-capped mountain ranges to deserts, plains, hills and plateaus. India comprises most of the Indian subcontinent situated on the Indian Plate, the northerly portion of the Indo-Australian Plate. Having a coastline of over 7,000 km (4,300 miles), most of India lies on a peninsula in southern Asia that protrudes into the Indian Ocean. India is bounded in the southwest by the Arabian Sea and in the southeast by the Bay of Bengal.\r\n\r\nThe fertile Indo-Gangetic plain occupies most of northern, central and eastern India, while the Deccan Plateau occupies most of southern India. To the west of the country is the Thar Desert, which consists of a mix of rocky and sandy desert. India\'s east and northeastern border consists of the high Himalayan range. The highest point in India is disputed due to a territorial dispute with Pakistan; according to India\'s claim, the highest point (located in the disputed Kashmir territory) is K2, at 8,611 m (28,251 feet). The highest point in undisputed Indian territory is Kangchenjunga, at 8,598 m (28,208 feet). Climate ranges from equatorial in the far south, to tundra in the Himalayan altitudes.\r\n\r\nIndia is bordered by Pakistan, the People\'s Republic of China, Bangladesh, Myanmar, Nepal, Bhutan and Afghanistan. Sri Lanka and the Maldives are island nations to the south of India. Politically, India is divided into 28 states, six federally administered union territories and a national capital territory. The political divisions generally follow linguistic and ethnic boundaries rather than geographic transitions.\r\n\r\n\r\nLocation and extent\r\nKanyakumari is the southernmost point in mainland India.\r\nEnlarge\r\nKanyakumari is the southernmost point in mainland India.\r\nIndia lies to the north of the equator between 8 degree 4 minutes and 37 degree 6 minutes north latitude and 68 degrees 7 minutes and 97 degrees 25 minutes east longitude. It is the seventh-largest country in the world, with a total land area of 3,287,590 km² (1,269,219 square miles). India measures 3,214 km (1,997 miles) from north to south and 2,933 km (1,822 miles) from east to west. It has a land frontier of 15,200 km (9,445 miles) and a coastline of 7,516.5 km (4,670.5 miles). The Andaman and Nicobar Islands in the Bay of Bengal and Lakshadweep in the Arabian Sea are parts of India.\r\n\r\nIndia is bounded on the southwest by the Arabian Sea and on the southeast by the Bay of Bengal. On the north, northeast, and northwest are the Himalayas. Kanyakumari constitutes the southern tip of the Indian peninsula, which narrows before ending in the Indian Ocean', '2Unit-Physicalgeography.mp4', 0, 'Unit - 2', NULL, 'Physical Geography'),
(36, 1, 3, 16, '1573192533_india-climate.png', 'The climate of India comprises a wide range of weather conditions across a vast geographic scale and varied topography, making generalisations difficult. Based on the Köppen system, India hosts six major climatic subtypes, ranging from arid deserts in the west, alpine tundra and glaciers in the north, and humid tropical regions supporting rainforests in the southwest and the island territories. Many regions have starkly different microclimates, making it one of the most climatically diverse countries in the world. The country\'s meteorological department follows the international standard of four climatological seasons with some local adjustments: winter (December, January and February), summer (March, April and May), a monsoon means rainy season (June to September), and a post-monsoon period (October to November).\r\n\r\nIndia\'s geography and geology are climatically pivotal: the Thar Desert in the northwest and the Himalayas in the north work in tandem to effect a culturally and economically important monsoonal regime. As Earth\'s highest and most massive mountain range, the Himalayas bar the influx of frigid katabatic winds from the icy Tibetan Plateau and northerly Central Asia. Most of North India is thus kept warm or is only mildly chilly or cold during winter; the same thermal dam keeps most regions in India hot in summer.\r\n\r\nThough the Tropic of Cancer—the boundary between the tropics and subtropics—passes through the middle of India, the bulk of the country can be regarded as climatically tropical. As in much of the tropics, monsoonal and other weather patterns in India can be wildly unstable: epochal droughts, floods, cyclones, and other natural disasters are sporadic, but have displaced or ended millions of human lives. There is one scientific opinion which states that in South Asia such climatic events are likely to change in unpredictability, frequency, and severity. Ongoing and future vegetative changes and current sea level rises and the attendant inundation of India\'s low-lying coastal areas are other impacts, current or predicted, that are attributable to global warming.\r\n\r\nDuring the Triassic period of some 251–199.6 Ma, the Indian subcontinent was part of a vast supercontinent known as Pangaea. Despite its position within a high-latitude belt at 55–75° S—latitudes now occupied by parts of the Antarctic Peninsula, as opposed to India\'s current position between 5 and 35° N—India likely experienced a humid temperate climate with warm and frost-free weather, though with well-defined seasons.[4] India later merged into the southern supercontinent Gondwana, a process beginning some 550–500 Ma. During the Late Paleozoic, Gondwana extended from a point at or near the South Pole to near the equator, where the Indian craton (stable continental crust) was positioned, resulting in a mild climate favourable to hosting high-biomass ecosystems. This is underscored by India\'s vast coal reserves—much of it from the late Paleozoic sedimentary sequence—the fourth-largest reserves in the world.[5] During the Mesozoic, the world, including India, was considerably warmer than today. With the coming of the Carboniferous, global cooling stoked extensive glaciation, which spread northwards from South Africa towards India; this cool period lasted well into the Permian.[6]\r\n\r\nTectonic movement by the Indian Plate caused it to pass over a geologic hotspot—the Réunion hotspot—now occupied by the volcanic island of Réunion. This resulted in a massive flood basalt event that laid down the Deccan Traps some 60–68 Ma,[7][8] at the end of the Cretaceous period. This may have contributed to the global Cretaceous–Paleogene extinction event, which caused India to experience significantly reduced insolation. Elevated atmospheric levels of sulphur gases formed aerosols such as sulphur dioxide and sulphuric acid, similar to those found in the atmosphere of Venus; these precipitated as acid rain. Elevated carbon dioxide emissions also contributed to the greenhouse effect, causing warmer weather that lasted long after the atmospheric shroud of dust and aerosols had cleared. Further climatic changes 20 million years ago, long after India had crashed into the Laurasian landmass, were severe enough to cause the extinction of many endemic Indian forms.[9] The formation of the Himalayas resulted in blockage of frigid Central Asian air, preventing it from reaching India; this made its climate significantly warmer and more tropical in character than it would otherwise have been.', '3Unit-CLIMATE.mp4', 0, 'Unit - 3', NULL, 'Climate Of India'),
(37, 1, 3, 17, '1573193074_drainage-system-india.jpg', '. The Indian Drainage System is divided into 3 categories: (1) Major River Basin with catchment area up to 20000 sq. km. and above, accounts for 83% of the total run off and are 13 in number in India.  (2) Medium River Basin with catchment area of 2000-20000 sq. km. and above accounts of 8% of the total run off all the rivers and are 45 in India. (3) Minor River Basin with catchment area up to 2000 sq. km. It accounts for 9% of the total run off among all the rivers with 55 basins in India.\r\n\r\n2. On the basis of physiographic origin the Indian drainage may be distinguished as the Himalayan drainage and the peninsular drainage. Himalayan drainage system mainly comprises the basin areas of the Indus, the Ganga and the Brahmaputra. These are mostly perennial and youth having gorges, V-shaped valley and depositional features like Deltas.\r\n\r\nComparison between Himalayan and the Peninsular River of India\r\n\r\n3. Many of the rivers are older than the Himalayas and cut across it. Whereas Peninsular Rivers is much older and includes numerous rivers. Rivers are matured with almost graded Profiles and mostly superimposed in nature i.e., follow the gradient or fault valley. These are devoid of meanders and have fixed course unlike Himalayan drainage.\r\n\r\n4. River Indus flows through Ladakh and Zaskar Range. Gilgit is a right bank tributary of Indus.\r\n\r\n5. Ganga River enters into plain at Haridwar. The number of tributaries of the River Ganga is more in Avadh Plain as compared to that in Rohilkhand Plain. Bhagirathi and Alaknanda meet at Devprayag and after that it takes the name of river Ganga.\r\n\r\n6. Brahmaputra or Tsangpo flows through Tibet, India and Bangladesh and forms the largest delta of the world along with Ganga.\r\n\r\n7. Important tributaries are Subansiri, Kameng, Dhansiri, Dihang, Lohit, Tista, Manas, etc. River Brahmaputra is called as Sikiang in Arunachal Pradesh and Jamuna in Bangladesh.\r\n\r\n8. East flowing rivers of Peninsular India are Mahanadi, Godavari, Krishna and Cauvery and West flowing rivers are Narmada, Tapi, Mahi, Kalinadi and other small rivers.\r\n\r\n9. Mahanadi originates from Sihawa North foot hills of Dandakarnaya. Godavari originates from Trimbak Plateau of North Sahyadri near Nasik and Godavari makes boundary between Maharashtra and Andhra Pradesh.\r\n\r\n10. Krishna originates North of Mahabaleshwar in the Western Ghat and along with Godavari it forms the 2nd largest delta in India. Koleru Lake lies in this delta.\r\n\r\n11. Cauvery rises in Brahmagiri Range in Western Ghat. This is the only Perennial River in Peninsular India and creates contention among Kerala, Tamil Nadu, and Karnataka. cauvery forms a quadrilateral delta at its mouth.\r\n\r\n12. Among the West flowing rivers Tapi and Narmada are flowing through rift valleys. Tapi rises near Multai in Betul Plateau and flows between Satpura and Ajanta-Satamala hills. Narmada flows between Vindhya and Satpura range. Rivers Luni, Ghaggar, Rupnarain, Medha, etc have inland drainage.\r\n\r\n', '4Unit-RIVER.mp4', 0, 'Unit - 4', NULL, 'Indian Drainage System'),
(38, 1, 3, 18, '1573193284_Forest-PNG-HD.png', 'Forestry in India is a significant rural industry and a major environmental resource. India is one of the ten most forest-rich countries of the world.Together, India and these other 9 countries account for 67 percent of total forest area of the world.[1] India\'s forest cover grew at 0.20% annually over 1990-2000,[2] and has grown at the rate of 0.7% per year over 2000-2010,[2] after decades where forest degradation was a matter of serious concern.[3]\r\n\r\nAs of 2010, the Food and Agriculture Organization of the United Nations estimates India\'s forest cover to be about 68 million hectares, or 22% of the country\'s area[4][5] The 2013 Forest Survey of India states its forest cover increased to 69.8 million hectares by 2012, per satellite measurements; this represents an increase of 5,871 square kilometers of forest cover in 2 years.[6] However, the gains were primarily in northern, central and southern Indian states, while northeastern states witnessed a net loss in forest cover over 2010 to 2012.In 2018, the total forest and tree cover in India increased to 24.39% or 8,02,088 sq. km [7][8].\r\n\r\nIn 2002, forestry industry contributed 1.7% to India\'s GDP.[3] In 2010, the contribution to GDP dropped to 0.9%, largely because of rapid growth of the economy in other sectors and the government\'s decision to reform and reduce import tariffs to let imports satisfy the growing Indian demand for wood products. India produces a range of processed forest (wood and non-wood) products ranging from wood panel products and wood pulp to make bronze, rattazikistan ware and pern resin. India\'s paper industry produces over 3,000 metric tonnes annually from more than 400 mills.[3] The furniture and craft industry is another consumer of wood. India\'s wood-based processing industries consumed about 30 million cubic metres of industrial wood in 2002.[3] India annually consumes an additional 270 million tonnes of fuelwood, 2800 million tonnes of fodder, and about 102 million cubic meter of forest products - valued at about ?27,500 crore (US$4.0 billion) a year. India is one of the world\'s largest consumer of fuel-wood.[3] India\'s consumption of fuel-wood is about five times higher than what can be sustainably removed from forests.[3] However, a large percentage of this fuel-wood is grown as biomass remaining from agriculture, and is managed outside forests. Fuel-wood meets about 40% of the energy needs of the country.[3] Around 80% of rural people and 48% of urban people use fuel-wood.[3] Unless India makes major, rapid and sustained effort to expand electricity generation and power plants, the rural and urban poor in India will continue to meet their energy needs through unsustainable destruction of forests and fuel wood consumption. India\'s dependence on fuel-wood and forestry products as a primary energy source is not only environmentally unsustainable, it is a primary cause of India\'s near-permanent haze and air pollution.[9][10]\r\n\r\nForestry in India is more than just about wood and fuel. India has a thriving non-wood forest products industry, which produces latex, gums, resins, essential oils, flavours, fragrances and aroma chemicals, incense sticks, handicrafts, thatching materials and medicinal plants. About 60% of non-wood forest products production is consumed locally. About 50% of the total revenue from the forestry industry in India is in non-wood forest products category.[3] In 2002, non-wood forest products were a source of significant supplemental income to over 400 million people in India, mostly rural.', '5Unit-FOREST.mp4', 0, 'Unit - 5', NULL, 'Forest In India');
