(39, 1, 3, 19, '1573193568_soil_PNG84.png', 'Definition of Soil\r\nSoil can be simply defined as a mixture of small rock particles/debris and organic materials/ humus which develop on the earth surface and support growth of plants.\r\n\r\nSoil Classification – Urvara vs Usara\r\nIn India, soil had been classified from the ancient period itself even though it was not as detail as the modern classifications.\r\nIn the ancient period, the classification was based on only two things; whether the soil is fertile or sterile. Thus the classification were:\r\nUrvara [fertile]\r\nUsara [sterile]\r\nSoil Classification – Agencies involved\r\nIn the modern period, when men started to know about the various characteristics of soil they began to classify soil on the basis of texture, colour, moisture etc.\r\nWhen the Soil survey of India was established in 1956, they studied soils of India and their characteristics.\r\nThe National Bureau of Soil Survey and the Land Use Planning, an institute under the control of Indian Council of Agriculture Research did a lot of studies on Indian soil.\r\nMajor classification of Indian soils\r\nMajor soil types in India\r\n\r\nAlluvial soil [43%]\r\nRed soil [18.5%]\r\nBlack / regur soil [15%]\r\nArid / desert soil\r\nLaterite soil\r\nSaline soil\r\nPeaty / marshy soil\r\nForest soil\r\nSub-mountain soil\r\nSnowfields\r\nAlluvial soil:\r\nMostly available soil in India (about 43%) which covers an area of 143 sq.km.\r\nWidespread in northern plains and river valleys.\r\nIn peninsular-India, they are mostly found in deltas and estuaries.\r\nHumus, lime and organic matters are present.\r\nHighly fertile.\r\nIndus-Ganga-Brahmaputhra plain, Narmada-Tapi plain etc are examples.\r\nThey are depositional soil – transported and deposited by rivers, streams etc.\r\nSand content decreases from west to east of the country.\r\nNew alluvium is termed as Khadar and old alluvium is termed as Bhangar.\r\nColour: Light Grey to Ash Grey.\r\nTexture: Sandy to silty loam or clay.\r\nRich in: potash\r\nPoor in: phosphorous.\r\nWheat, rice, maize, sugarcane, pulses, oilseed etc are cultivated mainly.\r\nRed soil:\r\nSeen mainly in low rainfall area.\r\nAlso known as Omnibus group.\r\nPorous, friable structure.\r\nAbsence of lime, kankar (impure calcium carbonate).\r\nDeficient in: lime, phosphate, manganese, nitrogen, humus and potash.\r\nColour: Red because of Ferric oxide. The lower layer is reddish yellow or yellow.\r\nTexture: Sandy to clay and loamy.\r\nWheat, cotton, pulses, tobacco, oilseeds, potato etc are cultivated.\r\nBlack soil / regur soil:\r\nRegur means cotton – best soil for cotton cultivation.\r\nMost of the Deccan is occupied by Black soil.\r\nMature soil.\r\nHigh water retaining capacity.\r\nSwells and will become sticky when wet and shrink when dried.\r\nSelf-ploughing is a characteristic of the black soil as it develops wide cracks when dried.\r\nRich in: Iron, lime, calcium, potassium, aluminum and magnesium.\r\nDeficient in: Nitrogen, Phosphorous and organic matter.\r\nColour: Deep black to light black.\r\nTexture: Clayey.\r\nLaterite soil:\r\nName from Latin word ‘Later’ which means Brick.\r\nBecome so soft when wet and so hard when dried.\r\nIn the areas of high temperature and high rainfall.\r\nFormed as a result of high leaching.\r\nLime and silica will be leached away from the soil.\r\nOrganic matters of the soil will be removed fast by the bacteria as it is high temperature and humus will be taken quickly by the trees and other plants. Thus, humus content is low.\r\nRich in: Iron and Aluminum\r\nDeficient in: Nitrogen, Potash, Potassium, Lime, Humus\r\nColour: Red colour due to iron oxide.\r\nRice, Ragi, Sugarcane and Cashew nuts are cultivated mainly.\r\nDesert / arid soil:\r\nSeen under Arid and Semi-Arid conditions.\r\nDeposited mainly by wind activities.\r\nHigh salt content.\r\nLack of moisture and Humus.\r\nKankar or Impure Calcium carbonate content is high which restricts the infiltration of water.\r\nNitrogen is insufficient and Phosphate is normal.\r\nTexture: Sandy\r\nColour: Red to Brown.\r\nPeaty / marshy soil:\r\nAreas of heavy rainfall and high humidity.\r\nGrowth of vegetation is very less.\r\nA large quantity of dead organic matter/humus which makes the soil alkaline.\r\nHeavy soil with black colour.\r\nForest soil:\r\nRegions of high rainfall.\r\nHumus content is less and thus the soil is acidic.\r\nMountain soil:\r\nIn the mountain regions of the country.\r\nImmature soil with low humus and acidic.', '6Unit-SOIL.mp4', 0, 'Unit - 6', NULL, 'Soils In India'),
(40, 1, 3, 20, '1573193926_1565349656_agriculture-download-png-thumb.png', 'The history of Agriculture in India dates back to Indus Valley Civilization and even before that in some places of Southern India.[1] India ranks second worldwide in farm outputs. As per 2018, agriculture employed 50% of the Indian work force and contributed 17-18% to country\'s GDP.[2]\r\n\r\nIn 2016, agriculture and allied sectors like animal husbandry, forestry and fisheries accounted for 15.4% of the GDP (gross domestic product) with about 31% of the workforce in 2014.[3][4][5] India ranks first in the world with highest net cropped area followed by US and China.[6] The economic contribution of agriculture to India\'s GDP is steadily declining with the country\'s broad-based economic growth. Still, agriculture is demographically the broadest economic sector and plays a significant role in the overall socio-economic fabric of India.\r\n\r\nIndia exported $38 billion worth of agricultural products in 2013, making it the seventh largest agricultural exporter worldwide and the sixth largest net exporter.[7] Most of its agriculture exports serve developing and least developed nations.[7] Indian agricultural/horticultural and processed foods are exported to more than 120 countries, primarily to the Japan, Southeast Asia, SAARC countries, the European Union and the United States\r\n\r\nAs per the 2014 FAO world agriculture statistics India is the world\'s largest producer of many fresh fruits like banana, mango, guava, papaya, lemon and vegetables like chickpea, okra and milk, major spices like chili pepper, ginger, fibrous crops such as jute, staples such as millets and castor oil seed. India is the second largest producer of wheat and rice, the world\'s major food staples.[10]\r\n\r\nIndia is currently the world\'s second largest producer of several dry fruits, agriculture-based textile raw materials, roots and tuber crops, pulses, farmed fish, eggs, coconut, sugarcane and numerous vegetables. India is ranked under the world\'s five largest producers of over 80% of agricultural produce items, including many cash crops such as coffee and cotton, in 2010.[10] India is one of the world\'s five largest producers of livestock and poultry meat, with one of the fastest growth rates, as of 2011.[11]\r\n\r\nOne report from 2008 claimed that India\'s population is growing faster than its ability to produce rice and wheat.[12] While other recent studies claim that India can easily feed its growing population, plus produce wheat and rice for global exports, if it can reduce food staple spoilage/wastage, improve its infrastructure and raise its farm productivity like those achieved by other developing countries such as Brazil and China.[13][14]\r\n\r\nIn fiscal year ending June 2011, with a normal monsoon season, Indian agriculture accomplished an all-time record production of 85.9 million tonnes of wheat, a 6.4% increase from a year earlier. Rice output in India hit a new record at 95.3 million tonnes, a 7% increase from the year earlier.[15] Lentils and many other food staples production also increased year over year. Indian farmers, thus produced about 71 kilograms of wheat and 80 kilograms of rice for every member of Indian population in 2011. The per capita supply of rice every year in India is now higher than the per capita consumption of rice every year in Japan.[16]\r\n\r\nIndia exported $39 billion worth of agricultural products in 2013, making it the seventh largest agricultural exporter worldwide, and the sixth largest net exporter.[7] This represents explosive growth, as in 2004 net exports were about $5 billion.[7] India is the fastest growing exporter of agricultural products over a 10-year period, its $39 billion of net export is more than double the combined exports of the European Union (EU-28).[7] It has become one of the world\'s largest supplier of rice, cotton, sugar and wheat. India exported around 2 million metric tonnes of wheat and 2.1 million metric tonnes of rice in 2011 to Africa, Nepal, Bangladesh and other regions around the world.[15]\r\n\r\nAquaculture and catch fishery is amongst the fastest growing industries in India. Between 1990 and 2010, the Indian fish capture harvest doubled, while aquaculture harvest tripled. In 2008, India was the world\'s sixth largest producer of marine and freshwater capture fisheries and the second largest aquaculture farmed fish producer. India exported 600,000 metric tonnes of fish products to nearly half of the world\'s countries.[17][18][19] Though the available nutritional standard is 100% of the requirement, India lags far behind in terms of quality protein intake at 20% which is to be tackled by making available protein rich food products such as eggs, meat, fish, chicken etc. at affordable prices\r\n\r\nIndia has shown a steady average nationwide annual increase in the kilograms produced per hectare for some agricultural items, over the last 60 years. These gains have come mainly from India\'s green revolution, improving road and power generation infrastructure, knowledge of gains and reforms.[21] Despite these recent accomplishments, agriculture has the potential for major productivity and total output gains, because crop yields in India are still just 30% to 60% of the best sustainable crop yields achievable in the farms of developed and other developing countries. Additionally, post harvest losses due to poor infrastructure and unorganised retail, caused India to experience some of the highest food losses in the world.', '7Unit-Agriculture.mp4', 0, 'Unit - 7', NULL, 'Agriculture In India'),
(41, 1, 3, 21, '1573194959_irrigation.png', 'Irrigation in India includes a network of major and minor canals from Indian rivers, groundwater well based systems, tanks, and other rainwater harvesting projects for agricultural activities. Of these groundwater system is the largest.[1] In 2013-14, only about 47.7% of total agricultural land in India was reliably irrigated.[2] The largest canal in India is Indira Gandhi Canal, which is about 650 km long. About 2/3rd cultivated land in India is dependent on monsoons.[3] Irrigation in India helps improve food security, reduce dependence on monsoons, improve agricultural productivity and create rural job opportunities. Dams used for irrigation projects help produce electricity and transport facilities, as well as provide drinking water supplies to a growing population, control floods and prevent droughts.\r\n\r\nThe earliest mentions of irrigation are found in Rigveda chapters 1.55, 1.85, 1.105, 7.9, 8.69 and 10.101.[5] The Veda mentions only well-style irrigation,[6] where kupa and avata wells once dug are stated to be always full of water, from which varatra (rope strap) and cakra (wheel) pull kosa (pails) of water. This water was, state the Vedas, led into surmi susira (broad channels) and from there into khanitrima (diverting channels) into fields.[5]\r\n\r\nLater, the 4th-century BCE Indian scholar P??ini, mentions tapping several rivers for irrigation.[5][7] The mentioned rivers include Sindhu, Suvastu, Varnu, Sarayu, Vipas and Chandrabhaga.[5] Buddhist texts from the 3rd century BCE also mention irrigation of crops.[6] Texts from the Maurya Empire era (3rd century BCE) mention that the state raised revenue from charging farmers for irrigation services from rivers.[5][8]\r\n\r\nPatanjali, in Yogasutra of about the 4th century CE, explains a technique of yoga by comparing it to \"the way a farmer diverts a stream from an irrigation canal for irrigation\".[9][10] In Tamil Nadu, the Grand Anicut (canal) across the Kaveri river was implemented in the 3rd century CE, and the basic design is still used today.Peace[8]\r\n\r\nMedieval era\r\nThe most widespread irrigation system in India was undertaken in India in the medieval period by the Sultanate rulers. Firuz Shah Tughalq (1309-1388) built the most extensive canal irrigation system around the Indo-Gangetic doab and the region west of the river Yamuna in the fourteenth century. These canals provided vast resources of water to agricultural lands in northern India as well as vital supplies of water to urban and rural settlements.[11]. These irrigation projects were continued by the subsequent rulers of northern India, particularly the Mughal rulers till the early eighteenth century. The British built the colonial canal networks on these medieval canal systems.[12]\r\n\r\nColonial era\r\n\r\nGanges irrigation canal built during the colonial era, and inaugurated in 1854.\r\nIn 1800, some 800,000 hectares were irrigated in India.[8] The British Raj by 1940 built significant number of canals and irrigation systems in Uttar Pradesh, Bihar, Punjab, Assam and Orissa. The Ganges Canal reached 350 miles from Haridwar to Kanpur in Uttar Pradesh. In Assam, a jungle in 1840, by 1900 had 1.62m hectares under cultivation, especially in tea plantations. In all, the amount of irrigated land multiplied by a factor of eight. Historian David Gilmour states British colonial government had built irrigation network with Ganges canal and that, \"by the end of the century the new network of canals in the Punjab\" were in place.\r\n\r\nMuch of the increase in irrigation during British colonial era was targeted at dedicated poppy and opium farms in India, for exports to China.[18][19][20] Poppy cultivation by the British Raj required reliable, dedicated irrigation system. Large portions of the eastern and northern regions of India, namely United Provinces, Northwestern Provinces, Oudh, Behar, Bengal and Rewa were irrigated to ensure reliable supply of poppy and opium for China.[22] By 1850, the Asian opium trade created nearly 1,000 square kilometers of poppy farms in India in its fertile Ganges plains, which increased to over 200.000 hectares by 1900. This diversion of food crop land to cash crop use, state scholars, led to massive famines over the 1850 to 1905 period.[23][24]\r\n\r\nMajor irrigation canals were built after millions of people died each in a series of major famines in the 19th century in British India.[8][24] In 1900, British India (including Bangladesh and Pakistan) had about 13 million ha under irrigation. In 1901 the Viceroy, Lord Curzon, appointed a Commission chaired by Sir Colin Scott-Moncrieff to draw up a comprehensive irrigation plan for India. In 1903 the Commission\'s report recommended irrigation of an additional 2.6 million hectares. By 1947, the irrigated area had increased to about 22 million ha. In Northwestern British India region alone, with the colonial government\'s effort, 2.2 million hectares of previously barren land was irrigated by 1940s, most of which is now part of Pakistan. Arthur Cotton led some irrigation canal projects in the Deccan peninsula, and landmarks are named after him in Andhra Pradesh and Tamil Nadu. However, much of the added irrigation capacity during the colonial era was provided by groundwater wells and tanks, operated manually', '8Unit-irrigation.mp4', 0, 'Unit - 8', NULL, 'Irrigation In India'),
(42, 1, 3, 22, '1573195616_minerals.hi.png', 'Abiotic resources are obtained from the non-living and non-organic material. Some of the resources, like water and air, are renewable. Other resources like minerals are non-renewable and exhaustible because they cannot be regenerated. Minerals have many categories like metallic, non-metallic and minor minerals.\r\n\r\nMetallic minerals\r\nMetallic minerals are the minerals which contain one or more metallic elements. They occur in rare, naturally formed concentrations known as mineral deposits. Metallic minerals available from India are zinc, iron ore, manganese ore, gold, bauxite, silver, lead, tin, copper and chromite.[19]\r\n\r\nCopper\r\nMain article: Copper production in India\r\n\r\n1st-century B.C. copper coin signifies the usage of copper in India since ancient times.\r\nCopper has been used since ancient times. Details of copper mining and metallurgy are available in ancient works like Arthashastra. Copper is mainly used in industrial applications, electrical/electronic equipment and Consumer products such as utensils. Major resources of copper are available at Rajasthan, Madhya pradesh and Jharkhand. As of 2010, India has the world\'s largest copper reserve beating Russia. It is called Mihid and has about 10,000 workers to this day. .[20] India is one of the 20 major copper producers. In 2008, India produced 7,10,000 tonnes of copper.[21] Hindustan Copper Limited, a public sector company, is the only producer of primary refined copper. Post-pillar method and blast hole stoping method are used for mining. Some of the domestic demand is met through scrap recycling. In India, copper scrap is recycled through direct melting, which is a hazardous process.[22]\r\n\r\nZinc\r\nZinc is a bluish-white, lustrous, diamagnetic metal. It is also a fair conductor of electricity. References to medicinal uses of zinc are present in the Charaka Samhita. Ancient zinc smelting technique was found at a zinc production site in Zawar, Rajasthan. Zinc is recovered from a number of different zinc ores. The types of zinc ores include sulfide, carbonate, silicate and oxide.[23] It is used in corrosive resistant coatings for iron and steel, and in the automotive, electrical and machinery industries. India is the World\'s fourth largest zinc reserve as in 2013.[24] Hindustan Zinc Limited is the main producer of zinc in India. Most of the resources are available in Rajasthan. A minor amount of resources are available in Andhra Pradesh, Madhya Pradesh, Bihar and Maharashtra states.[23]\r\n\r\nIron ore\r\nIndia is the world\'s third biggest exporter of iron ore as of 2013.[5] As of 2010, India had 27 billion tonnes or resource (including hematite and magnetite). The major amount of hematite is found in Orissa, Jharkhand, Chhattisgarh, Karnataka and Goa. Minor amounts of hematite are found in Andhra Pradesh, Assam, Bihar, Maharashtra, Madhya Pradesh, Meghalaya, Rajasthan and Uttar Pradesh. Most magnetite is found in Karnataka, Andhra Pradesh, Rajasthan and Tamil Nadu. Minor amounts of magnetite are found in Assam, Bihar, Goa, Jharkhand, Kerala, Maharashtra, Meghalaya and Nagaland. Mining is done by the opencast method. Iron ore is mainly used for manufacturing of pig iron, sponge iron and steel. It is also used in coal washeries, cement and glass industries.[25] Public sector companies like National Mineral Development Corporation and Steel Authority of India contribute to 25% of the total production. Private companies including Tata Steel provide major contribution.[26]\r\n\r\nChromite\r\nChromite is an oxide of chromium and iron. It is the only commercial source of chromium. As of 2010, India had 200 million tonnes of resource. Major amount of resources are available from Orissa (Cuttack and Jajpur districts). Minor amount of resources are available from Manipur, Nagaland, Karnataka, Jharkhand, Maharashtra, Tamil Nadu and Andhra Pradesh.[27] In 2009-2010, India produced 3.41 million tonnes and ranked second in world production.[28] It is mostly mined by opencast method. Chromium provides additional strength to the alloys and it is resistant to corrosion, so it is mainly used in metallurgical applications. It can withstand sudden temperature changes, so it is used in refractories. It is also used in chemical applications.[27]\r\n\r\nNon-metallic minerals\r\nNon-metallic minerals are those which do not yield new products on melting. They are generally associated with sedimentary rocks. Non-Metallic minerals available from India are phosphorite, dolomite, gypsum, garnet, wollastonite, vermiculite, ochre, perlite, bentonite, asbestos, cadmium, felspar, soapstone, kaolin, sillimanite, limestone, diatomite, pyrophyllite, fluorite, vanadium, dunite, ilmenite, gallium and Zircon[29]\r\n\r\n\r\nAlmandine (garnet group) from Rajasthan\r\nGarnet group\r\nIt is a group of complex silicate minerals and has similar chemical compositions. There are three groups of garnet - aluminum-garnet group, chromium-garnet group, and iron-garnet group. The minerals in aluminium-garnet group are almandine, grossularite, pyrope, and spessartine. The mineral in Iron-garnet group is andradite. The mineral in chromium-garnet group is uvarovite. Garnet group minerals occur in different rock types.[30] It is a hard substance. It is resistant to chemical exposure. It is used as a semi-precious stone and also in abrasives, sand blasting, water filtration materials and water jet cutting. Garnets are available in Andhra Pradesh, Chhattisgarh, Jharkhand, Kerala, Orissa, Rajasthan and Tamil Nadu. It is also found in beach sands of Kerala, Orissa and Tamil Nadu states.[31] In 2007-08, India produced 8,73,000 tonnes.[32]\r\n\r\nWollastonite\r\nIt is a meta-silicate of calcium. It is mostly white in color and occurs as bladed or needle like crystals. In 2010, India had 16 million tonnes of resource. Most of the deposits are available in Rajasthan (Dungarpur, Pali, Sirohi and Udaipur districts). Minor amount of deposits are found in Gujarat and Tamil Nadu.[33] It is mainly used in ceramic industries and metallurgical applications. It is also used as a filler in wall tiles, paint, rubber and plastic. India is one of the largest reserves. In 2011, India produced 150,000 tons.[34] It is mined by opencast method. It is also used as a substitute for short-fibre asbestos in brake-linings. Central Building Research Institute has found that wollastonite can be used as substitute for chrysotile asbestos in cement products.[33]\r\n\r\nSillimanite group\r\n\r\nSillimanite from Orissa\r\nIt is a group of metamorphic minerals - sillimanite, kyanite and andalusite. These are polymorphs of alumino-silicate. These are formed under high-pressure and high-temperature conditions. The three minerals are calcined to form mullite. Mainly used as refractory materials.[35] As of 2010, India had 66 million tonnes of sillimanite, 100 million tonnes of Kyanite and 18 million tonnes of Andalusite as a resource. Most of the resources are found in Tamil Nadu, Orissa, Uttar Pradesh, Andhra Pradesh, Kerala and Assam. A minor amount of resources are found in Jharkhand, Karnataka, Madhya Pradesh, Maharashtra, Meghalaya, Rajasthan and West Bengal. Granular sillimanite is available in beach sands of South India. Sillimanite refractory bricks are used in steel, glass and petrochemical industries.[36] In 2004, India produced 14,500 tonnes of sillimanite and 6200 tonnes of kyanite.[37]\r\n\r\nIlmenite\r\nIt is a compound of iron and titanium. It will be iron-black or steel-gray in color. It is a non-toxic material used in biomedical substances. Institute of Minerals and Materials Technology has developed an environmentally friendly technology for processing ilmenite.[38] It is also used in production of titanium dioxide pigment. It is available in Kerala, Tamil Nadu and Orissa. Mining is done at Chavara, Chatrapur, Aluva and Manavalakurichi by Indian Rare Earths limited.[39] As of 2013, India has 21% of the world\'s reserves and constitutes 6% of the world\'s production.[40]\r\n\r\nPyrophyllite\r\nIt is a hydrous alumino-silicate. It is chemically inert, has high melting point and low electrical conductivity. It is used in refractories, foundry dressings, pesticides, ceramics and rubber. It is available as hydrothermal deposits.[41] The physical and optical properties are pyrophyllite are similar to talc. It is also used in electrical insulators, sanitary-ware and in the glass industry. As of 2010, India had 56 million tonnes of this resource. Most of the resources are found in Madhya Pradesh (Chhatarpur, Tikamgarh and Shivpuri districts). The remaining resources are found in Orissa, Uttar Pradesh, Andhra Pradesh, Maharashtra and Rajasthan. In 2010, India produced 1.5 million tonnes.[42]\r\n\r\nMinor minerals\r\n\r\nQuartzite rocks in North Coastal Andhra Pradesh\r\n\r\nWhite marble rocks in Madhya Pradesh\r\nMinor minerals available are building stone, brick earth, quartzite, marble, granite, gravel, clay and sand. These are mainly used in building constructions.[19] Environmental impact of mining these minerals was significant over a period of time even the area was small. Impacts were increasing water scarcity, damage to river beds and adverse effects on biodiversity. So from 2012 onwards, mining of these minerals are to be done after clearance from the Ministry of Environment and Forests. [43]\r\n\r\nMarble\r\nMarble is a metamorphosed limestone formed by re-crystallization. It is available in different colours and textures. Marble deposits are available in many states of India.[44] It has been used in India for a long time. It was used in construction of Temples, Tombs and Palaces. Now it is also used for flooring in homes and offices. It is preferred for flooring because of its durability and water resistance.[45] Marbles which are economically important are available in Rajasthan, Gujarat, Haryana, Andhra Pradesh and Madhya Pradesh. As of 2010, there was 1931 million tonnes of resource, including all grades of marble. Based on the chemical composition, types of Marble available are Calcite, Dolomitic, Siliceous Limestone, Serpentine and Travertine marbles. Other than construction, it is used in Paint and Agricultural lime.[44]\r\n\r\nNuclear\r\nIndia\'s proven nuclear reserves include uranium and thorium.\r\n\r\nUranium\r\nIn Nalgonda District, the Rajiv Gandhi Tiger Reserve (the only tiger project in Telangana) has been forced to surrender over 3,000 sq. kilometres to uranium mining, following a directive from the Central Ministry of Environment and Forests.[46]\r\n\r\nIn 2007, India was able to extract 229 tonnes of U3O8 from its soil.[47] On 19 July 2011, Indian officials announced that the Tumalapalli mine in Andhra Pradesh state of India could provide more than 170,000 tonnes of uranium, making it as the world\'s largest uranium mine. Production of the ore is slated to begin in 2012.[48]\r\n\r\nThe Department of Atomic Energy (DAE) recently discovered that the upcoming mine in Tumalapalli has close to 49,000 tonne of uranium reserves. This could help India\'s nuclear power aspirations as it is three times the original estimate of the area\'s deposits.[49]\r\n\r\nThorium\r\nThe IAEA\'s 2005 report estimates India\'s reasonably assured reserves of thorium at 319,000 tonnes, but mentions recent reports of India\'s reserves at 650,000 tonnes.[50] A government of India estimate, shared in the country\'s Parliament in August 2011, puts the recoverable reserve at 846,477 tonnes.[51] The Indian Minister of State V. Narayanasamy stated that as of May 2013, the country\'s thorium reserves were 11.93 million tonnes (monazite, having 9-10% ThO2[52]), with a significant majority (8.59 Mt; 72%) found in the three eastern coastal states of Andhra Pradesh (3.72 Mt; 31%), Tamil Nadu (2.46 Mt; 21%) and Odisha (2.41 Mt; 20%).[53] Both the IAEA and OECD appear to conclude that India may possess the largest share of world\'s thorium deposits.', '9Unit-Minerals.mp4', 0, 'Unit - 9', NULL, 'Mineral In India'),
(43, 1, 3, 23, '1573196081_Industry-260x300.png', 'During the first term of the NDA regime, as per World Bank, the GDP growth in India was 6.6% in 2017. In the short term, the growth was adversely impacted by Modi government measures like demonetisation and introduction of GST. On the other hand, World Bank has projected its growth forecast at 7.5% for FY2019-20 and retained the same forecast for the next two years as well. This shows a strong industrial outlook for India.\r\n\r\nAccording to the Index of Industrial Production (IIP), our country’s industrial output grew at 3.4% on YoY basis in April 2019. The estimated contribution of various sectors to the GDP is agriculture 16%, industry 30% and services 54% respectively. Promoting industrial growth through infrastructure development, easy access to credit, and through research and skill development measures remain the government’s priority, as evidenced in ‘Make in India’ initiative.\r\n\r\nAs far as industries are concerned, 12 out of 23 groups in the manufacturing sector have performed very well during May 2019. Some industries have shown positive growth like wood and products of wood and cork. The best possible result has come from the manufacture of articles of straw and plating materials. Its growth rate is 24.8 percent; then comes the food products at 15.9 percent and computer, electronic and optical products at 9.4 percent.\r\n\r\nIn the present scenario, experts suggest that right now defence is one area that can significantly revive the stalled industrial scene of India, especially the manufacturing sector. If the ‘Make in India’ programme of Modi is to materialise, then this is the most obvious bet.\r\n\r\nAccordingly, in the 2019-20 budget, Rs 3.19 lakh crore money has been allocated to the defence sector. This was mentioned by the Finance Minister Nirmala Sitharaman, while presenting her maiden budget in Modi 2.0 government. She further stated that, “This is a national priority.” So, defence equipments which are not manufactured in the country would be exempted from the basic duty. Indian air force requires to replace its old Soviet-era aircrafts. Indian navy has also planned to have dozen submarines to cope with the presence of the Chinese navy in the Indian ocean.\r\n\r\nCan India Be Industrially Self-Sufficient?\r\nIndustrialists like Ratan Tata opine that in the last few years, India has been able to significantly increase its capacities to achieve self-sufficiency from an industrial point of view. He says with the introduction of the liberal economic policies from 1991 onwards, the Indian economy is in much better health than before. Problems such as License Raj are no more, and new domains of business are opening on a regular basis. This is especially true of infrastructure sector, as well as other areas that were previously the sole preserve of the government.\r\n\r\nIndian industrial sector has been forced to restructure itself and thus has become significantly modern than before. There is more focus on reducing costs of production and achieving the levels of technological competence that can help one stay globally relevant and deal with cut-throat competition.\r\n\r\nHe feels that companies that were previously used to monopolising certain areas of business because of protective legislations will find it hard to survive in the new environment. However, he feels that companies that are willing to change with the need of time will be able to sustain and do well in the days ahead.\r\n\r\nIndustrial Rules and Policies in India\r\nIf the industrial sector in India has to flourish, then there has to be sufficient foreign capital in the country. However, as many foreign firms would attest, it is not that easy to invest in India. The stock prices of some companies witness volatility because of their issues with the ongoing tax regime. However, the Modi government is attempting to make things better for international companies interested in investing in India. Foreign Direct Investment (FDI) rules have been amended significantly so as to allow interested Non-Resident Indians (NRIs) to invest in India.\r\n\r\nA non-resident entity can invest in India, subject to the FDI Policy except in those sectors/activities which are prohibited. Special dispensation is available to companies and firms incorporated abroad and owned by NRIs.\r\n\r\nFIIs and FPIs can invest in the capital of an Indian company under the Portfolio Investment Scheme (subject to sectoral or statutory caps). It also stated recently that in sectors where there is provision for automatic rules for FDI, foreign companies need not get permission from the Foreign Investment Promotion Board (FIPB) if they want to merge with a company in India or just acquire it. In certain sectors, FDI is permitted up to 100% on the Automatic route. These include mining and exploration, coal and lignite, oil and natural gas fields, DTH and cable networks, airports etc.\r\n\r\nThis information has been revealed by a circular emanating from the Department of Industrial Policy and Promotion (Chapter 5: Sector Specific Conditions on FDI, Consolidated FDI Policy 2017). The same circular has also stated that in cases where automatic rules are applicable, one does not need to take government’s permission for issuing employee stock options. It is expected that such initiatives will increase the levels of credibility of the FDI policy and make India a far more attractive business destination for international investors.\r\n\r\nImports and Exports- Success Rate\r\nIndia has not been doing well in its Balance of Trade as can be gauged from the fact that trade deficit in 2018-19 has gone up to US$ 76.42 billion, as against $162.05 in the previous year. The difference between exports and imports has been narrowed to US$10.89 billion as compared to US$13.51 billion in March 2018.\r\n\r\n\r\nExports rose to 11% in March 2019. It is possible due to higher growth in pharmaceuticals, chemicals, petroleum products and engineering sector. In March 2019, exports hit US$32.55 billion compared to US$29.32 billion in the same month last year.\r\n\r\nThe healthy growth has come at a time when World Trade Organisation (WTO) decreased global forecast of merchandise trade from 3% in 2018 to 2.6% in 2019. This was stated by Ganesh Gupta, president, FIEO. He further added that it was possible due to the hard work put in by the exporting community. \r\n\r\nOil imports in March 2019 were $ 11.75 billion, and it was 5.55% more than the same month last year. However, imports of gold grew 40% more at $ 22.74 billion, as against the same month last year.\r\n\r\nThe US is India\'s major exporting ally. It buys almost one-fifth of India\'s exports. Country\'s IT services exports to the US have touched $63.51 billion in 2018. The Prime Minister, speaking on the fifth meeting of NITI Aayog\'s governing council recently, stressed that the export sector is important for increasing per capita income and generating employment.\r\n\r\nMajor Industries in India\r\nTextile Industry\r\nThis industry covers a wide range of activities ranging from generation of raw materials such as jute, wool, silk and cotton to greater value-added goods such as readymade garments prepared from different types of manmade or natural fibres. Textile industry provides job opportunity to over 45 million (2017-2018) individuals, thus playing a major role in the nation\'s economy. It has 2 per cent share in GDP and shares 15% of the gross export income in 2017-2018.\r\n\r\nFood Processing Industry\r\nFood Processing Industry\'s contribution in the Indian economic growth is vital. The government of India has been encouraging this industry. India\'s food and grocery market is the sixth largest in the world, and contributes 70% of the sales. So, this industry is called a \'Sunrise Sector\'. The important thing is that 1.85 million people work in this industry. It is estimated to expand by 37 million by 2025. Its contribution is around 14% of manufacturing GDP and 13% of India\'s total food exports. Some of the key players in India\'s food processing industry are PepsiCo, Glaxo-SmithKline (GSK), Mapro Foods, Dabur, Parle, Nestlé, Frito-Lay, and Haldiram.\r\n\r\nChemical Industry:\r\nIndia is the third largest producer of chemicals in Asia. Indian Chemical industry generates around 80,000 commercial goods ranging from plastic to toiletries and pesticides to beauty products. It is regarded as the oldest domestic sector in India. In 2016-17, Alkali chemicals had the largest share in the Chemical industry in India which is approximately 69% share in the total production. Production of polymers account for around 59% of total production of basic major petrochemicals.\r\n\r\nThe future of petrochemical market in India seems to be bright. It is expected to go up at 10 per cent over the next five years, to touch US$ 100 billion by 2022. Market for crop protection chemicals in India is expected to reach US$ 7.5 billion by 2019. The government schemes and high FDI inflows have proved beneficial for the growth of chemical industry. The government has announced to upgrade the technology and simplify FDI procedure for the rapid growth of this sector. The government has also granted tax and allowed duty reductions. Import duty is relaxed on various inputs including coal, oil, naphtha etc.\r\n\r\nCement Industry:\r\nIndian cement industry is second largest in the world. India has 10 large cement plants governed by the different State governments. Besides this, India has 115 big cement plants and around 300 small cement plants. The big cement plants have installed capacity of 148.28 million tonnes per annum whereas the mini cement plants have the total capacity of 11.10 million tonnes per annum. Cement demand is going to touch 550-600 million tonnes per annum by 2025. At present, Indian cement industry is producing 280 million tonnes for meeting its domestic demand and 5 million tonnes for the exports. Ambuja cement, J K Cement, Aditya Cement, L & T Cement and Ultratech Cement are some of the major cement companies in India.\r\n\r\nSteel Industry:\r\nIndian Steel Industry is a 400 years old sector. As per the 2018 Report, India ranked second in steel production. It produces 106.5 MT in 2018. The boost in the Indian steel due to availability of raw material in abundance and cost-effective labour. Indian steel consumption is expected to touch 103 million tonnes in 2019, as against 96 million tonnes in 2018.\r\n\r\nThe key players in Steel Industry are Steel Authority of India (SAIL), Bokaro Steel Plant, Rourkela Steel Plant, Durgapur Steel Plant and Bhilai Steel Plant.\r\n\r\n\r\nSoftware Industry:\r\nSoftware Industry in India has registered a massive expansion in the last 10 years. India\'s IT sector growth has reached US$ 181 billion in 2018-19. Exports from the IT sector have gone up to US$ 137 billion in FY19 while domestic revenues (including hardware) advanced to US$ 44 billion. The IT industry is expected to maintain growth rate of over 9 per cent. \r\n\r\nMining Industry:\r\nThe GDP contribution of the mining industry is 2.2% to 3% only but going by the GDP of the total industrial sector it contributes around 10% to 11%. Even mining done on small scale contributes 6% to the entire cost of mineral production. Indian mining industry provides job opportunities to around 0.7 million individuals. \r\n\r\nPetroleum industry\r\nstarted its operations in the year 1867 and is considered as one of the oldest Indian industries. India is one of the most flourishing oil markets in the world and, in the last few decades, has witnessed the expansion of top national companies like ONGC, HPCL, BPCL and IOC. India ranked third in energy and oil consumption in the world after China and the US. It is the fourth largest importer of Liquefied Natural Gas (LNG).\r\nFisheries in India\r\nIndia is third largest producer of fish in the world. Fish industry is also known as \'Blue Revolution\'. This industry is important for India because it provides job opportunities and is one of the best sources of nutritional food for local population. Fisheries in India are still developing, so it is a good source of earning foreign exchange too. The fishery sector fetches 1.21% of the total GDP and 5.37% of the GDP from agriculture sector.', '10Unit-Industires.mp4', 0, 'Unit - 10', NULL, 'Industries In India'),
(44, 1, 3, 24, '1573197529_1551178309.jpg', 'Transport in India consists of transport by land, water and air. Public transport remains the primary mode of road transport for most Indian citizens, and India\'s public transport systems are among the most heavily used in the world.\r\n\r\nIndia\'s road network is the second-largest and one of the busiest in the world,[1] transporting 8.225 billion passengers and over 970 million tonnes of freight annually, as of 2015.[2] India\'s rail network is the fourth largest and second busiest in the world, transporting 8.107 billion passengers and over 1.108 billion tonnes of freight annually, as of 2017.[3] Aviation in India, broadly divided into military and civil aviation, is the fastest-growing aviation market in the world (IATA data) and Bangalore with 65% national share is the largest aviation manufacturing hub of India.[4] India\'s waterways network in the form of rivers, canals, backwaters and creeks, is the ninth largest waterway network in the world. Freight transport by waterways is highly under-utilised in India with the total cargo moved (in tonne kilometres) by inland waterways being 0.1 percent of the total inland traffic in India.[5]\r\n\r\nIn total, about 21 percent of households have two wheelers whereas 67.7 percent of households in India have cars/vans as per the 2011 Census.[6][7] The automobile industry in India is currently rapidly growing with an annual production of over 4.6 million vehicles,[8] with an annual growth rate of 10.5%[6] and vehicle volume is expected to rise greatly in the future.[9]\r\n\r\nThe number of deaths caused by traffic is among the highest in the world and increasing.[10][11] The demand for transport infrastructure and services has been rising by around 10% a year[1] with the current infrastructure being unable to meet these growing demands. According to Goldman Sachs, India will need to spend US$1.7 trillion on infrastructure projects over the next decade to increase economic growth.\r\n\r\n[32] As per 2017 estimates, the total road length in India is 5,603,293 km (3,481,725 mi);[33] making the Indian road network the second largest road network in the world after the United States. At 0.66 km of highway per square kilometre of land the density of India\'s highway network is higher than that of the United States (0.65) and far higher than that of China\'s (0.16) or Brazil\'s (0.20).[1]\r\n\r\nIndia has a network of National Highways connecting all the major cities and state capitals, forming the economic backbone of the country. As of 2013, India has a total of 70,934 km (44,076 mi) of National Highways, of which 1,205 km (749 mi) are classified as expressways.[34] Although India has more than 35,000 kms of four or more lane highways of international quality standards, but without access control (entry/exit control), they are not called as expressways but simply as highways.\r\n\r\nAs per the National Highways Authority of India, about 65% of freight and 80% passenger traffic is carried by the roads. The National Highways carry about 40% of total road traffic, though only about 2% of the road network is covered by these roads.[34] Average growth of the number of vehicles has been around 10.16% per annum over recent years.[34]\r\n\r\nUnder National Highways Development Project (NHDP), work is under progress to equip national highways with at least four lanes; also there is a plan to convert some stretches of these roads to six lanes.[35] All national highways are metalled, but very few are constructed of concrete, the most notable being the Mumbai-Pune Expressway. In recent years construction has commenced on a nationwide system of multi-lane highways, including the Golden Quadrilateral and North-South and East-West Corridors which link the largest cities in India.\r\n\r\nIn 2000, around 40% of villages in India lacked access to all-weather roads and remained isolated during the monsoon season.[1][36] To improve rural connectivity, Pradhan Mantri Gram Sadak Yojana (Prime Minister\'s Rural Road Program), a project funded by the Central Government with the help of World Bank, was launched in 2000 to build all-weather roads to connect all habitations with a population of 500 or above (250 or above for hilly areas).[36][37]\r\n\r\nGenerally, traffic in most of the cities in India moves slowly, where traffic jams and accidents are very common, but in some cities like Chandigarh, wide roads and less vehicles contribute to lesser traffic.[38][39] India has very poor records on road safety—around 90,000 people die from road accidents every year.[40] At least 13 people die every hour in road accidents in the country, also in the year 2007 road accidents claimed more than 130,000 lives, overtaking China.[41][42] A Reader\'s Digest study of traffic congestion in Asian cities ranked several Indian cities within the top ten for worst traffic.', '11Unit-TRANSPORT.mp4', 0, 'Unit - 11', NULL, 'Transport In India'),
