(48, 1, 5, 49, '1579085673_parliament-of-india-clip-arts-parliament-of-india.png', 'The Constitution of India is the supreme law of India. The document lays down the framework demarcating fundamental political code, structure, procedures, powers, and duties of government institutions and sets out fundamental rights, directive principles, and the duties of citizens. It is the longest written constitution of any country on earth. B. R. Ambedkar, chairman of the drafting committee, is widely considered to be its chief architect.\r\n\r\nIt imparts constitutional supremacy (not parliamentary supremacy, since it was created by a constituent assembly rather than Parliament) and was adopted by its people with a declaration in its preamble Parliament cannot override the constitution.', 'Constitutional Development ( stage - 1)_1.mp4', 0, 'Unit - 1', NULL, 'Constitutional Development '),
(49, 1, 5, 49, '1579086036_1579085673_parliament-of-india-clip-arts-parliament-of-india.png', 'It was adopted by the Constituent Assembly of India on 26 November 1949 and became effective on 26 January 1950. The constitution replaced the Government of India Act, 1935 as the country\'s fundamental governing document, and the Dominion of India became the Republic of India. To ensure constitutional autochthony, its framers repealed prior acts of the British parliament in Article 395.India celebrates its constitution on 26 January as Republic Day.\r\n\r\nThe constitution declares India a sovereign, socialist, secular, democratic republic, assuring its citizens justice, equality and liberty, and endeavours to promote fraternity. The original 1950 constitution is preserved in a helium-filled case at the Parliament House in New Delhi. The words \"secular\" and \"socialist\" were added to the preamble in 1976 during the emergency.\r\n\r\n\r\n', 'constitutional Development ( stage -2)_1.mp4', 0, 'Unit - 1', NULL, 'Constitutional Development Part -2 '),
(50, 1, 5, 49, '1579086302_parliament-of-india-png-3.png', '', 'Constitutional Devlopment (stage -3)_1.mp4', 0, 'Unit - 1', NULL, 'Constitutional Development - 3'),
