(56, 1, 6, 62, '1579093057_1573040837_Andhra_Pradesh_topo_leer.png', 'Andhra Pradesh is bound on the north by Orissa and Madhya Pradesh, on the West by Maharashtra and Karnataka, on the south by Tamil Nadu and on the east by Bay of Bengal, with a coastline of 974 km. Krishna, Godavari and Pennar are the main rivers of the state. After Vindhyas, the southern India starts. So Andhra Pradesh is the link between north and south of India. The state is broadly divided into three major regions viz. the Circars or Coastal districts, which are well developed and enjoy greater degree of affluence than the other regions, Rayalaseema which is close to the coastal districts and where rainfall is less than coastal districts and drought conditions prevail sometimes, and the Telengana region of the former princely state of Nizam\'s of Hyderabad, which is close to Maharashtra\'s Marathwada region and some parts of Karnataka. The rainfall in the area is not much and the forest cover is, therefore, thin while the rocks are also porous in nature.\r\n\r\nGeologically the state consists of igneous, metamorphic & sedimentary formations. Peninsular Geneissic Complex consisting of Archaean Group covered by complex group of Gneisses and Schists. The Precambrian Sedimentary formation of the Cuddapah Super Group, Pakhal Super Group and Kumool Group are found in Kurnool, Cuddapah, Ananthapur, Chittoor, Nalgonda, Mahabubnagar, Guntur, Krishna and Khammam Districts. The Bhima’s are found in the western part of Rangareddy District, the Gondwana Super Group in Khammam, Warangal, Karimnagar and Adilabad Districts. The Deccan Traps are found in Rangareddy, Nizamabad, Medak and Adilabad Districts. Outcrops of Tertiary formations are found in East and West Godavari and Vishakapatnam Districts and the Quaternary sediments as thick blankets of alluvium are found in the river valleys, deltas and along the East Coast.', 'ap geography unit - 1_1.mp4', 0, 'Unit - 1', NULL, 'AP Geography');
INSERT INTO `chapter` (`chapter_id`, `class_id`, `subject_id`, `chapter_id_name`, `chapter_image`, `description`, `video_name`, `popular_video`, `chapter_name`, `popular_video_image`, `video_title`) VALUES
(57, 1, 6, 63, '1579093748_rsz_clust-map.png', 'Andhra Pradesh, state of India, located in the southeastern part of the subcontinent. It is bounded by the Indian states of Tamil Nadu to the south, Karnataka to the southwest and west, Telangana to the northwest and north, and Odisha to the northeast. The eastern boundary is a 600-mile (970-km) coastline along the Bay of Bengal. Telangana was a region within Andhra Pradesh for almost six decades, but in 2014 it was carved off to form a separate state. The capital of both Andhra Pradesh and Telangana is Hyderabad, in west-central Telangana.\r\n\r\nThe state draws its name from the Andhra people, who have inhabited the area since antiquity and developed their own language, Telugu. Andhra Pradesh came into existence in its present form in 1956 as a result of the demand of the Andhras for a separate state. Although it is primarily agricultural, the state has some mining activity and a significant amount of industry. Area 106,204 square miles (275,068 square km). Pop. (2011) 84,665,533.\r\n\r\nLand\r\nRelief, drainage, and soils\r\nThe state has three main physiographic regions: the coastal plain to the east, extending from the Bay of Bengal to the mountain ranges; the mountain ranges themselves, the Eastern Ghats, which form the western flank of the coastal plain; and, in the southwest, the plateau to the west of the Ghats. The coastal plain, also known as the Andhra region, runs almost the entire length of the state and is watered by several rivers, flowing from west to east through the hills into the bay. The deltas formed by the most important of those rivers—the Godavari and the Krishna—make up the central part of the plains, an area of fertile alluvial soil.', 'ap geography unit - 2_1.mp4', 0, 'Unit - 2', NULL, 'AP Land & It\'s Boundaries'),
